('5', 'Privacy Policy', '<p><strong>Privacy Policy&nbsp; </strong></p>\r\n\r\n<p>Last updated: October 07, 2022</p>\r\n\r\n<p>This Privacy Policy describes Our policies and procedures on the collection, use and disclosure of Your information when You use the Service.</p>\r\n\r\n<p>www.spdstores.com (The Site) and SPDStores (The application) is owned by Sri Purna Departmental Stores. We use Your Personal data to provide and improve the Service. By using the Service, You agree to the collection and use of information in accordance with this Privacy Policy.</p>\r\n\r\n<p>Definitions&nbsp;</p>\r\n\r\n<p>For the purposes of this Privacy Policy:</p>\r\n\r\n<p>* Account means a unique account created for You to access our Service or parts of our Service.</p>\r\n\r\n<p>* Application means the software program provided by the Company (Colourmoon Technologies) downloaded by You on any electronic device, named SPDSTORES</p>\r\n\r\n<p>* Company (referred to as either &quot;the Company&quot;, &quot;We&quot;, &quot;Us&quot; or &quot;Our&quot; in this Agreement) refers to Sri Purna Departmental Stores, 16-1-25, Main Road, Tenali, 522201.</p>\r\n\r\n<p>* Device means any device that can access the Service such as a computer, a mobile phone or a digital tablet.</p>\r\n\r\n<p>* Personal Data is any information that relates to an identified or identifiable individual.</p>\r\n\r\n<p>* Service refers to the Application.</p>\r\n\r\n<p>* Service Provider means any natural or legal person who processes the data on behalf of the Company. It refers to third-party companies or individuals employed by the Company to facilitate the Service, to provide the Service on behalf of the Company, to perform services related to the Service or to assist the Company in analysing how the Service is used.</p>\r\n\r\n<p>* Usage Data refers to data collected automatically, either generated by the use of the Service or from the Service infrastructure itself (for example, the duration of a page visit).</p>\r\n\r\n<p>* You means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</p>\r\n\r\n<p><strong>Collecting and Using Your Personal Data&nbsp; </strong></p>\r\n\r\n<p><strong>Types of Data Collected&nbsp; </strong></p>\r\n\r\n<p><strong>Personal Data&nbsp; </strong></p>\r\n\r\n<p>While using Our Service, We may ask You to provide Us with certain personally identifiable information that can be used to contact or identify You.</p>\r\n\r\n<p>Personally identifiable information may include, but is not limited to:</p>\r\n\r\n<p>* Email address</p>\r\n\r\n<p>* First name and last name</p>\r\n\r\n<p>* Phone number</p>\r\n\r\n<p>* Address, State, Province, ZIP/Postal code, City</p>\r\n\r\n<p>* Usage Data</p>\r\n\r\n<p><strong>Usage Data </strong>&nbsp;</p>\r\n\r\n<p>Usage Data is collected automatically when using the Service.</p>\r\n\r\n<p>Usage Data may include information such as Your Device&#39;s Internet Protocol address (e.g. IP address), browser type, browser version, the pages of our Service that You visit, the time and date of Your visit, the time spent on those pages, unique device identifiers and other diagnostic data.</p>\r\n\r\n<p>When You access the Service by or through a mobile device, We may collect certain information automatically, including, but not limited to, the type of mobile device You use, Your mobile device unique ID, the IP address of Your mobile device, Your mobile operating system, the type of mobile Internet browser You use, unique device identifiers and other diagnostic data.</p>\r\n\r\n<p>We may also collect information that Your browser sends whenever You visit our Service or when You access the Service by or through a mobile device.</p>\r\n\r\n<p>Information Collected while Using the Application&nbsp;</p>\r\n\r\n<p>While using Our Application, in order to provide features of Our Application, We may collect, with Your prior permission:</p>\r\n\r\n<p>*Information regarding your location:</p>\r\n\r\n<p>We use this information to provide features of Our Service, to improve and customize Our Service. The information may be uploaded to the Company&#39;s servers and/or a Service Provider&#39;s server or it may be simply stored on Your device.</p>\r\n\r\n<p>You can enable or disable access to this information at any time, through Your Device settings.</p>\r\n\r\n<p><strong>Use of Your Personal Data&nbsp; </strong></p>\r\n\r\n<p>The Company may use Personal Data for the following purposes:</p>\r\n\r\n<p>&nbsp;* To provide and maintain our Service, including to monitor the usage of our Service.</p>\r\n\r\n<p>&nbsp;* To manage Your Account: to manage Your registration as a user of the Service. The Personal Data You provide can give You access to different functionalities of the Service that are available to You as a registered user.</p>\r\n\r\n<p>* For the performance of a contract: the development, compliance and undertaking of the purchase contract for the products, items or services You have purchased or of any other contract with Us through the Service.</p>\r\n\r\n<p>* To contact You: To contact You by email, telephone calls, SMS, or other equivalent forms of electronic communication, such as a mobile application&#39;s push notifications regarding updates or informative communications related to the functionalities, products or contracted services, including the security updates, when necessary or reasonable for their implementation.</p>\r\n\r\n<p>* To provide You with news, special offers and general information about other goods, services and events which we offer that are similar to those that you have already purchased or enquired about unless You have opted not to receive such information.</p>\r\n\r\n<p>* To manage Your requests: To attend and manage Your requests to Us.</p>\r\n\r\n<p>* For business transfers: We may use Your information to evaluate or conduct a merger, divestiture, restructuring, reorganization, dissolution, or other sale or transfer of some or all of Our assets, whether as a going concern or as part of bankruptcy, liquidation, or similar proceeding, in which Personal Data held by Us about our Service users is among the assets transferred.</p>\r\n\r\n<p>* For other purposes: We may use Your information for other purposes, such as data analysis, identifying usage trends, determining the effectiveness of our promotional campaigns and to evaluate and improve our Service, products, services, marketing and your experience.</p>\r\n\r\n<p>We may share Your personal information in the following situations:</p>\r\n\r\n<p>* With Service Providers: We may share Your personal information with Service Providers to monitor and analyse the use of our Service, to contact You.</p>\r\n\r\n<p>* For business transfers: We may share or transfer Your personal information in connection with, or during negotiations of, any merger, sale of Company assets, financing, or acquisition of all or a portion of Our business to another company.</p>\r\n\r\n<p>* With Affiliates: We may share Your information with Our affiliates, in which case we will require those affiliates to honor this Privacy Policy. Affiliates include Our parent company and any other subsidiaries, joint venture partners or other companies that We control or that are under common control with Us.</p>\r\n\r\n<p>* With business partners: We may share Your information with Our business partners to offer You certain products, services or promotions.</p>\r\n\r\n<p>* With other users: when You share personal information or otherwise interact in the public areas with other users, such information may be viewed by all users and may be publicly distributed outside.</p>\r\n\r\n<p>&nbsp; * With Your consent: We may disclose Your personal information for any other purpose with Your consent.</p>\r\n\r\n<p>Retention of Your Personal Data&nbsp;</p>\r\n\r\n<p>The Company will retain Your Personal Data only for as long as is necessary for the purposes set out in this Privacy Policy. We will retain and use Your Personal Data to the extent necessary to comply with our legal obligations (for example, if we are required to retain your data to comply with applicable laws), resolve disputes, and enforce our legal agreements and policies.</p>\r\n\r\n<p>The Company will also retain Usage Data for internal analysis purposes. Usage Data is generally retained for a shorter period of time, except when this data is used to strengthen the security or to improve the functionality of Our Service, or We are legally obligated to retain this data for longer time periods.</p>\r\n\r\n<p>Delete Your Personal Data&nbsp;</p>\r\n\r\n<p>You have the right to delete or request that We assist in deleting the Personal Data that We have collected about You. Our Service may give You the ability to delete certain information about You</p>\r\n\r\n<p>from within the Service.</p>\r\n\r\n<p>You may update, amend, or delete Your information at any time by signing in to Your Account, if you have one, and visiting the account settings section that allows you to manage Your personal information. You may also contact Us to request access to, correct, or delete any personal information that You have provided to Us.</p>\r\n\r\n<p>Please note, however, that We may need to retain certain information when we have a legal obligation or lawful basis to do so.</p>\r\n\r\n<p><strong>Disclosure of Your Personal Data&nbsp; </strong></p>\r\n\r\n<p>Business Transactions&nbsp;</p>\r\n\r\n<p>If the Company is involved in a merger, acquisition or asset sale, Your Personal Data may be transferred. We will provide notice before Your Personal Data is transferred and becomes subject to a different Privacy Policy.</p>\r\n\r\n<p>Law enforcement&nbsp;</p>\r\n\r\n<p>Under certain circumstances, the Company may be required to disclose Your Personal Data if required to do so by law or in response to valid requests by public authorities (e.g. a court or a government agency).</p>\r\n\r\n<p>Other legal requirements</p>\r\n\r\n<p>The Company may disclose Your Personal Data in the good faith belief that such action is necessary to:</p>\r\n\r\n<p>&nbsp; * Comply with a legal obligation</p>\r\n\r\n<p>&nbsp; * Protect and defend the rights or property of the Company</p>\r\n\r\n<p>&nbsp; * Prevent or investigate possible wrongdoing in connection with the Service</p>\r\n\r\n<p>&nbsp; * Protect the personal safety of Users of the Service or the public</p>\r\n\r\n<p>&nbsp; * Protect against legal liability</p>\r\n\r\n<p><strong>Changes to this Privacy Policy&nbsp; </strong></p>\r\n\r\n<p>We may update Our Privacy Policy from time to time. We will notify You of any changes by posting the new Privacy Policy on this page.</p>\r\n\r\n<p>We will let You know via email and/or a prominent notice on Our Service, prior to the change becoming effective and update the &quot;Last updated&quot; date at the top of this Privacy Policy.</p>\r\n\r\n<p>You are advised to review this Privacy Policy periodically for any changes. Changes to this Privacy Policy are effective when they are posted on this page.</p>\r\n\r\n<p><strong>Contact Us</strong></p>\r\n\r\n<p>If you have any questions about this Privacy Policy, You can contact us:</p>\r\n\r\n<p>* By email: sripurnadepartmentalstores@gmail.com</p>\r\n\r\n<p>* By phone number: 8143577577</p>\r\n'),
('6', 'About Us', '<p>Admit that you&#39;re lazy and don&#39;t want to stop at the supermarket on your way home? You have SPDStores, where you may purchase health drinks, snacks, edible oils, laundry supplies, gift articles, kitchen care, bags, and much more. We will deliver within 2 hours, or you can choose a delivery slot whenever and wherever you want.</p>\r\n\r\n<p>We are a departmental store in Tenali with over 32-years of expertise. Jakka Venkata Nageshwara Rao founded the company in 1988. We have now begun providing services to you via the internet. You may use the app/website to explore our merchandise from the comfort of your home at any time, and we&#39;ll deliver right to your door. Through our app/website, you can get groceries, household products, cosmetics, baby care, travel supplies, handbags, and much more.&nbsp; We strive to make our app a pleasant shopping experience for you.</p>\r\n\r\n<p>In our store, major cosmetic beauty brands such as Lakme, Sugar,&nbsp;Coloressence, Renee, Jovees, Dazzler, and Nandini employ professional Beauty Advisors. As a result, we deliver the best services in this field and VIP Industries has certified us as an authorized dealer.</p>\r\n\r\n<p>We are the town&#39;s largest store, with more than 12000 products and over 500 brands, and we offer a wide range of merchandise. We can assure you that once you enter our store, most of your daily requirements will be met. We regularly solicit input from our customers to improve their buying experience. Some of the feedback we received is that because we have such a large store, customers can occasionally pass over certain sections of products, while some require promotional items, and others want to know about all the products we offer. We also receive a lot of phone orders for door-to-door delivery. We developed this program to address all of these concerns by considering them.</p>\r\n\r\n<p>We provide a wide selection of products from trusted brands across a range of categories, including:</p>\r\n\r\n<p>1. Baby care</p>\r\n\r\n<p>2. Personal Care</p>\r\n\r\n<p>3. Household Care</p>\r\n\r\n<p>4. Beverages</p>\r\n\r\n<p>5. Staples</p>\r\n\r\n<p>6. Snacks &amp; Branded Foods</p>\r\n\r\n<p>7. Cosmetics</p>\r\n\r\n<p>8. Kitchen Care</p>\r\n\r\n<p>9.Travel &amp; Backpacks</p>\r\n\r\n<p>10. Hand Bags</p>\r\n\r\n<p>11. Gift articles</p>\r\n'),
