('8', 'Terms & Conditions', '<p>TERMS OF SERVICE AGREEMENT</p>\r\n\r\n<p>LAST REVISION: [20-09-2022]</p>\r\n\r\n<p>PLEASE READ THIS TERMS OF SERVICE AGREEMENT CAREFULLY. BY USING THIS WEBSITE&nbsp;OR ORDERING PRODUCTS FROM THIS WEBSITE&nbsp;YOU AGREE TO BE BOUND BY ALL OF THE TERMS AND CONDITIONS OF THIS AGREEMENT.</p>\r\n\r\n<p>This Terms of Service Agreement (the &quot;Agreement&quot;) governs your use of this website, [spdstores.com], Sri Purna Departmental Stores offer products for purchase on this Website, or your purchase of products available on this Website. This Agreement includes, and incorporates by this reference, the policies and guidelines referenced below. Sri Purna Departmental Stores reserves the right to change or revise the terms and conditions of this Agreement at any time by posting any changes or a revised Agreement on this Website. Sri Purna Departmental Stores will alert you that changes or revisions have been made by indicating on the top of this Agreement the date it was last revised. The changed or revised Agreement will be effective immediately after it is posted on this Website. Your use of the Website following the posting of any such changes or of a revised Agreement will constitute your acceptance of any such changes or revisions. Sri Purna Departmental Stores encourages you to review this Agreement whenever you visit the Website to make sure that you understand the terms and conditions governing the use of the Website. This Agreement does not alter in any way the terms or conditions of any other written agreement you may have with Sri Purna Departmental Stores for other products or services. If you do not agree to this Agreement (including any referenced policies or guidelines), please immediately terminate your use of the Website.</p>\r\n\r\n<p>I. PRODUCTS</p>\r\n\r\n<p>Terms of Offer. This Website offers for sale certain products (the &quot;Products&quot;). By placing an order for Products through this Website, you agree to the terms set forth in this Agreement.&nbsp;</p>\r\n\r\n<p>Customer Solicitation: Unless you direct Sri Purna Departmental Stores sales reps, while they are calling you, of your desire to opt-out from further direct company communications and solicitations, you are agreeing to continue to receive further emails and call solicitations from Sri Purna Departmental Stores.</p>\r\n\r\n<p>Opt-Out Procedure: We provide 2 easy ways to opt out of future solicitations.</p>\r\n\r\n<p>1. You may also choose to opt-out, via sending your email address to [opt-out email].&nbsp;</p>\r\n\r\n<p>2. You may send a written remove request to address: 16-1-25, Main Road, Tenali, Pin code:522201.&nbsp;</p>\r\n\r\n<p>Proprietary Rights. Sri Purna Departmental Stores has proprietary rights and trade secrets in the Products. You may not copy, reproduce, resell or redistribute any Product manufactured and/or distributed by Sri Purna Departmental Stores. Sri Purna Departmental Stores also has rights to all trademarks and trade dress and specific layouts of this webpage, including calls to action, text placement, images and other information.</p>\r\n\r\n<p>Sales Tax. If you purchase any Products, you will be responsible for paying any applicable sales tax.</p>\r\n\r\n<p>II. WEBSITE</p>\r\n\r\n<p>Content; Intellectual Property; Third-Party Links. In addition to making Products available, this Website also offers information and marketing materials. This Website also offers information, both directly and through indirect links to third-party websites, about groceries and fancy products. Sri Purna Departmental Stores does not always create the information offered on this Website; instead, the information is often gathered from other sources. To the extent that Sri Purna Departmental Stores does create the content on this Website, such content is protected by the intellectual property laws of India, foreign nations, and international bodies. Unauthorized use of the material may violate copyright, trademark, and/or other laws. You acknowledge that your use of the content on this Website is for personal, noncommercial use. Any links to third-party websites are provided solely as a convenience to you. Sri Purna Departmental Stores does not endorse the contents on any such third-party websites. Sri Purna Departmental Stores is not responsible for the content of or any damage that may result from your access to or reliance on these third-party websites. If you link to third-party websites, you do so at your own risk.&nbsp;</p>\r\n\r\n<p>Use of Website; Sri Purna Departmental Stores is not responsible for any damages resulting from the use of this website by anyone. You will not use the Website for illegal purposes. You will (1) abide by all applicable local, state, national, and international laws and regulations in your use of the Website (including laws regarding intellectual property), (2) not interfere with or disrupt the use and enjoyment of the Website by other users, (3) not resell material on the Website, (4) not engage, directly or indirectly, in the transmission of &quot;spam&quot;, chain letters, junk mail or any other type of unsolicited communication, and (5) not defame, harass, abuse, or disrupt other users of the Website</p>\r\n\r\n<p>License. By using this Website, you are granted a limited, non-exclusive, non-transferable right to use the content and materials on the Website in connection with your normal, noncommercial, use of the Website. You may not copy, reproduce, transmit, distribute, or create derivative works of such content or information without express written authorization from Sri Purna Departmental Stores or the applicable third party (if third party content is at issue).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>III. DISCLAIMER OF WARRANTIES</p>\r\n\r\n<p>THIS WEBSITE AND/OR PRODUCTS ARE USED AT YOUR OWN RISK. THE WEBSITE AND ITS PRODUCTS ARE PROVIDED &quot;AS IS&quot; AND &quot;AS AVAILABLE.&quot; WITH RESPECT TO THE PRODUCTS OR WEBSITE CONTENT, OR ANY RELIANCE ON. Sri Purna Departmental Stores EXPRESSLY DISCLAIMS ALL WARRANTIES OF ANY KIND, WHETHER EXPRESS OR IMPLIED, INCLUDING, BUT NOT LIMITED TO, IMPLIED WARRANTIES OF MERCHANTABILITY FOR A PARTICULAR PURPOSE AND NON-INFRINGEMENT WITH RESPECT TO THE PRODUCTS OR WEBSITE CONTENT, OR ANY RELIANCE UPON OR USE OF THE WEBSITE CONTENT OR PRODUCTS. (&quot;PRODUCTS&quot; INCLUDE TRIAL PRODUCTS.)</p>\r\n\r\n<p>WITHOUT LIMITING THE GENERALITY OF THE FOREGOING, Sri Purna Departmental Stores MAKES NO WARRANTY:</p>\r\n\r\n<p>THAT THE INFORMATION PROVIDED ON THIS WEBSITE IS ACCURATE, RELIABLE, COMPLETE, OR TIMELY.</p>\r\n\r\n<p>NO ADVICE OR INFORMATION, WHETHER ORAL OR WRITTEN, OBTAINED BY YOU FROM THIS WEBSITE WILL CREATE ANY WARRANTY NOT EXPRESSLY STATED HEREIN.&nbsp;</p>\r\n\r\n<p>AS TO THE RESULTS THAT MAY BE OBTAINED FROM THE USE OF THE PRODUCTS OR THAT DEFECTS IN PRODUCTS WILL BE CORRECTED.&nbsp;</p>\r\n\r\n<p>REGARDING ANY PRODUCTS PURCHASED OR OBTAINED THROUGH THE WEBSITE.</p>\r\n\r\n<p>SOME JURISDICTIONS DO NOT ALLOW THE EXCLUSION OF CERTAIN WARRANTIES, SO SOME OF THE ABOVE EXCLUSIONS MAY NOT APPLY TO YOU.</p>\r\n\r\n<p>IV. LIMITATION OF LIABILITY</p>\r\n\r\n<p>Sri Purna Departmental Stores ENTIRE LIABILITY, AND YOUR EXCLUSIVE REMEDY, IN LAW, IN EQUITY, OR OTHWERWISE, WITH RESPECT TO THE WEBSITE CONTENT AND PRODUCTS AND/OR FOR ANY BREACH OF THIS AGREEMENT IS SOLELY LIMITED TO THE AMOUNT YOU PAID, LESS SHIPPING AND HANDLING, FOR PRODUCTS, PURCHASED VIA THE WEBSITE.</p>\r\n\r\n<p>Sri Purna Departmental Stores WILL NOT BE LIABLE FOR ANY DIRECT, INDIRECT, INCIDENTAL, SPECIAL OR CONSEQUENTIAL DAMAGES IN CONNECTION WITH THIS AGREEMENT OR THE PRODUCTS IN ANY MANNER, INCLUDING LIABILITIES RESULTING FROM (1) THE USE OR THE INABILITY TO USE THE WEBSITE CONTENT OR PRODUCTS; (2) THE COST OF PROCURING SUBSTITUTE PRODUCTS OR CONTENT; (3) ANY PRODUCTS PURCHASED OR OBTAINED OR TRANSACTIONS ENTERED INTO THROUGH THE WEBSITE; OR (4) ANY LOST PROFITS YOU ALLEGE.</p>\r\n\r\n<p>SOME JURISDICTIONS DO NOT ALLOW THE LIMITATION OR EXCLUSION OF LIABILITY FOR INCIDENTAL OR CONSEQUENTIAL DAMAGES SO SOME OF THE ABOVE LIMITATIONS MAY NOT APPLY TO YOU.</p>\r\n\r\n<p>V. INDEMNIFICATION</p>\r\n\r\n<p>You will release, indemnify, defend and hold harmless Sri Purna Departmental Stores, and any of its contractors, agents, employees, officers, directors, shareholders, affiliates and assigns from all liabilities, claims, damages, costs and expenses, including reasonable attorneys&#39; fees and expenses, of third parties relating to or arising out of (1) this Agreement or the breach of your warranties, representations and obligations under this Agreement; (2) the Website content or your use of the Website content; (3) the Products or your use of the Products (including Trial Products); (4) any intellectual property or other proprietary right of any person or entity; (5) your violation of any provision of this Agreement; or (6) any information or data you supplied to Sri Purna Departmental Stores. When Sri Purna Departmental Stores is threatened with suit or sued by a third party, Sri Purna Departmental Stores may seek written assurances from you concerning your promise to indemnify Sri Purna Departmental Stores; your failure to provide such assurances may be considered by Sri Purna Departmental Stores to be a material breach of this Agreement. Sri Purna Departmental Stores will have the right to participate in any defense by you of a third-party claim related to your use of any of the Website content or Products, with counsel of Sri Purna Departmental Stores choice at its expense. Sri Purna Departmental Stores will reasonably cooperate in any defense by you of a third-party claim at your request and expense. You will have sole responsibility to defend Sri Purna Departmental Stores against any claim, but you must receive Sri Purna Departmental Stores prior written consent regarding any related settlement. The terms of this provision will survive any termination or cancellation of this Agreement or your use of the Website or Products.</p>\r\n\r\n<p>VI. PRIVACY</p>\r\n\r\n<p>Sri Purna Departmental Stores believes strongly in protecting user privacy and providing you with notice of our use of data. Please refer to the Sri Purna Departmental Stores privacy policy, incorporated by reference herein, that is posted on the Website.</p>\r\n\r\n<p>VII. AGREEMENT TO BE BOUND</p>\r\n\r\n<p>By using this Website or ordering Products, you acknowledge that you have read and agree to be bound by this Agreement and all terms and conditions on this Website.&nbsp;</p>\r\n\r\n<p>VIII. GENERAL</p>\r\n\r\n<p>Force Majeure. Sri Purna Departmental Stores will not be deemed in default hereunder or held responsible for any cessation, interruption or delay in the performance of its obligations hereunder due to earthquake, flood, fire, storm, natural disaster, the act of God, war, terrorism, armed conflict, labour strike, lockout, or boycott.</p>\r\n\r\n<p>Cessation of Operation. Sri Purna Departmental Stores may at any time, in its sole discretion and without advance notice to you, cease operation of the Website and distribution of the Products.</p>\r\n\r\n<p>Entire Agreement. This Agreement comprises the entire agreement between you and Sri Purna Departmental Stores and supersedes any prior agreements pertaining to the subject matter contained herein.</p>\r\n\r\n<p>Effect of Waiver. The failure of Sri Purna Departmental Stores to exercise or enforce any right or provision of this Agreement will not constitute a waiver of such right or provision. If any provision of this Agreement is found by a court of competent jurisdiction to be invalid, the parties nevertheless agree that the court should endeavor to give effect to the parties&#39; intentions as reflected in the provision, and the other provisions of this Agreement remain in full force and effect.</p>\r\n\r\n<p>Governing Law; Tenali Jurisdiction. This Website originates from the Tenali. This Agreement will be governed by the laws of the State of Andhra Pradesh without regard to its conflict of law principles to the contrary. Neither you nor Sri Purna Departmental Stores will commence or prosecute any suit, proceeding or claim to enforce the provisions of this Agreement, to recover damages for breach of or default of this Agreement, or otherwise arising under or by reason of this Agreement, other than in courts located in State of Andhra Pradesh. By using this Website or ordering Products, you consent to the jurisdiction and venue of such courts in connection with any action, suit, proceeding or claim arising under or by reason of this Agreement. You hereby waive any right to trial by jury arising out of this Agreement and any related documents.</p>\r\n\r\n<p>Statute of Limitation. You agree that regardless of any statute or law to the contrary, any claim or cause of action arising out of or related to the use of the Website or Products or this Agreement must be filed within one (1) year after such claim or cause of action arose or be forever barred.</p>\r\n\r\n<p>Waiver of Class Action Rights. BY ENTERING INTO THIS AGREEMENT, YOU HEREBY IRREVOCABLY WAIVE ANY RIGHT YOU MAY HAVE TO JOIN CLAIMS WITH THOSE OF OTHERS IN THE FORM OF A CLASS ACTION OR SIMILAR PROCEDURAL DEVICE. ANY CLAIMS ARISING OUT OF, RELATING TO, OR IN CONNECTION WITH THIS AGREEMENT MUST BE ASSERTED INDIVIDUALLY.</p>\r\n\r\n<p>Termination. Sri Purna Departmental Stores reserves the right to terminate your access to the Website if it reasonably believes, in its sole discretion, that you have breached any of the terms and conditions of this Agreement. Following termination, you will not be permitted to use the Website and Sri Purna Departmental Stores may, in its sole discretion and without advance notice to you, cancel any outstanding orders for Products. If your access to the Website is terminated, Sri Purna Departmental Stores reserves the right to exercise whatever means it deems necessary to prevent unauthorized access of the Website. This Agreement will survive indefinitely unless and until Sri Purna Departmental Stores chooses, in its sole discretion and without advance to you, to terminate it.</p>\r\n\r\n<p>Domestic Use. Sri Purna Departmental Stores makes no representation that the Website or Products are appropriate or available for use in locations outside India. Users who access the Website from outside India do so at their own risk and initiative and must bear all responsibility for compliance with any applicable local laws.</p>\r\n\r\n<p>Assignment. You may not assign your rights and obligations under this Agreement to anyone. Sri Purna Departmental Stores may assign its rights and obligations under this Agreement in its sole discretion and without advance notice to you.</p>\r\n\r\n<p>BY USING THIS WEBSITE OR ORDERING PRODUCTS FROM THIS WEBSITE YOU AGREE&nbsp;</p>\r\n\r\n<p>TO BE BOUND BY ALL OF THE TERMS AND CONDITIONS OF THIS AGREEMENT.</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
