('139', '3', '14', 'Dabur amla hair oil ', 'Dabur-amla-hair-oil-513098', '', 'Active', 'Dabur Amla Hair Oil infuses your hair with strength, thanks to Amla extract which is renowned as the power fruit for hair which has been traditionally used as a hair tonic.It is a beneficial product for scalp health . Dabur Amla hair oil penetrates well into your scalp, nourishes your scalp & hair with the power of Amla. Dabur Amla helps make your hair strong from the roots and also helps in hair growth to give stronger, longer & thicker hair. Now Strengthen your hair from roots to tips!', 'Dabur', '', '', '50', '2,2,2,2,2', 'Dabur Amla hair oil has Amla extract. Amla is known to be a power fruit for your hair. As the power of Amla nourishes your scalp from within, your hair is strengthened from root to tip. This helps give you thick, long & silky hair\r\nAmla is known for its potent hair growth promoting activity and thus is regarded as a potent herbal treatment for hair loss\r\nAmla is also enriched with Omega 3 and Antioxidants and has rich hair nutrients like vitamin C, tannins and amino acids which helps in making your stronger\r\nDabur Amla Hair Oil also helps in dandruff reduction\r\nIt also helps in maintaining the natural colour of hair', '6', ''),
('140', '3', '14', 'Dabur vatika hair oil ', 'Dabur-vatika-hair-oil-540273', '', 'Active', 'Are you experiencing hair problems like hair fall, dandruff or dull & damaged hair? It''s time to switch to New Dabur Vatika Enriched Coconut Hair Oil. It has the goodness of 100% pure coconut oil along with 10 selected ingredients with proven hair benefits in Ayurveda. Each ingredient has a unique benefit  Amla: Helps strengthen hair roots and make hair stronger Curry Leaves: Boosts hair growth Aloe Vera: Helps condition hair to make them softer Henna: Helps impart color to hair & useful in Dandruff control Bhringraj: Helps reduce hair fall and promotes new hair growth Methi seeds: Helps control dandruff Brahmi: Good for scalp health Black Pepper: Helps promote hair growth Kalonji: Helps control Hair fall Triphala: Makes hair stronger & helps controls dandruff Vatika Hair Oil penetrates deeper into hair & scalp to give complete nourishment and 50% hair fall control in just 4 weeks! * It also helps control dandruff and manages dull & damaged hair! Vatika  For Stronger, Thicker, Beautiful Hair!', 'Dabur', '', '', '78', '2,2', 'Dabur Vatika Hair Oil has the goodness of 100% pure coconut oil along with 10 selected ingredients\r\nEach Ingredient has proven hair benefits in Ayurveda\r\nVatika Hair Oil penetrates deeper into hair and scalp and gives complete nourishment\r\nIt has no Parabens, Minerals, Silicones and Sulphates\r\nIt helps to control damage and manages dull and damaged hair . Thus , providing stronger , thicker and shinier hair', '6', ''),
('141', '3', '14', 'Kesh King Ayurvedic Onion Hair Oil ', 'Emami-kesh-king-ayurvedic-onion-Hair-Oil-683049', '', 'Active', 'Hair Type:All\r\n<div>Product Benefits:Softening, Hair Growth</div>\r\n\r\n<div>Material Type Free:Paraben Free</div>\r\n', 'Kesh King ', 'Offer Products', '', '200', '2', '<ul>\r\n	<li>Suitable For All Hair Types</li>\r\n	<li>Applied For Anti-hair Fall</li>\r\n	<li>Reduces Hair Fall</li>\r\n	<li>Strengthens &amp; Nourises Hair</li>\r\n	<li>Makes Hair Soft, Shiny &amp; Frizz Free</li>\r\n	<li>Kesh King Onion Oil is a unique and potenet blend of 21 rare ayurvedic herbs and Onion Oil that works together to revive your crowning glory. It has been designed for optimal hair growth, hair fall control &amp; curing other hair problems. Regular use helps improving hair&#39;s texture making it fuller, shinier &amp; stronger.</li>\r\n</ul>\r\n', '2', ''),
('142', '3', '14', 'Hair&care aloevera triple blend hair oil ', 'Haircare-aloevera-triple-blend-hair-oil-065437', '', 'Active', 'Details\r\nProduct BenefitsSoftening,Conditioning,Smoothening,Soothing,Nourishing,Moisturizing\r\nBrandHair & Care', 'Hair& care', '', '', '154', '2', '\r\nIt offers the potent nourishment of herbal proteins that deeply nourish hair\r\nIt helps reduce hair fall by upto 50 percent\r\nIt is 48 hour nourishment lock ensures that hair is healthy, nourished and style ready', '6', ''),
('143', '3', '14', 'Hair&care fruit oils green hair oil ', 'Haircare-fruit-oils-green-hair-oil-035168', '', 'Active', 'Details\r\nProduct BenefitsSoftening,Conditioning,Smoothening,Soothing,Nourishing,Moisturizing\r\nBrandHair & Care', 'Hair& care', '', '', '109', '2', 'Repair upto 100% hair damage* with New Hair & Care triple blend Damage Repair Oil enriched with Aloe Vera, Olive Oil & Green tea\r\nCares for dry, frizzy & rough hair. Helps repair these signs of damage to give soft, smooth & bouncy hair. Repairs damage caused by styling heat, colouring, chemicals, pollution, sun and hard water\r\nOlive oil, known to be rich in Vitamin E and antioxidants, moisturises hair, and prevents scalp irritation, giving strong and nourished hair\r\nAloe Vera soothes itchy scalp, reduces dryness, deep conditions the hair and protects it from sun damage thus leaving your hair soft, smooth and shiny hair\r\nMakes hair irresistibly soft and frizz-free thereby preventing them from drying\r\nMiracle combination of Aloe Vera gel extracts conditioning and Coconut Oil nourishment\r\nCoconut oil penetrates 10x deeper than any other hair oil making them strong from the core', '6', ''),
