('145', '3', '14', ' Hair & Care Dry Fruit Oil with Walnut & Almond ', '-Hair-Care-Dry-Fruit-Oil-with-Walnut-Almond-792348', '', 'Active', 'Why use just an Almond Oil when you can get the benefit of 2 oils - Walnut and Almond Oil? Hair & Care combines the goodness of Almond Oil and Walnut Oil in one bottle and still comes in Hair & Care''s trusted, non-sticky format. Try out the new Hair & Care hair oil and experience the goodness of Walnut Oil, Almond Oil and Vitamin E.\r\nWalnuts are known for their numerous health benefits and are known to have proven hair benefits. In addition to promoting hair growth, they are also rich in Omega-3 fatty acids which help nourish hair. Walnuts also contain a high amount of selenium which promote a healthy scalp in addition to healthy hair. This along with Almond, which is known for its nourishment credentials, becomes a potent combination. Vitamin E is known to be a powerful antioxidant which helps nourish hair making it stronger.\r\nTry out the Hair & Care Walnut and Almond oil for silky strong hair. Its light and non-sticky formula ensures that it is super easy to apply. Deeply massage and leave overnight before washing or dab a few drops after wash to get manageable hair.', 'Hair& care', '', '', '163', '2', 'Contains goodness of Walnut oil and Almond oil ,known for nourishing and strengthening hair\r\nNon-sticky and light formula for easy styling\r\nPowered by Vitamin-E, a natural antioxidant known to maintain healthy scalp and hair\r\nCan be used after-wash for style and manageability\r\nFor Strong and Silky hair\r\nSuitable for any hair style', '6', ''),
('146', '3', '14', ' Himalaya Anti-Hair Fall Hair Oil', '-Himalaya-Anti-Hair-Fall-Hair-Oil-726513', '', 'Active', 'Himalaya Anti-Hair Fall Hair Oil effectively fights commonly occurring hair problems like hair fall and hair damage. Primarily crafted for daily use, it is a non sticky anti hair fall oil that strengthens your roots and prevents breakage and hair fall. Our hair oil effectively fights various hair problems such as Hair Fall, Dull Hair, Damaged Hair, Dry Hair, Itchy Scalp, Frizzy Hair, Split Ends, Rough Hair etc. It comes with a unique comb applicator that helps with deep oil penetration into the scalp. Apply the oil directly from the spill-proof applicator onto the scalp. Gently massage hair oil onto the scalp and hair. It is an effective hair growth oil fortified with natural ingredients like Bhringaraj, Amla, Neem, Methi & Bilva. Bhringraj promotes hair growth, while Amla is a well-known ingredient for hair care; it prevents hair fall & conditions your hair. It is safe to use on all skin and hair types. For best results, wash off with Himalaya Anti-Hair Fall Shampoo for healthy and beautiful hair.\r\n\r\nSEE ', 'Himalaya ', '', '', '119', '2,2', 'PREVENTS HAIR FALL: Himalaya Anti-Hair Fall Hair Oil is a non sticky, daily-use oil that strengthens roots & prevents hair fall.\r\nPROMOTES HAIR GROWTH: Regular usage keeps your scalp healthy & stimulates hair growth.', '6', ''),
('147', '3', '14', 'Indulekha Bringraj Oil ', 'Indulekha-bringraj-hair-oil-246387', '', 'Active', 'Product Benefits:Anti Hair Loss\r\n<div>Hair Type:Dandruff</div>\r\n\r\n<div>Material Type Free:Bringha</div>\r\n\r\n<div>Item Form:Oil</div>\r\n', 'Indhuleka ', '', 'induleka, induleka oil, induleka hair oil, indulekha hair oil ', '222', '2,2', '<ul>\r\n	<li>Clinically Proven to Grow Hair in 4 months, Reduces Hair Fall</li>\r\n	<li>Power of 11 Herbs & Essential Oil cooked under Natural Sunlight for 7 days.</li>\r\n	<li>100% Ayurvedic Oil, Recommended by Ayurvedic Experts. Product is Dermatologically tested.</li>\r\n	<li>Free from Parabens, Sulphates, Silicones, Synthetic Dyes & Artificial Perfume</li>\r\n	<li>Proven on Real Male & Female consumers having Mild to Severe Hair Fall</li>\r\n	<li>100% Natural Fragrance and Colour.</li>\r\n</ul>\r\n', '6', ''),
('148', '3', '14', ' Keo Karpin Hair Oil', '-Keo-Karpin-Hair-Oil-407132', '', 'Active', 'Product Benefits:Moisturizing\r\n<div>Hair Type:Oily</div>\r\n\r\n<div>Item Form:Oil</div>\r\n\r\n<div>Scent:Unscented</div>\r\n', 'Keo Karpin', '', '', '95', '2,2,2,2', '<ul>\r\n	<li>Weight : 200ml</li>\r\n	<li>Olive oil provides Deep Moisturising therapy.</li>\r\n	<li>Protects the hair from pollution &amp; stress</li>\r\n	<li>Olive oil provides Deep Moisturising therapy which protects the hair from pollution &amp; stress.</li>\r\n</ul>\r\n', '6', ''),
('149', '3', '14', 'Kesh King hair oil ', 'Kesh-King-hair-oil-621940', '', 'Active', 'Hair Type:All\r\n<div>Product Benefits:Anti Hair Loss</div>\r\n\r\n<div>Material Type Free:Oil Free</div>\r\n', 'Kesh King ', '', '', '47', '2,2', '<ul>\r\n	<li>World&rsquo;s No. 1 Ayurvedic hair oil for hair fall related problems</li>\r\n	<li>Contains the goodness of 21 Ayurvedic herbs like Bhringraja, Amalaki, Methi, Brahmi, Japa, Lodhra, Manjistha, Jatamansi</li>\r\n	<li>Clinically proven to be 2 time more effective than other Ayurvedic oils in reducing hair fall and promoting hair growth</li>\r\n	<li>Helpful in all hair problems like dandruff, premature greying etc.</li>\r\n	<li>Comes with Deep Root Comb applicator which stimulates roots aiding in deeper oil penetration</li>\r\n	<li>It is the only oil certified by Anthony Pearce Trichology.</li>\r\n</ul>\r\n', '6', ''),
('150', '3', '14', 'kLF Nirmal pure coconut oil', 'Kesh-King-hair-oil-845360', '', 'Active', 'Brand:KLF Nirmal\r\n<div>Diet Type:Vegetarian</div>\r\n\r\n<div>Flavour:Coconut</div>\r\n\r\n<div>Form:Liquid</div>\r\n', 'Nirmal', '', '', '32', '2,2,2', '<ul>\r\n	<li>100 Percent pure and edible grade coconut oil</li>\r\n	<li>No added chemicals or fragrance</li>\r\n	<li>Country of Origin: India</li>\r\n	<li>No burnt smell, pure aroma of coconut oil</li>\r\n	<li>Best for healthy hair.</li>\r\n</ul>\r\n', '6', ''),
('151', '3', '14', 'Livon shake& spray ', 'Livon-shake-spray-249376', '', 'Inactive', 'Product Benefits:Smoothening, Shine, Moisturizing\r\n<div>Hair Type:All</div>\r\n\r\n<div>Item Form:Serum</div>\r\n', 'Livon', '', '', '47', '2', '<ul>\r\n	<li>Suitable for all hair types, no matter where you are, give your hair the perfect salon finish anytime, anywhere with Livon Shake and Spray</li>\r\n	<li>Express moisture, It''s vitamin B fortified water keeps your hair moisturized and cuts away the frizz while its serum glossers boost shine and give your hair an express salon finish</li>\r\n	<li>Frizz Free, Instantly, Livon Shake & Spray Serum eliminates frizz and tames flyaways giving your hair instant smoothness and gloss outside your home</li>\r\n	<li>On the go Gloss, All you need to do is just shake & spray on dry hair to cut away the frizz and get instant smoothness & gloss</li>\r\n	<li>Salon in your bag, just carry Livon Shake & Spray Serum in your bag so you can apply it whenever and get salon finish wherever</li>\r\n	<li>Smooth, Salon Finish Hair, use it before making a hairstyle to get hydrated hair which is easy to style. Spray it on after making the hairstyle to get the perfect glossy finish</li>\r\n	<li>You leave home looking great, but aren''t you shocked at how frizzy and messy hair gets during the day? We know you spend time doing up your hair every morning but by the time you reach office or college, aren''t you shocked at how frizzy & messy your hair looks?</li>\r\n	<li>When luck is not on your side, Livon Shake and Spray Serum is! Made for all you girls who spend so much time outdoors, Livon Shake and Spray Serum cuts frizz on the go and boosts gloss instantly. A spray which can easily be carried in the bag, it has Vitamin B fortified water & serum glossers that give you fab hair whenever, wherever. Livon Shake and Spray is a bi-phasic hair serum for women that contains Moroccan Argan oil and water based conditioning actives. It is super light and also contains multivitamins, shine boosters and UV filters that fight against frizzy hair , pollution and dullness. All you need to do is just shake & spray on dry hair to cut away the frizz and get instant smoothness & gloss! So go ahead, keep Livon Shake and Spray Serum in your bag and get express salon finish hair anytime, anywhere!</li>\r\n</ul>\r\n', '6', ''),
('152', '3', '14', 'Livon go frizz free serum', 'Livon-go-frezz-free-serum-269031', '', 'Active', 'Hair Type:Frizzy\r\n<div>Product Benefits:Smoothening, Detangle</div>\r\n\r\n<div>Material Type Free:Sulfate Free</div>\r\n', 'Livon', '', '', '250', '2,2,2', '<ul>\r\n	<li>Suitable for all hair types: No matter how you like to keep your hair, Livon Serum will give your hair the salon finish it deserves</li>\r\n	<li>Perfect Moisturization: Infused with potent moroccan argan oil extracts, Livon Serum moisturises hair, giving it a glossy finish</li>\r\n	<li>Ultra Glossy Hair: Livon Serum instantly makes your hair upto 50% glossier, giving your hair a super gloss boost</li>\r\n	<li>Frizz Free Hair: Livon Serum instantly detangles your hair, cuts through frizz and gives super smooth ultra glossy hair</li>\r\n	<li>Salon Finish Hair: Livon Serum gives your hair the perfect, salon finish every single time to shampoo so your hair looks fab always</li>\r\n	<li>Hairstyling Partner: Apply Livon Serum to your hair before making a hairstyle to protect your hair from damage. Use a little Livon Serum after making the hairstyle to tame flyaways.</li>\r\n</ul>\r\n', '6', ''),
('153', '3', '14', 'Mama Earth almond hair oil ', 'Mama-Earth-almond-hair-oil-167258', '', 'Active', 'Product Benefits:Smoothening, Nourishing, Hair Growth\r\n<div>Hair Type:Normal</div>\r\n\r\n<div>Item Form:Oil</div>\r\n', 'Mamaearth', '', '', '379', '2', '<ul>\r\n	<li>FOR HEALTHY HAIR GROWTH: Say hello to the hair of your dreams. Enriched with potent Vitamin E and almond goodness, the oil penetrates deep into the roots, leading to healthy hair growth. High in antioxidants, the oil improves texture and smoothens hair.</li>\r\n	<li>DEEPLY NOURISHES SCALP &amp; HAIR: Happy scalp = healthy hair growth. Mamaearth Almond Hair Oil deeply nourishes the scalp and hair strands, which means root to tip nourishment with the goodness of nature.</li>\r\n	<li>MADE WITH NATURAL INGREDIENTS: Dermatologically tested, the hair oil is free from Sulfates, Parabens, SLS, and Mineral Oils.</li>\r\n	<li>SUITABLE FOR ALL HAIR TYPES: This hair oil is dermatologically tested &amp; is suitable for all hair types.</li>\r\n</ul>\r\n', '6', ''),
