('162', '3', '15', 'Mamaearth anti pollution face cream', 'Mamaearth-anti-pollution-face-cream-438690', '', 'Inactive', 'Product Benefits:Brightening\r\n<div>Material Type Free:Oil Free;Paraben Free</div>\r\n\r\n<div>Skin Type:All;Acne</div>\r\n\r\n<div>Item Form:Cream</div>\r\n', 'Mamaearth', '', '', '332', '2', '<ul>\r\n	<li>OIL-FREE FORMULA: The oil-free formula feels light on the face and is non-greasy. Ideal for everyday use, the cream is suitable for all skin types and all seasons.</li>\r\n	<li>PROTECTS AGAINST POLUTION: Pollustop, a revolution in skincare significantly protects skin cells from Sun damage & other atmospheric pollution. It also acts against UV damage & tan caused due to Sun exposure.</li>\r\n	<li>FIGHTS FREE RADICALS: Curcumin, an active ingredient in Turmeric is known to fight free radicals while delaying the signs of aging. Its anti-bacterial and anti-septic properties keep acne and pimples at bay.</li>\r\n	<li>SUITABLE FOR ALL SKIN TYPES: Free of any additives, this cream is dermatologically tested & suitable for all skin types.; NATURAL & TOXIN FREE: Dermatologically Tested, the cream is free from Sulfates, Paraben, SLS, Petroleum, Artificial Preservatives, & Colors.</li>\r\n	<li>Target Gender: Unisex</li>\r\n	<li>This unique lightweight cream offers tough protection from pollution and UV rays, while being gentle on the skin. The non-greasy formula forms a shield to protect against dirt, pollution, and the sun. Enriched with soothing Turmeric Extract and nourishing Carrot Extract, it keeps your skin calm and nourished. Turmeric Extract restores elasticity, brightens the complexion, and keeps skin moisturized. Carrot improves skin elasticity, nourishes, and repairs skin. Pollustop forms an invisible shield to protect your skin from free radical damage and acne-causing dirt. The Anti-Pollution Face Cream is dermatologically-tested, and suitable for all skin types. Its completely free of harmful chemicals like Sulfates, Parabens, Silicones, Petrolatum, and Dyes.</li>\r\n</ul>\r\n', '6', ''),
('163', '3', '15', 'Mamaearth bye bye blemishes face cream', 'Mamaearth-bye-bye-blemishes-face-cream-564029', '', 'Inactive', 'Special Ingredients:Glycerin, Shea Butter\r\n<div>Product Benefits:Soothing</div>\r\n\r\n<div>Material Type Free:Oil Free, Sodium Lauryl Sulfate Free, Sulfate Free, Petroleum Free, Paraben Free</div>\r\n\r\n<div>Skin Type:Combination</div>\r\n', 'Mamaearth', '', '', '427', '2', '<ul>\r\n	<li>NATURAL REMEDY FOR PIGMENTED SKIN: Our dermatologically tested everyday non-greasy cream creates a protective barrier on the skin. Packed with powerful ingredients like Daisy Flower Extract and Mulberry Extract, it calms and soothes the skin, reducing the appearance of blemishes, dark spots, age spots, discoloration, hyperpigmentation and loss of skin elasticity.</li>\r\n	<li>NON-GREASY FORMULA: The light formula gives your face a non-greasy glow.; NOURISHES THE SKIN: Rich with natural active ingredients Daisy Flower Extract with Vitamin C, Mulberry Extract and Shea Butter. Daisy Flower extract reduces melanin activity and provides even pigmentation. Mulberry extract reduces the appearance of dark spots. Vitamin C with Glycerin aids the skins natural collagen production promoting healthy glowing skin.</li>\r\n	<li>SAFE FOR ALL SKIN TYPES: All ingredients used are natural and free of toxicity and irritants. Thus, making the cream safe even for oily and sensitive skin.</li>\r\n	<li>NATURAL & CERTIFIED TOXIN FREE: Dermatologically Tested, the cream is free from Sulfates, Paraben, SLS, Mineral Oil, Petroleum, Artificial Preservatives, Colors & Fragrances.</li>\r\n	<li>Scent Name: Unscented ; Target Gender: Female.</li>\r\n</ul>\r\n', '6', ''),
('164', '3', '14', ' Nuzen Gold Herbal Hair Oil', '-Nuzen-Gold-Herbal-Hair-Oil-854610', '', 'Active', 'Product Benefits:Damage Control, Prevents Dandruff, Strong Hair, Grows Dark&amp; strong hair.\r\n<div>Hair Type:All</div>\r\n\r\n<div>Material Type Free:Paraben Free</div>\r\n\r\n<div>Item Form:Oil</div>\r\n', 'Nuzen', '', '', '375', '2', '<ul>\r\n	<li>NuZen Gold Herbal hair oil is made from a proprietary mix of herbs, flowers, fruits and oil. Inspired from &ldquo;BHAVAPRAKASA NIGHANTUVU&rdquo;, a 16th century AD lexicon of Ayurveda. The oil is a treasure trove of natural ingredients including Amalaki, Bhringaraja, Methika, Japa Pushpa and Patra, Narikela, Nimbukam and Vatada.</li>\r\n</ul>\r\n', '6', ''),
('165', '3', '15', 'Mamaearth charcoal face scrub', 'Mamaearth-charcoal-face-scrub-439126', '', 'Active', 'Skin Type:Combination\r\n<div>Product Benefits:Softening, Exfoliating, Removes Dirt</div>\r\n\r\n<div>Material Type Free:Paraben Free</div>\r\n\r\n<div>Active Ingredients:Charcoal</div>\r\n', 'Mamaearth', '', '', '332', '2', '<ul>\r\n	<li>GENTLY EXFOLIATES: The mild granular Walnut beads and Activated Charcoal gently unclog pores, leaving behind soft, supple, and clean skin.</li>\r\n	<li>REMOVES DEAD SKIN: Gently massaging the scrub on your face and neck boosts blood flow, removes dead skin, and delivers a healthy glow.</li>\r\n	<li>REMOVES SKIN IMPURITIES: The exfoliating scrub removes dirt, toxins, and acne-causing bacteria that clog pores. All this, without disturbing the skins pH balance.</li>\r\n	<li>MADE WITH NATURAL INGEDIENTS: Dermatologically tested, the scrub is free from Parabens, Sulfates, SLS, and Artificial Colors.</li>\r\n	<li>SUITABLE FOR ALL SKIN TYPES: Free of any additives, this face scrub is dermatologically tested & suitable for all skin types.</li>\r\n</ul>\r\n', '1', ''),
