('167', '3', '15', 'Mamaearth Coco face wash', 'Mamaearth-Coco-face-wash-895704', '', 'Active', 'Skin Type:Combination\r\n<p>Product Benefits:Anti-Aging, Cleansing</p>\r\n\r\n<p>Material Type Free:Sulphate Free, Mineral Oil Free, Sodium Lauryl Sulfate (SLS) Free, Petroleum Free, Paraben Free</p>\r\n\r\n<p>Item Form:Gel</p>\r\n', 'Mamaearth', '', '', '246', '2', '<ul>\r\n	<li>REFRESHES INSTANTLY: Enriched with Cocoa and Coffee, the face wash energizes the skin with antioxidants. It fights dullness, evens out skin tone, and reduces puffiness.</li>\r\n	<li>DEEPLY CLEANSES SKIN: The deep cleansing formula removes dirt, excess oil, and keeps your face away from dullness.</li>\r\n	<li>GENTLE FORMULA: Loaded with the goodness of natural ingredients, this face wash is gentle on the skin, pH balanced, and dermatologically tested to suit all skin types.</li>\r\n	<li>MADE WITH NATURAL INGREDIENTS: Dermatologically tested, the face wash is made from natural ingredients and is free from Sulfates, Parabens, SLS, Petroleum, artificial preservatives &amp; colors.</li>\r\n	<li>SUITABLE FOR ALL SKIN TYPES: This face wash is dermatologically tested &amp; is suitable for all skin types.</li>\r\n</ul>\r\n', '6', ''),
('168', '3', '14', 'Parachute coconut hair oil ', 'Parachute-coconut-hair-oil-014259', '', 'Active', 'Hair Type:All\r\n<p>Material Type Free:Sulfate Free</p>\r\n', 'Parachute ', '', '', '94', '2,2,2,2', '<ul>\r\n	<li>Nothing but 100% pure coconut oil</li>\r\n	<li>Is made with the finest hand-picked Coconuts</li>\r\n	<li>Contains no added preservatives or chemicals</li>\r\n	<li>Fresh nutty fragrance of pure coconut oil</li>\r\n	<li>Long lasting freshness</li>\r\n	<li>27 quality tests and 5 stage purification process &ndash; for 100% purity every time.</li>\r\n</ul>\r\n', '6', ''),
('169', '3', '15', 'Mamaearth hydra gel Indian sunscreen', 'Mamaearth-hydra-gel-Indian-sunscreen-581267', '', 'Inactive', 'Sun Protection:50 SPF\r\n<div>Skin Type:Combination</div>\r\n\r\n<div>Product Benefits:Hydrating</div>\r\n\r\n<div>Item Form:Gel</div>\r\n', 'Mamaearth', '', '', '379', '2', '<ul>\r\n	<li>PROTECTS AGAINST UVA & B RAYS: Raspberry present in the sunscreen is high in antioxidants. The SPF 50 formula protects the skin from UV damage.</li>\r\n	<li>NON-STICKY AND LIGHTWEIGHT FORMULA: The gel-based formula provides long term hydration and protection from the sun. Aloe Vera makes it non-sticky & lightweight.</li>\r\n	<li>PROVIDES HYDRATION: While Raspberry in the sunscreen protects against the sun and its harmful rays, Aloe Vera hydrates while soothing dry skin</li>\r\n	<li>MADE WITH NATURAL INGREDIENTS: Made using natural ingredients, the sunscreen is free from Parabens, SLS, Petroleum, Artificial Preservatives, & Colors.</li>\r\n	<li>SUITABLE FOR ALL SKIN TYPES: The sunscreen is dermatologically tested & is suitable for all skin types.</li>\r\n	<li>We all know the damaging effects of the sun. Harmful UVA & UVB rays cause long term skin damage like sunburn, dark spots, dry and itchy skin. Whats the solution? Avoid sun damage by using a sunscreen that not only protects but also hydrates! Mamaearth HydraGel Indian Sunscreen is made keeping in mind the needs of Indian skin. The gel-based formula with SPF 50 soothes the skin while protecting it from the harmful rays of the sun. Aloe Vera in the sunscreen has high anti-inflammatory properties and is extremely soothing. It also contains Raspberries that rejuvenate the skin and reverse signs of aging, such as fine lines, dark spots, and wrinkles. The light and non-greasy gel formula protects your skin from sun damage and also keeps it hydrated. The product is dermatologically tested and is suitable for all skin types. It contains no Parabens, mineral oils, or harmful chemicals, and is 100% safe to add to your daily skin regimen.</li>\r\n</ul>\r\n', '0', ''),
('170', '3', '14', 'Parachute coconut hair oil packet ', 'Parachute-coconut-hair-oil-packet-832140', '', 'Active', 'Hair Type:Oily', 'Parachute ', '', '', '30', '2', '<ul>\r\n	<li>100 Percent pure</li>\r\n	<li>Consistent viscosity</li>\r\n	<li>Long lasting freshness</li>\r\n	<li>A market leader in its category and one of our oldest brands, Parachute Coconut Oil today stands for purity and quality. Over the years, the brand has seen a lot of innovations in packaging, sizing and tamper-proofing. Parachute enjoys enormous loyalty in urban, semi-urban and rural market.</li>\r\n</ul>\r\n', '6', ''),
('171', '3', '14', 'Mamaearth onion hair oil', 'Mamaearth-onion-hair-oil-493267', '', 'Active', 'Hair Type:All, Color-Treated\r\n<div>Product Benefits:Shine, Nourishing, Hair Growth</div>\r\n\r\n<div>Material Type Free:Silicone Free, Dye Free, Mineral Oil Free, Paraben Free</div>\r\n', 'Mamaearth', '', '', '569', '2,2', '<ul>\r\n	<li>REDUCES HAIR FALL: Onion Oil, in combination with Redensyl, reduces hair fall and makes your hair healthy and strong.</li>\r\n	<li>ADDS STRENGTH &amp; SHINE: Full of nature&rsquo;s goodness, a blend of nourishing oils such as Sunflower Oil, Amla Oil, Hibiscus Oil, etc. our Onion Oil makes hair strong from the inside &amp; shinier on the outside.</li>\r\n	<li>BALANCES SCALP: Bhringraj Oil is known to balance &amp; nourish the scalp. Rich in Vitamin D, Almond Oil provides nutrition to the scalp, making hair lustrous.</li>\r\n	<li>MADE WITH NATURAL INGREDIENTS: Dermatologically tested, the oil is free from Sulfates, Paraben, SLS, Petroleum, Artificial Preservatives, &amp; Colors.</li>\r\n	<li>SUITABLE FOR ALL HAIR TYPES: The hair oil is dermatologically tested &amp; is suitable for all hair types.</li>\r\n</ul>\r\n', '6', ''),
