('196', '3', '20', 'Lifebuoy Alcohol Based Germ Protection Hand Sanitizer', 'Lifebuoy-Alcohol-Based-Germ-Protection-Hand-Sanitizer-786193', '', 'Inactive', 'When we step out of home, our hands touch common surfaces like elevator buttons, cab doors, train handles or grocery carts that are a breeding ground of bacteria & viruses. However we dont always have access to water & soap. Thats why lifebuoy total hand sanitizer, is a must have when you are out of home. The world health organisation recommends to use an alcohol based hand sanitizer when out of home to prevent the spread of bacteria and virus. When out of home, use lifebuoy alcohol based hand sanitizer, that has more than 60% alcohol content, and gives you instant germ protection without water. Lifebuoy hand sanitizer gel has glycerine, that leaves your skin feeling fresh & supple. This quick-drying, non-sticky formula also comes in a convenient size pack. It can also be used by kids when they are out of home. Make lifebuoy hand sanitiser your new 24 hour companion in school, at home, work place, metros, market and gymsclaim support, as per lab test. Keep out of reach of children below 5 years.', 'Lifebuoy ', '', '', '25', '2', '<ul>\r\n	<li>Lifebuoy Hand Sanitizer has over 60% alcohol content and gives you instant germ protection</li>\r\n	<li>Lifebuoy Hand Sanitizer kills 99.9% bacteria and virus without water</li>\r\n	<li>Lifebuoy Hand Sanitizer has Glycerine, it leaves your skin feeling moisturised</li>\r\n	<li>Apply enough Hand sanitiser gel on your palm. Spread and rub over the back of your hands thoroughly and fingertips until completely dry before touching other surfaces</li>\r\n	<li>Lifebuoy Hand Sanitizer also comes in a convenient easy to carry pack that helps protect you when out of home.</li>\r\n</ul>\r\n', '10', ''),
('197', '3', '20', 'Moov Fast Pain Relief Cream', 'Moov-Fast-Pain-Relief-Cream-148325', '', 'Active', 'Modern lifestyles can cause both men and women to suffer from innumerable pains, for several reasons, on various body parts. Pain always comes in uninvited and can occur even while doing everyday tasks such as lifting heavy objects or wrong posture at work or home. But you need not worry if you have MOOV?s trusted pain relief formula by your side. MOOV Pain Relief Cream is one of India&#39;s most popular ointments for fast pain relief amongst the homemakers. It is an analgesic (or pain relieving) ointment made using 100% ayurvedic ingredients. Also available in a Spray format that allows easy application. This analgesic (or pain relieving) cream is a First Aid Kit must have, with a special formula fortified with the power of &quot;Four Active Ingredients&quot;. These penetrate deep inside to produce warmth that relaxes the muscles and help you recover fast. It is pain relieving cream with herbal ingredients such as wintergreen oil, mint extract (pudine ke phool) and turpentine oil (tarpin ka tel). These oils are known for their pain relieving properties. Moov provides you fast and long lasting relief from muscle pain, neck and backache, inflammation, sprain, myositis, fibrositis and sciatica. It works great for chronic neck aches and lower back pains.', 'Moov', '', '', '128', '2,2,2', '<ul>\r\n	<li>Get quick &amp; long lasting pain relief with Moov Instant Pain Relief cream &amp; spray</li>\r\n	<li>Suitable for Muscle Pain, Back Pain, Joint Pain, Knee Pain, Ankle Pain, Sprains, Spasms &amp; Cramps</li>\r\n	<li>100% Ayurvedic formula &ndash; Contains Eucalyptus Oil, Wintergreen Oil, Turpentine Oil &amp; Mint Extract</li>\r\n	<li>Useful for injuries or pain due to Sports activities, Fitness or Gym Workouts &amp; Daily household activities</li>\r\n	<li>Small convenient packaging makes it easy to carry everywhere you go.</li>\r\n</ul>\r\n', '6', ''),
