('221', '3', '14', 'Tru hair onion Hair Oil ', 'Tru-hair-onion-Hair-Oil-829537', '', 'Active', 'Product Benefits:Smoothening, Nourishing\r\n<div>Hair Type:Normal</div>\r\n\r\n<div>Material Type Free:Paraben Free</div>\r\n\r\n<div>Item Form:Oil</div>\r\n', 'Tru hair ', '', '', '415', '2', '<ul>\r\n	<li>COMES WITH A HEATER: The Heater heats the oil to around 65&deg; in about 4 mins. Massaging hot oil at 65&deg; to your scalp and hair increases blood circulation in the scalp, strengthens your hair roots, and nourishes your hair with essential nutrients.</li>\r\n	<li>NOURISHES THE HAIR: The unique formula in our Onion Shampoo contains Aloe Vera that NOURISHES THE HAIR and makes the hair smooth and silky.</li>\r\n	<li>FIGHTS DANDRUFF &amp; HAIR FALL: Tru Hair Onion oil is a combination of onion juice extracts and 9 other novel ingredients, that fights dandruff, reduce hair fall, and strengthen hair.</li>\r\n	<li>AYURVEDIC FORMULATION: Tru Hair Onion oil and Onion Shampoo are prepared based on our ancient ayurvedic scripts. Both products contain a combination of vital novel herbs.</li>\r\n	<li>FREE FROM NASTY CHEMICALS: All Tru Hair products are natural &amp; free from LLPs, parabens, and sulphates.</li>\r\n	<li>SUITABLE FOR ALL HAIR TYPES: Tru Hair products are formulated by combining Ancient Ayurveda with Modern Technology and are SUITABLE FOR ALL HAIR TYPES.</li>\r\n</ul>\r\n', '6', ''),
('222', '3', '14', 'Vicco amla hair oil ', 'Vicco-amla-hair-oil-150834', '', 'Active', 'Product Benefits:Nourishing, Hair Growth\r\n<div>Hair Type:Normal</div>\r\n\r\n<div>Material Type Free:Sulfate Free</div>\r\n\r\n<div>Item Form:Liquid</div>\r\n', 'Vicco', '', '', '43', '2', '<ul>\r\n	<li>Dabur Amla hair oil has Amla extract. Amla is known to be a power fruit for your hair. As the power of Amla nourishes your scalp from within, your hair is strengthened from root to tip. This helps give you thick, long &amp; silky hair</li>\r\n	<li>Amla is known for its potent hair growth promoting activity and thus is regarded as a potent herbal treatment for hair loss</li>\r\n	<li>Amla is also enriched with Omega 3 and Antioxidants and has rich hair nutrients like vitamin C, tannins and amino acids which helps in making your stronger</li>\r\n	<li>Dabur Amla Hair Oil also helps in dandruff reduction</li>\r\n	<li>It also helps in maintaining the natural colour of hair.</li>\r\n</ul>\r\n', '6', ''),
('223', '3', '14', 'Vlcc hair straightening Oil ', 'Vlcc-hair-straightening-Oil-317546', '', 'Inactive', 'Product Benefits:Hair Strengthening, Hair Growth\r\n<div>Hair Type:All</div>\r\n\r\n<div>Scent:Rosemary</div>\r\n', 'Vlcc', '', '', '380', '2', '<ul>\r\n	<li>Strengthens hair from the root</li>\r\n	<li>Stimulates hair growth</li>\r\n	<li>Fight scalp infections</li>\r\n	<li>Country of Origin: India</li>\r\n	<li>Hair can lose its strength and become fragile due to various reasons. It can occur due to the harsh weather, use of excessive hair styling products or simply progression of hair. Our hair seems to lose its natural charm. However, now you can manage your dry and weak hair with VLCC Hair Strengthening Oil which is a right blend of almond oil and olive oil and provides the right amount of nourishment your hair needs. Olive oil is rich in Vitamin K and Vitamin A, therefore, it protects the hair from sun damage. Almond oil which is rich in Vitamin E makes the hair strong and healthy. The other main components of this beneficial hair oil are sesame oil, orange oil, rosemary oil, Musk rook extract and Bhringraj Extract. Each of these has significant hair strengthening properties that nourishes the hair and helps to regain the lost strength. This hair oil is also enriched with advanced CSF (Cortex Strengthening Formula) that helps to increase the keratin formation in the cortex layer. It provides nourishment to the hair root and also reduces the chance of premature greying. Rosemary and orange extracts help to cure hair irritation and also relaxes and refreshes the hair. This hair oil has a faint smell of orange and Bhringraj Extract which does not linger. This is non-greasy and runs smoothly through the hair while working on all the hair related issues.</li>\r\n	<li>The VLCC Hair Oil comes in a transparent plastic bottle with a flip open cap and is available in a 100ml pack. So you can buy 100 ml VLCC Oil and experience shiny, strong and healthy hair.</li>\r\n</ul>\r\n', '6', ''),
