('292', '3', '20', 'Savlon herbal sensitive hand wash ', 'Savlon-herbal-sensitive-hand-wash-864750', '', 'Inactive', 'Item Form:Liquid\r\n<div>Skin Type:All</div>\r\n\r\n<div>Brand:Savlon</div>\r\n\r\n<div>Scent:Herbal</div>\r\n\r\n<div>Material Feature:Dermatologist Tested</div>\r\n\r\n<div>Our Hands are hot beds of germs. Maintaining good hand hygiene is important for staying healthy. Keep your family in safe hands with Savlons advanced range of Handwashes. Savlon Handwash provides effective cleansing and protects you and your family from a million germs. Savlon Handwash also protects against H1N1 virus, Rotavirus, Stomach Flu & Flu virus. It is dermatologically tested and is suitable for all skin types</div>\r\n\r\n<div></div>\r\n\r\n<div>Washing your hands is easy, and its one of the most effective ways to prevent the spread of germs. Keep yourself and your loved ones healthy by washing your hands often, especially during these key times when you are likely to get and spread germs - Before, during, and after preparing food, Before and after eating food, after using the toilet and after blowing your nose, coughing, or sneezing. Directions of use:</div>\r\n\r\n<div>1. Wet your hands with clean, running water, turn off the tap, and press the nozzle of Savlon Handwash gently to get the Handwash on the wet hand</div>\r\n\r\n<div>2. Lather your hands by rubbing them together with the handwash. Lather the backs of your hands, between your fingers, and under your nails. Scrub your hands for at least 20 seconds</div>\r\n\r\n<div>3. Rinse your hands well under clean, running water. Dry your hands using a clean towel</div>\r\n\r\n<div></div>\r\n\r\n<div>Based on lab study. Washes away Germs</div>\r\n\r\n<div>Million Germs refer to number of germs.</div>\r\n', 'Savlon', '', '', '86', '2', '<ul>\r\n	<li>Break the chain of infection with Savlon Handwash that protects from a million germs</li>\r\n	<li>Protects from H1N1 virus, Rotavirus, Stomach Flu & Flu virus</li>\r\n	<li>Savlon herbal sensitive handwash - with herbal essence and effective cleansing, this handwash fights germs with a dose of extra sensitivity.</li>\r\n	<li>Dermatologically tested, suitable for all skin types, with natural extracts. No TCC. No Triclosan. No added parabens.</li>\r\n	<li>Directions for use: To use, press the nozzle gently to get Savlon Handwash on the wet hand, wash hands for at least 20 seconds</li>\r\n	<li>Available in Sizes: 500ml pump, 175ml refill, 750ml refill. Available in variants: Moisture Shield & Deep Clean.</li>\r\n</ul>\r\n', '6', ''),
