('357', '7', '91', 'Jovees neem skin toner', 'Jovees-neem-skin-toner-813042', '', 'Active', 'Skin Type:Oily\r\n<p>Product Benefits:Freshening, Moisturizing</p>\r\n\r\n<p>Item Form:Toner</p>\r\n\r\n<p>Scent:Natural</p>\r\n', 'Jovees', '', '', '185', '2', '<ul>\r\n	<li>It help to increase skin&rsquo;s ability to retain moisture and effectively cleanses pores deeply to remove the last trace of dirt, surface impurities</li>\r\n	<li>Clean face and pat dry. Spray sufficient quantity directly onto the face and neck and wipe softly using cotton swabs. Use twice daily</li>\r\n	<li>Recommended For: Oily Skin</li>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n', '6', ''),
('358', '7', '91', 'Jovees cucumber skin toner', 'Jovees-cucumber-skin-toner-412657', '', 'Active', 'Skin Type:Oily\r\n<p>Product Benefits:Hydrating, Lightens Skin, Soothing, Tightening, Cleansing, Ph Balancing</p>\r\n\r\n<p>Item Form:Spray</p>\r\n', 'Jovees', '', '', '214', '2', '<ul>\r\n	<li>TONER FOR OILY SKIN: Jovees Cucumber Skin Toner will neutralise the pH balance of your skin, hydrate it and soothe the irritation caused by acne. Perfect toner for sensitive skin</li>\r\n	<li>SKIN TONER MADE FROM NATURAL INGREDIENTS: The anti-inflammatory and soothing properties of cucumber reduce swelling, puffiness, soothes acne, and prevents early signs of ageing.</li>\r\n	<li>LIGHTENS SKIN TONE: The astringent properties of Aloe vera controls sebum and reduces red spots and blemishes, making the skin appear brighter and lighter.</li>\r\n	<li>PORE TIGHTENING TONER FOR FACE: The best cleansing, purifying, and pore-tightening partner for oily skin. Promotes clearer, younger-looking skin with regular use.</li>\r\n	<li>DERMATOLOGICALLY TESTED. Suitable for women and men with oily skin. Paraben, Alcohol and Cruelty free.</li>\r\n</ul>\r\n', '6', ''),
