('414', '3', '14', 'Revlon top speed hair colour women ', 'Revlon-top-speed-hair-colour-women-150482', '', 'Active', ' Revlon Top Speed is an ammonia-free complete hair coloring kit that allows multiple applications and covers grey hair in 5 minutes. It comes with two professional quality brushes for easy application. Infused with intense conditioning ingredients, Revlon Top Speed protects hair from damage making them shiny and resilient.  Top Speed''s ammonia-free formula protects the natural texture of hair, ensuring 100% grey coverage.  Top Speed is enriched with intense conditioning ingredients like Mother of Pearl & Ginseng Root Extract that make hair shiny, resilient and protect hair from damage.  Top Speed provides fast and natural results and covers grey hair in 5 minutes. Hair color can be applied with just one comb', 'Revlon', '', '', '712', '2', 'Covers gray hair in 5 minutes.\r\nAmmonia-free formula which protects the natural texture of hair\r\nInfused with Mother of Pearl and Ginseng Root Extract that deliver shiny and resilient hair\r\nA complete hair coloring kit that comes with two brushes: 1 for full coverage and 1 for root touch-up.\r\nNo mixing required.\r\nEasy to use at home.\r\nAvailable in 8 shades.', '6', ''),
