('417', '3', '14', 'Set wet vertical hold hair gel', 'Set-wet-vertical-hold-hair-gel-465109', '', 'Active', 'Love showing off your hair in all its glory? Then Set Wet daily use vertical hold hair gel for men is the hair gel for you! You are a true adrenaline junkie. You breathe adventure for the thrill of pushing every limit. Challenges are your best friends and you face them in style. You are a great sport and have a bold sense of style. You will for sure stand out in the crowd when you have Set Wet daily use vertical hold hair gel for men by your side. For spiky look try the new and improved Set Wet daily use vertical hold hair gel for men that gives your hair the ultimate spikes. Set Wet daily use vertical hold hair gel for men is 100 percent alcohol free hair gel for men and contains added pro-vitamin B5 water soluble vitamin that moisturizes the hair, keeping it soft, strong and conditioned. Set Wet daily use vertical hold hair gel for men is for those who want to make a mark with their glorious spikes! Now make a style statement and \"sada sexy raho!\".', 'Set Wet', '', '', '48', '2', ' \r\nSet Wet  vertical hold hair styling gel gives your hair the prefect vertical look with a strong hold and get the desired look throughout the day\r\nAll Set Wet gels are free from bad chemicals like sulphate, mineral oil, alcohol, phthalate, petrolatum, formaldehyde, dea, sls, sles\r\nSet Wet hair gel range has an added boost of pro-vitamin B5\r\nStyle has a new mantra with Set Wet range. It is ideal for straight, wavy or curly hair types\r\nThis hair styling gel for men is specially formulated for daily grooming with all day mess  proof natural shine\r\nGet the desired look with runny texture that spreads evenly and remains intact', '6', ''),
('418', '3', '14', 'Set wet look styling gel ', 'Set-wet-look-styling-gel-495627', '', 'Active', 'Get the just out-of-the-shower, shiny look with Set Wet daily use Wet Look hair gel for men. Perfect for men who want to sport a mess-proof natural shine. Gentlemen behold, every dapper dudes style quotient is here! Youre classy and looking good for you is about the entire package. You make it a point to be respectful towards others, because as the saying goes - manners make the man, and you are a true gentleman. For a shiny wet look try Set Wet daily use Wet Look hair gel for men. Set Wet daily use Wet Look hair gel for men is a hair gel that gives your hair shiny wet look that stays all day long. Set Wet daily use Wet Look hair gel for men is 100 percent ALCOHOL FREE hair gel for men and contains added pro-vitamin b5 water soluble vitamin that moisturizes the hair, keeping it soft, strong and conditioned. Give your hair the strength they need and makes you feel more confident. Achieve any hairstyle you want to sport with Set Wet hair styling gel. Now make a mark for yourself and \"Sada Sexy Raho\"', 'Set Wet', '', '', '48', '2', 'Set Wet Daily Hair Styling Gel for Men Wet Look, Alcohol Free, Pro Vitamin B5, Light Hold & Shine', '6', ''),
('419', '3', '13', 'Clear Complete Active Care Anti Dandruff Shampoo ', 'Clear-Complete-Active-Care-Anti-Dandruff-Shampoo-315784', '', 'Active', 'In a world where it is almost too easy to blend in and go with the flow, CLEAR wants to empower men and women to stand out from the crowd and show the world their own unique point of view. To own their spotlight moments with the best version of themselves. The scalp is the foundation of beautiful hair. Unlike many other shampoos which only wash dandruff away, CLEAR shampoos are engineered to not only remove dandruff flakes, but also boost scalps natural self-defence*, ending recurring dandruff concern.** Clear Complete Active Care anti dandruff shampoo with its unique Nutrium Oil Complex makes hair stronger^ and more beautiful. It nourishes 3 scalp layers deep^^ and targets itch, dryness associated with dandruff, and dandruff itself at source. It increases the scalps natural resistance and strengthens hair from the roots up. It further quenches the thirsty scalp and hair with essential nourishment. Clear Active Care anti dandruff shampoo is suitable for all scalp and hair types. With Clear Active Care anti dandruff shampoo get up to 4X softer hair. Every moment can be your spotlight moment because you have Nothing to Hide. *Helps restore the function of scalp skin barrier **no visible flakes with regular use ^ vs non conditioning shampoo ^^ at epidermal level', 'Clear', '', '', '147', '2', 'This shampoo with the effective Nutrium Oil Complex formulation shields the scalp and hair against the recurring of intensive hair damage.\r\nClinically proven to help restore the scalp''s natural moisture balance\r\nIt eliminates dandruff and reduces grease\r\nRelieves your scalp from itching\r\nGently cleanses and nourishes the scalp while leaving hair soft and shiny', '6', ''),
