('439', '3', '13', 'Dove Anti Dandruff Care Shampoo', 'Dove-Anti-Dandruff-Care-Shampoo-348065', '', 'Active', 'Scared of going out with white scalp flakes over your shoulder? When white flakes appear, all we want to know is how to prevent dandruff  and quickly. Say ''bye'' to dandruff and dryness with the Dove Dandruff Care Shampoo. The ZPTO formula is clinically proven to target dandruff at its source. This shampoo removes dandruff* from your scalp without causing harm to your hair. Clinically tested, the formula enriched with ZPTO is proven to be successful at removing dandruff without leaving your hair dry & rough. ZPTO formula starts to clear visible flakes from the first wash. This gentle shampoo effectively relieves dandruff associated itches and clears up white flakes with regular use. The unique formula nourishes from roots up, combining beautiful hair results with effective dandruff relief*, for hair you can be proud of in no time. This anti-dandruff shampoo nourishes your hair from root up, combining beautiful hair results with effective dandruff relief*. Step out of the shower to soft, smooth and visibly flake- free strands*: quick results, with nourishing care, too. For best results, use Dove Dandruff Care shampoo along with Dove Dandruff Care conditioner together. *No visible flakes with regular product use, effect may vary with person.\r\n\r\n', 'Dove', '', '', '30', '2', '', '6', ''),
