('443', '3', '13', 'Dove Daily Shine Shampoo', 'Dove-Daily-Shine-Shampoo-905672', '', 'Active', 'The mystery of how to get shiny hair isn''t a tricky one to solve. The key to getting shiny damage free hair we all long for is making sure your hair is nourished, from the start of your routine. That''s where Dove Daily Shine Shampoo comes in. Dove Daily Shine Shampoo with Nutritive Serum builds a protective shield around the hair fiber and defends your hair from daily hair damage. It is a gentle hair cleanser that keeps your hair looking healthy and lustrous. It is mild on your scalp but gives protection from the aggression your hair faces every day. Its Nutritive Serum absorbs into the hair strands to keep them beautifully nourished and shiny, this Dove shampoo surrounds your hair with a protective shield, defending it from everyday stresses, like brushing & damage. And not only is it gentle enough to use every day, over time Dove Daily Shine Shampoo makes your hair better*. So, as well as cleansing from roots up, it helps make your hair look healthy, too. The result? Beautifully shiny, strong and silky hair which is everything you want it to be. *Based on lab test with Dove Daily Shine System vs non-conditioning shampoo', 'Dove', '', '', '176', '2,2,2', 'Nourishment and protection from daily damage, wear and tear\r\nDove shampoo adds shine to normal hair\r\nFormulated with Nutritive Serum\r\nLeaves hair strong and beautiful\r\nGentle formula that''s suitable for everyday use\r\nNourish and protect hair with Dove Daily Shine Shampoo, for shiny healthy-looking damage free hair', '6', ''),
