('448', '3', '14', 'V care shampoo hair colour ', 'V-care-shampoo-hair-colour-054813', '', 'Active', 'The safest way to color your hair in just 5 minutes! \r\n\r\n Peptides and oleanolic derivatives reduce hair loss and promote hair growth. In just 5 minutes, you''ll have the richness of natural-looking color with glossy shine thanks to a non-drip formula infused with Hydrolyzed Keratin and Silk Protein. \r\n\r\nKey ingredients- \r\n\r\nKeratin: Keratin works by smoothing down the cells that overlap to form the strands of your hair. The hair cuticle is a layer of cells that theoretically absorbs keratin, resulting in full, glossy hair. Keratin is also said to make curly hair less frizzy, more accessible to style, and appear straighter.\r\n\r\nSilk Protein: Higher molecular weight silk proteins have film-forming properties, making them excellent additions to hair care, particularly for dry or damaged hair, because they can increase moisture retention at the hair surface like conditioning. It acts like a one-two punch: Hydration and Strengthening. \r\n\r\n', 'V Care', '', '', '62', '2,2', 'Hair color shampoo black for men - you can change your hair color instantly without spending hours\r\nv care products for hair colour black is the apt hair products for men', '6', ''),
