('566', '3', '16', 'Yardley London Imperial Jasmine Body Spray', 'Surf-Excel-Easy-Wash-Detergent-Powder-573260', '', 'Active', 'Scent,:Sandalwood, Jasmine\r\nItem Form:Spray.', 'Yardley ', '', '', '180', '2', 'For the die hard lover of hills and mountains, rivers and canoes, forests and campfires, Yardley London brings a classic original fragrance in the form of the Yardley Adventure. The Yardley Adventure Deo Spray was conceived for the man who feels an inner proximity to nature and a perpetual willingness to set out on adventures to explore the unexplored. The elegant composition is a medley of enticing, exotic aromatic notes that blend in harmoniously to tease and titillate the senses and revitalize the spirits. The energy and vivacity of this delightful Yardley mass premium body spray provides round-the-clock protection against sweat and offensive body odour problems, especially following vigorous physical activities. Get re-energized and refreshed with this classy, natural fragrance from Yardley and feel ever-ready to walk out of home in search of new excitement and adventure.', '3', ''),
('567', '3', '16', 'Yardley London Imperial Sandalwood Body Spray', 'Surf-Excel-Easy-Wash-Detergent-Powder-047316', '', 'Active', 'Scent:Fresh\r\nTarget Gender:Unisex\r\nItem Form:Liquid.', 'Yardley ', '', '', '180', '2', 'Yardley London has been a purveyor of quality products since the 17th century when the Yardley family paid King Charles I to grant them a concession to manufacture soap for London.\r\nBringing English Luxury to India with refreshing fragrances.\r\nHow To Use: Hold upright and spray 15cms from the skin.\r\nFragrance Family: Fresh; Fragrance Classification: Body Mist.\r\nTarget Audience: Women.', '6', ''),
('568', '3', '16', 'Yardley London English Lavender Body Spray', 'Surf-Excel-Easy-Wash-Detergent-Liquid-375629', '', 'Active', 'Scent:Fresh, Lavender\r\nTarget Gender:Female\r\nItem Form:Spray.', 'Yardley ', '', '', '180', '2', 'Contemporary range of fragrances crafted from a bouquet of flowers. Experience the scent of fresh flowers from the English countryside in every spray; Yardley creates this deodorant fundamentally for the contemporary women who believe in subtlety.\r\nEnergizing and rejuvenating, English Lavender Deodorant Spray keeps body odor at bay and gives you a refreshing feel.\r\nBe assured that the smell of this deodorant will uplift your mood and aid you in carrying out your daily activities with vigor as it is long lasting. \r\nHow To Use: Hold upright and spray 15cms from the skin.\r\nTarget Audience: Women.', '6', ''),
('569', '4', '22', 'Surf Excel Matic Front Load Detergent Powder', 'Surf-Excel-Matic-Front-Load-Detergent-Powder-381507', '', 'Active', '', 'Surf Excel', '', '', '276', '2', '', '3', ''),
('570', '7', '91', 'Jovees silk foundation perfect glow & flawless finish spf15', 'Jovees-silk-foundation-perfect-glow-flawless-finish-spf15-378150', '', 'Inactive', 'Skin Tone:Light\r\n<p>Finish Type:Radiant</p>\r\n\r\n<p>Sun Protection:15 SPF</p>\r\n', 'Jovees', '', '', '266', '2', '<ul>\r\n	<li>Uniform tone to the complexion without clogging skin pores all through the day</li>\r\n	<li>A daily use lightweight foundation with SPF 15 and enriched with Argan Oil, Olive Oil, Vitamin E and other precious natural ingredients</li>\r\n	<li>It shall help improve skin radiance.</li>\r\n</ul>\r\n', '6', ''),
('571', '7', '91', 'Jovees lemon face wash', 'Jovees-lemon-face-wash-167923', '', 'Active', 'This gentle purifying face wash is enriched with natural lemon extracts that are loaded with Vitamin C, an antioxidant that shall help reduce skin damage and premature aging while infusing energy into skin. It leaves your skin clean, clear and energised, every single day.', 'Jovees', '', '', '185', '2', '<ul>\r\n	<li>Removes excess oil off your face, leaving a thoroughly clean and oil-free skin without making it dry.</li>\r\n	<li>Lemon has natural anti-bacterial properties and it reduces dark-spots and sign of an aging.</li>\r\n	<li>Orange Peel helps to have anti- oxidant properties which rejuvenate &amp; brighten your skin.</li>\r\n</ul>\r\n', '6', ''),
('572', '7', '91', 'Jovees essential advanced 4in1 moisturising face wash', 'Jovees-essential-advanced-4in1-moisturising-face-wash-189273', '', 'Active', 'Skin Type:All skin type, Dry', 'Jovees', '', '', '214', '2', '<ul>\r\n	<li>NATURAL EXFOLIATOR: Jovees Men Essential 4 in 1 facewash contains natural ingredients that help reduce dark spots, pigmentation, acne scars and fine lines. Its natural and effective exfoliating properties brighten the skin by removing dead skin cells and flaky patches on the top layer of your skin.</li>\r\n	<li>DEEP CLEANSER: Bilberry fruit extract deep cleanses, tightens, and nourishes the skin. Its antioxidant properties strengthen the skin&rsquo;s texture, evens out skin tone and keeps your skin moisturised.</li>\r\n	<li>SKIN REJUVENATOR: Enriched with Vitamin C and E which aid in regeneration of skin cells and helps improve skin elasticity.</li>\r\n	<li>SHEER MOISTURE: Provides intense hydration to the skin with the help of linoleic acid present in the fruit extracts. This nourishes the skin from the outside and gives your skin the ability to absorb nutrients and hold onto water longer. Great for those with perpetually dry skin.</li>\r\n	<li>DERMATOLOGICALLY TESTED. Suitable for women of all skin types. Paraben, Alcohol and Cruelty free.</li>\r\n	<li>JOVEES HERBAL MEN&rsquo;S 4 IN 1 FACE WASH Skincare is for everyone, and this 4-in-1 face wash acts as a cleanser, exfoliator, skin rejuvenator, and moisturiser. Multiple benefits packed in one bottle make it perfect for a hassle-free morning and night ritual every single day. Key Ingredients: Indian Gooseberry : The antioxidants and Vitamin C present in the Indian gooseberry help to brighten, tone, and tighten your skin. Neem Extract is still the best herbal solution to get rid of acne, inflammation, excess oil, and blemishes. White Morus Root lightens age spots and evens out the skin tone. How To Use: Moisten your face with a splash of water. Squeeze out a small coin-sized amount of the product on your palm. Rub your hands together and massage gently on your face and neck. Rinse thoroughly and pat dry. Don&rsquo;t forget to follow it up with a toner and a moisturiser. Use twice a day for best results. At Jovees, we pick the best herbal and ayurvedic ingredients to craft well balanced and effective products that nourish your skin and hair. Started in 2004, Jovees products are now available in India, Sri Lanka, Hong Kong, France, Maldives, Australia and Spain. To see Jovees complete range of beauty products, please click on the JOVEES link in blue above the product title. For fresh supply, purchase directly from the manufacturer i.e. Seller Name: Jovees Herbal.</li>\r\n</ul>\r\n', '6', ''),
('573', '7', '91', 'Jovees men essential advanced 7in1 skin boosting cream', 'Jovees-men-essential-advanced-7in1-skin-boosting-cream-375420', '', 'Active', 'Jovees Advanced 7 in 1 Skin Boosting Cream for Men is formulated after an extensive research followed by clinical tests. Enriched with naturally derived plant extracts this skin boosting cream helps brighten the skin, lighten discoloration, smoothes fine lines, strengthens skin&#39;s defences against environmental aggressors and repairs and renew skin cells. Loaded with antioxidants derived from vitamin C it helps fight free radical damage. The broad spectrum of SPF 15 protects skin from tanning and the harmful UV rays. About the Brand: Jovees, a line of herbal and Ayurvedic products is result of an extensive research aligning the power of herbs and science. Blending Ayurveda, the oldest Indian indigenous medicine system with new age technology, Jovees offers wide range of innovative skin and body care products and cosmetics that are made using natural, organic ingredients and are quite effective in results.', 'Jovees', '', '', '252', '2', '<ul>\r\n	<li>Application Area: Face</li>\r\n</ul>\r\n\r\n<p>&bull; For Men</p>\r\n\r\n<p>&bull; For All Skin Types</p>\r\n\r\n<p>&bull; Cream Form</p>\r\n', '6', ''),
