('669', '2', '3', 'Nestle CERELAC Baby Cereal with Milk, Wheat Apple Cherry', 'Nestle-CERELAC-Baby-Cereal-with-Milk-Wheat-Apple-Cherry-865970', '', 'Active', 'Brand:Nestl&eacute; CERELAC FlavourWheat Apple Cherry Item Form:powder Net Quantity:300.0 gram Number of Items:1 Package Information:Bag-In-Box', 'Nestle ', '', '', '295', '2', 'Nestl&eacute; CERELAC Baby Cereal with Milk, Wheat Apple Cherry is a complementary food for babies from 8 to 12 months. While infants and children have higher requirements of nutrients than adults, 2 serves of CERELAC Wheat Apple Cherry Cereal provides 75% of a baby&rsquo;s daily need of iron. It is also, a source of 18 important nutrients including vitamins and minerals. Nestl&eacute; develops infant nutrition products backed by evolving science and research. Innovation has been at the heart of Nestl&eacute; since its beginning. Optimal Preparation: Careful and hygienic preparation of Infant food is most essential for health. Do not use fewer scoops than directed, since diluted feeding will not provide adequate nutrients needed by your infant. Do not use more scoops than directed since concentrated feed will not provide the water needed by your infant. Storage:After opening the pack, the contents should immediately be transferred to an empty, clean, dry and airtight container.Replace the lid tightly after every use and store in a cool, dry place. Ensure enclosed scoop is thoroughly washed and dried before use. After opening, use the contents within 3 weeks or the expiry date, whichever is earlier. Important Notice:Mother&rsquo;s milk is best for your baby. Safety Warnings: Infant food should be used only on the advice of a health worker as to the need for its use and the proper method of its use. Infant food is not the sole source of nourishment for an infant. Use prepared feed within half an hour otherwise microbial deterioration may set in. Discard unused feed.', '2', ''),
