('676', '3', '13', 'Dove dryness care shampoo', 'Dove-dryness-care-shampoo-163592', '', 'Active', 'Harsh, humid weather taking a toll on your beautiful hair causing damage with every passing day? Guard your hair against harsh weather. Crafted from a perfect blend of ingredients, the shampoo helps to restore hair softness and smoothness. To help prevent daily hair damage, Dove Nutritive Solutions Dryness Care Shampoo nourishes normal and dry locks for healthy looking hair. The shampoo cleans your dry locks and gives it a shiny and glossy look. The specially designed formula of this dryness care shampoo is perfect for days when your dry hair needs help. Dove Dryness Care Shampoo is just what you need for smooth and bouncy hair! This moisturizing and nourishing shampoo helps to protect hair from damage, for silky, soft locks. Uniquely formulated with Pro-Moisture Complex, this Dove shampoo nourishes hair strands from within. Dove Dryness Care Shampoo nourishes hair with each application, for strong hair thats manageable and healthy looking. Gently massage this shampoo into your scalp to create a lather and rinse well. After wash, this shampoo makes your hair look glossy and locks dryness of your hair. Smooth, soft and more resilient to daily damage from grooming and brushing,  beautiful hair is just one wash away with this nourishing shampoo.', 'Dove', '', '', '171', '2,2', 'Dove dryness care shampoo for smoother hair more resilient to damage\r\nStrengthening shampoo formulated with pro-moisture complex\r\nHelps protect hair from daily wear and tear\r\nFor manageable and silky hair every day.\r\nNourishes hair to help it withstand 90 percent of damage even before it happens\r\nSuitable for daily use. Ideal for Men. For all Hair types. Directions to Use: Apply to wet hair. Lather and Rinse Off.', '3', ''),
