with eyes</li>\r\n	<li>Chicco () is one of the largest baby care brands in the world. With experience of over 60 years, it offers a wide range of baby products in nursing, baby toiletries, toys, travel (strollers and car safety seats) and fashion categories</li>\r\n	<li>Quantity: 2 packs with 72 pcs each. Total 144 pcs</li>\r\n</ul>\r\n', '2', ''),
