('832', '3', '20', 'Dabur chyawanprash', 'Dabur-chyawanprash-871234', '', 'Active', 'Do you think your child has inner strength? Do you worry that your child will fall ill? Do you feel that your child may miss school due to falling ill? Do you doubt that only good food is not enough for your child&rsquo;s good health? If your answer to any of the above questions is yes, then Dabur Chyawanprash is the answer to your child&rsquo;s health worries - A recipe used in Ayurveda since ancient times,chyawanprash offers a wide range of health benefits. Dabur Chyawanprash provides strong immunity and good digestion for children and adults alike. Two spoons daily of Dabur Chyawanprash supports immunity and is beneficial for overall health and well being. It is also good for the digestive and respiratory systems. The primary action of Dabur Chyawanprash is to bolster the immune system and to support the body&rsquo;s natural ability to fight illnesses . Amalaki (the main ingredient) aids in the elimination of ama (toxins). Therefore, regular use of Dabur Chyawanprash helps strenghten body&rsquo;s natural defense systems. It builds the essence of immunity, promoting systemic health and well-being. ingredients of Dabur Chyawanprash are scientifically validated for their beneficial effects on health. It is considered one of the best family tonics&mdash;suitable for all ages from young children to the elderly. (Children above 3 years of age).', 'Dabur', '', '', '109', '2,2,2', '<ul>\r\n	<li>Dabur Chyawanprash boosts ability to fight illnesses*</li>\r\n	<li>2 spoons of Dabur Chyawanprash daily help to keep your child protected</li>\r\n	<li>It is 2 spoons of protection with good taste</li>\r\n	<li>Dabur Chyawanprash is a daily dose for your family to build Strength &amp; Stamina</li>\r\n	<li>It fights illness* with the power of double immunity - (*Illness refers to common day to day infections and allergies).</li>\r\n</ul>\r\n', '0', ''),
