('1098', '3', '15', 'Banjaras Aloe Vera Moisturizing Cream', 'Banjaras-Aloe-Vera-Moisturizing-Cream-402175', '', 'Active', 'Special Ingredients:Aloevera Extract, Vitamin E &amp; Titanium Dioxide\r\n<p>Product Benefits:Banjara&#39;s Aloe Vera Moisturizing cream Formulated with Vitamin E , is a nutrient- rich skin nourishing cream. The cream promotes cell renewal, boosts skin immunity &amp; gives the skin a renewed glow.</p>\r\n\r\n<p>Skin Type:All</p>\r\n\r\n<p>Item Form:Cream</p>\r\n', 'Banjaras', '', '', '135', '2', '<ul>\r\n	<li>Banjara&#39;s Aloe vera Skin Moisturizing Cream formulates with Vitamin E , is a nutrient - rich skin nourishing cream. The cream promotes cell renewal, boosts skin immunity &amp; gives the skin a renewed glow.</li>\r\n</ul>\r\n', '2', ''),
('1099', '3', '15', 'Banjaras Aloe Vera Cucumber Gel', 'Banjaras-Aloe-Vera-Cucumber-Gel-103927', '', 'Active', 'Special Ingredients:Aloe Vera Leaf Juice, Cucumber Extract, Glycerin &amp; Provitamin B5\r\n<p>Product Benefits:A Moisturizing blend of Aloevera and Cucumber naturally nourishes the skin. It will boost your skin&#39;s hydration and combat skin dullness. Regular use helps to heal blemishes and soothes skin. Enjoy refreshed, supple skin all day long.</p>\r\n\r\n<p>Skin Type:Combination</p>\r\n\r\n<p>Item Form:Gel</p>\r\n', 'Banjaras', '', '', '99', '2', '<p>A moisturising blend of aloe Vera and cucumber naturally nourishes the skin. It will boost your skin&#39;s hydration and combat skin dullness. Regular use helps to heal blemishes and soothes skin. Enjoy refreshed, supple skin all day long.</p>\r\n', '2', ''),
('1100', '3', '15', 'Banjaras Aloe Vera Moisturizing gel', 'Banjaras-Aloe-Vera-Moisturizing-gel-248360', '', 'Active', 'Special Ingredients:Aloe Vera Leaf Juice, Glycerine &amp; Provitamin B5\r\n<p>Product Benefits:The Aloe Vera Gel in its purest form taken fresh from nature, to give you the best skin care.It is a natural moisturizer with anti-bacterial, anti-inflammatory and anti-oxidant benefits. Naturally protects skin cells from environmental damage. The gel is ideal for soft, glowing and pampered skin.</p>\r\n\r\n<p>Skin Type:All</p>\r\n\r\n<p>Item Form:Gel</p>\r\n', 'Banjaras', '', '', '81', '2', '<ul>\r\n	<li>Moisturizing gel with non sticky feeling; Enriched with aloevera leaf juice, glycerin and pro-vitamin b5</li>\r\n	<li>Antibacterial, anti-inflammatory and anti-oxidant benefits</li>\r\n	<li>Protects the skin from the environmental damage</li>\r\n	<li>Gives the moisture, soft and glowing skin</li>\r\n	<li>Ideal for all skin type</li>\r\n	<li>Banjara&rsquo;s brings to you aloe vera gel in its purest form taken fresh from nature, to give you the best skin care secret. Aloe vera is a world renowned plant for its cosmetic and medicinal properties. It is a natural moisturizer with anti-bacterial, anti-inflammatory and anti-oxidant benefits. Naturally protects skin cells from environmental damage. The gel is an ideal solution for gifting yourself soft, glowing and pampered skin.</li>\r\n</ul>\r\n', '2', ''),
('1101', '3', '15', 'Banjaras Aloe Vera Rose Gel', 'Banjaras-Aloe-Vera-Rose-Gel-649017', '', 'Active', 'Special Ingredients:Aloe Vera\r\n<p>Product Benefits:Moisturizing</p>\r\n\r\n<p>Material Type Free:Alcohol Free</p>\r\n\r\n<p>Skin Type:All.</p>\r\n', 'Banjaras', '', '', '108', '2', '<ul>\r\n	<li>Aloe Vera Rose Gel is a pure, concentrated and freshly-pressed gel made from fresh aloe leaves, rose petals, and natural oils. It contains no artificial colors, fragrances, or preservatives. Banjaras Aloe Rose Gel is suitable for all skin types and is used as a moisturizer, toner, eye cream, lip balm, hair conditioner, and general skincare product.</li>\r\n</ul>\r\n', '2', ''),
('1102', '3', '15', 'Banjaras Aloe vera Saffron Gel ', 'Banjaras-Aloe-vera-Saffron-Gel-301749', '', 'Active', 'Product Benefits:Hydrating\r\n<p>Skin Type:Combination</p>\r\n\r\n<p>Item Form:Gel</p>\r\n\r\n<p>Specific Uses For Product:Hydration, Brightening</p>\r\n', 'Banjaras', '', '', '108', '2', '<ul>\r\n	<li>ALOE VERA CUCUMBER GEL : Cucumber is nature&rsquo;s answer for healthy, glowing supple skin. Ancient beauty regimes swear by the cooling effects of cucumber, as it softens, brightens and whitens skin. Aloevera or Gritha Kumari, known for its regenerative, and restorative properties to make skin youthful and supple is a skin care staple. Aloevera gel infused with cucumber stimulates skin cell regeneration, hydrates the skin, and reduces blemishes and dark patches, giving radiant, bright and moisturized skin. ALOE VERA SAFFROn GEL : Saffron or Kumkuma, known in Ayurveda for its warm glow and part of many traditional beauty regimes, saffron adds lumniscience to the skin, evens out the skin tone, reduces spots and blemishes, making it radiant. When combines with aloevera in our unique formulation, Banjara&rsquo;s Aloevera saffron gel will be your favorite goto, to all skin problems and a simple daily hydration routine.</li>\r\n</ul>\r\n', '2', ''),
