('1158', '3', '15', 'Banjaras Bhringraj powder ', 'Banjaras-Bhringraj-powder-958164', '', 'Active', 'Hair Type:All\r\n<p>Product Benefits:Amla Hair Care Powder is a rich source of Vitamin C. It prevents premature greying of hair, helps to reduce dandruff &amp; hairfall, imparts luster to hair thereby making the hair healthy.</p>\r\n\r\n<p>Active Ingredients:Amla Powder</p>\r\n\r\n<p>Scent:Amla</p>\r\n', 'Banjaras', '', '', '63', '2', '<ul>\r\n	<li>Natural raw herb powder and many nutritional values</li>\r\n	<li>It is an excellent natural hair conditioner</li>\r\n	<li>Stops falling of hair and strengthens hair roots</li>\r\n	<li>No fillers added, pure powder of emblica officinalis</li>\r\n	<li>Banjara&#39;s amla powder has the highest content of naturally occuring vitamin c and acts as a natural anti oxidant and in powder form is greate for topical application to the hair. The main advantages of applying amla powder to hair is keeping the hair black &amp; healthy and causing a cooling effect on hair.</li>\r\n</ul>\r\n', '3', ''),
