('1160', '3', '15', 'Banjaras Hibiscus Flower Powder for Hair', 'Banjaras-Hibiscus-Flower-Powder-for-Hair-157239', '', 'Active', 'Active Ingredients:Amino acids.', 'Banjaras', '', '', '90', '2', '<ul>\r\n	<li>In Ayurvedic traditions, hibiscus flowers are considered highly sattvic and sacred. They are used in spiritual practices for their ability to open the heart and encourage love and devotion. When used internally, hibiscus helps remove excess heat from the Head.</li>\r\n	<li> It&#39;s regular application on hair helps nourish scalp and hair. It helps strengthen the roots. Regular use of hibiscus controls damage of hair. Hibiscus helps prevent hair from breakage resulting into long and strong hair. Volume boost : With regular use of hibiscus, it helps hair become thicker and denser</li>\r\n	<li> 100% NATURAL : Our Hibiscus flower Powder is 100% Natural.</li>\r\n	<li> Hair mask: Mix with other ingredients of choice or by itself with lemon juice or curd and apply all over from root to tip. Leave for 30 mins and wash with a gentle hair cleanser.</li>\r\n	<li>Hibiscus flowers are not just beautiful, but have amazing benefits for hair growth, deep conditioning, and hair growth. Amino acids in hibiscus promote Keratin, the building block of hair and nails - making your hair longer, stronger and thicker.</li>\r\n</ul>\r\n', '3', ''),
('1161', '3', '15', 'BanjaraS Kasturi Turmeric Skin Care Powder', 'BanjaraS-Kasturi-Turmeric-Skin-Care-Powder-365719', '', 'Active', 'Skin Type:Acne Prone\r\n<p>Product Benefits:Anti-bacterial, Exfoliating</p>\r\n\r\n<p>Item Form:Powders.</p>\r\n', 'Banjaras', '', '', '90', '2', '<ul>\r\n	<li>Natural anti-microbial product</li>\r\n	<li>It removes pimples</li>\r\n	<li>It removes dead skin cell</li>\r\n	<li>Kasturi turmeric skin care powder is a natural anti-bacterial product. It removes acne and blemishes. Makes the skin radiant by preventing the wrinkles &amp; reducing pigmentation. It gently exfoliates the skin and gives you clear, radiant, glowing &amp; healthy skin.</li>\r\n</ul>\r\n', '3', ''),
