('1167', '3', '15', 'Banjaras Orange Peel Skin Care Powder', 'Banjaras-Orange-Peel-Skin-Care-Powder-021538', '', 'Active', 'Product Benefits:Exfoliating, Fine Lines Treatment\r\n<p>Item Form:Powder</p>\r\n\r\n<p>Scent:Orange.</p>\r\n', 'Banjaras', '', '', '72', '2', '<ul>\r\n	<li>Clear healthy radiant and glowing skin</li>\r\n	<li>Makes the skin radiant by preventing wrinkles and fine lines</li>\r\n	<li>Exfoliates and rejuvenates the skin</li>\r\n	<li>Banjara&#39;s all products are made from good quality material. We offer different types of items. It can be an ideal gift. Care instructions: inflammable, keep in cool dry place away from heat and open flame, keep out of reach of children.</li>\r\n</ul>\r\n', '3', ''),
('1168', '3', '15', 'Banjaras Rose Moisturizing Cream', 'Banjaras-Rose-Moisturizing-Cream-694352', '', 'Active', 'Special Ingredients:Rose Extract, Vitanim E &amp; Shea Butter\r\n<p>Product Benefits:Intense Hydration .Skin&#39;s best Anti-Inflammatory Regenerates the skin cells Reduces appearance of fine lines Makes your skin Glow.</p>\r\n\r\n<p>Material Type Free:Oil Free, Petrolatum Free, Sodium Lauryl Sulfate Free, Sulfate Free, Paraben Free</p>\r\n\r\n<p>Skin Type:All.</p>\r\n', 'Banjaras', '', '', '90', '2', '<ul>\r\n	<li>For both Men &amp; Women . For all skin types.</li>\r\n	<li>Intense Hydration .Skin&#39;s best Anti-Inflammatory</li>\r\n	<li>Regenerates the skin cells</li>\r\n	<li>Reduces appearance of fine lines</li>\r\n	<li>Makes your skin Glow</li>\r\n	<li>Banjara&#39;s Rose Moisturizing Cream helps soften and tone dry skin. This cream is lightweight, spreads easily and gets absorbed without feeling sticky.</li>\r\n</ul>\r\n', '3', ''),
('1169', '3', '15', 'Banjaras Rose Water', 'Banjaras-Rose-Water-913702', '', 'Active', 'Product Benefits:Softening, Tightening\r\n<p>Item Form:Oil</p>\r\n\r\n<p>Scent:Rose</p>\r\n', 'Banjaras', '', '', '135', '2,2,2,2,2', '<ul>\r\n	<li>Enriched with rose oil</li>\r\n	<li>Its also works as a natural skin toner by tightening pores.</li>\r\n</ul>\r\n', '3', ''),
('1170', '3', '15', 'Banjaras Rose Water Gel', 'Banjaras-Rose-Water-Gel-137985', '', 'Active', 'Special Ingredients:Gulab Ark (Flower ) Extract, Sodium Lactate &amp; Gluconate\r\n<p>Product Benefits:Banjara&#39;s Rose Water Gel smoothens the skin while cleansing the impurities from the skin. It makes your skin soft &amp; supple. Regular use diminishes fine lines and deeply hydrates the skin.</p>\r\n\r\n<p>Skin Type:All</p>\r\n\r\n<p>Item Form:Gel.</p>\r\n', 'Banjaras', '', '', '81', '2', '<ul>\r\n	<li>WHAT IS ROSE WATER GEL? If you like that classic rose scent you&rsquo;ll love this. It&rsquo;s thick and has a gel consistency but when applied leaves you with baby skin. Smells like a blooming rose and feels cooling to the skin. The sheer water gel formula is instantly absorbed into skin, replenishing moisture throughout the day while leaving no greasy residue behind. The cooling blend moisturizes &amp; hydrates skin.</li>\r\n	<li>This product can be used to feel simply refreshed at any point of time with a few sprays to your face or can be used after using the Rose Water (Toner) to feel extra moisturised &amp; to enhance the makeup attributes with this on, underneath.</li>\r\n	<li>For Men &amp; Women. Suitable for All Skin Types.</li>\r\n	<li>It hydrates well, calms the skin, and smells great. The product is free of animal ingredients, mineral oil, urea &amp; tar pigment.</li>\r\n	<li>Target Gender: Unisex.</li>\r\n</ul>\r\n', '3', ''),
('1171', '3', '15', 'Banjaras Saffron Face Wash with Nutgrass Extracts', 'Banjaras-Saffron-Face-Wash-with-Nutgrass-Extracts-825741', '', 'Inactive', 'Skin Type:Dry\r\n<p>Product Benefits:Saffron Face Wash formulated with Nutgrass, gently and effectively removes impurities, dirt and makeup. The gel formula conditions and hydrates skin without leaving it tight and dry. It replenishes essential moisture to the skin, while softening it, so your complexion is supple to the touch and luminous.</p>\r\n\r\n<p>Special Ingredients:Saffron, Nutgrass</p>\r\n\r\n<p>Item Form:Gel Mousse</p>\r\n', 'Banjaras', '', '', '105', '2,2', '<ul>\r\n	<li>Gently cleanses and effectively removes impurities, dirt and makeup</li>\r\n	<li>Hydrates skin without leaving it tight or dry</li>\r\n	<li>Replenishes essential moisture to the skin, while softening it, so your complexion is supple to the touch and luminous</li>\r\n	<li>Saffron face wash formulated with nutgrass, gently and effectively removes impurities, dirt and makeup.The gel formula conditions and hydrates skin without leaving it tight and dry.It replenishes essential moisture to the skin, while softening it, so your complexion is supple to the touch and luminous.</li>\r\n</ul>\r\n', '3', ''),
('1172', '3', '15', 'Banjaras Saffron Face Wash With Pomegranate', 'Banjaras-Saffron-Face-Wash-With-Pomegranate-047315', '', 'Inactive', 'Skin Type:Combination\r\n<p>Product Benefits:Saffron Face Wash enriched with pomegranate, gently and effectively removes impurities, dirt and makeup. The gel formula conditions and hydrates skin without leaving it tight and dry. It visibly brightens, hydrates and improves skin texture, so your complexion looks and feels its best.</p>\r\n\r\n<p>Special Ingredients:Pomegranate & Saffron</p>\r\n\r\n<p>Item Form:Gel Mousse.</p>\r\n', 'Banjaras', '', '', '57', '2', '<ul>\r\n	<li>Your skins daily dose of tender, loving care enriched with the goodness of fragrant saffron, and lush pomegranate extracts.</li>\r\n	<li>Refreshing and invigorating, this cleanser will leave your face with a fragrant, satin smooth, satisfied feel.</li>\r\n	<li>Nourishing blends of saffron and pomegranate extracts which balance the pH of the skin, promotes cell repair, reverse sun damage, and stimulates collagen production.</li>\r\n	<li>Freshness that is sure to be an inseparable part of your day and night beauty ritual.</li>\r\n</ul>\r\n', '3', ''),
('1173', '3', '15', 'Banjaras Saffron Face Wash with Sandal Extracts', 'Banjaras-Saffron-Face-Wash-with-Sandal-Extracts-035821', '', 'Inactive', 'Skin Type:Oily\r\n<p>Item Form:Gel Mousse</p>\r\n\r\n<p>Use for:Face</p>\r\n\r\n<p>Scent:Sandalwood.</p>\r\n', 'Banjaras', '', '', '105', '2,2', '<ul>\r\n	<li>The gel formula conditions and hydrates skin without leaving it tight and dry.</li>\r\n	<li>It replenishes essential moisture to the skin, while softening it, so your complexion is supple to the touch and luminous.</li>\r\n	<li>Our unique hydra-gel formulation leaves the skin feeling clean, supple and baby-soft while keeping its natural oils locked in.</li>\r\n</ul>\r\n', '3', ''),
('1174', '3', '15', 'Banjaras Saffron Face Wash With Tulsi', 'Banjaras-Saffron-Face-Wash-With-Tulsi-401389', '', 'Inactive', 'Face Wash Type:Gel\r\n<p>Applied :Skin Brightening</p>\r\n\r\n<p>Skin Types: All types.</p>\r\n', 'Banjaras', '', '', '105', '2,2', '<ul>\r\n	<li>An alluring interfusion of saffron''s warmth and the irreplaceable, mellow Tulsi, this face wash gently cleanses and conditions your skin, deflecting any dirt and pollutants, leaving it fresh, and sparkling clean. Pamper your skin with Saffron Face Wash with tulsi as we infuse the richness of Saffron (Kumkuma), known in Ayurveda for its lustre and lightening properties, along with ''Tulsi'' or Holy basil, which apart from its religious significance, is called the ''Anupameya'' or the incomparable one in Ayurveda, for its multifaceted properties. Our special hydra-gel formulation leaves the skin feeling bright, conditioned and satin-soft while being mild.</li>\r\n</ul>\r\n', '3', ''),
('1175', '3', '15', 'Banjaras Sunscreen SPF 50 PA+', 'Banjaras-Sunscreen-SPF-50-PA-910436', '', 'Active', 'Skin Type:Combination\r\n<p>Product Benefits:With SPF 50 &amp; PA+++, Banjara&#39;s Sunscreen SPF 50 PA++++ assures maximum protection from UV-ray induced sun damage &amp; provides the highest level of broad-spectrum sun protection and with Licorice &amp; Gotukola extracts protects the skin from sunburn, hyperpigmentation and dark spots. It keeps the skin hydrated and nourished.</p>\r\n\r\n<p>Active Ingredients:Licorice Root Extract &amp; Gotukola Extracts.</p>\r\n', 'Banjaras', '', '', '270', '2', '<ul>\r\n	<li>The Banjara&rsquo;s Continuous Protection Sunscreen with Licorice provides the highest level of broad-spectrum sun protection and protects the skin from sunburn, hyperpigmentation and dark spots. It keeps the skin hydrated and nourished.</li>\r\n	<li>With SPF 50 &amp; PA+++, it assures maximum protection from UV-ray induced sun damage. The sunscreen lotion forms a protective umbrella on your skin that helps to maintain your natural complexion.</li>\r\n	<li>This sunscreen lotion does not contain mineral oil and toxic chemicals such as paraben, phthalate, silicone, and sulfates. This product has not been tested on animals.</li>\r\n	<li>When to Use: 15 minutes before sun exposure apply an appropriate amount of the lotion to the exposed areas of your body. Reapply at least every 2 hours or after rubbing the skin with a towel.</li>\r\n	<li>For All Skin Types.</li>\r\n</ul>\r\n', '3', ''),
('1176', '3', '15', 'Banjaras Aloe Vera Almond Gel', 'Banjaras-Aloe-Vera-Almond-Gel-653700', '', 'Active', 'Product Benefits:Hydrating\r\n<p>Skin Type:Combination</p>\r\n\r\n<p>Item Form:Gel</p>\r\n\r\n<p>Specific Uses For Product:Hydration, Brightening</p>\r\n', 'Banjaras', '', '', '108', '2', '<ul>\r\n	<li>ALOE VERA CUCUMBER GEL : Cucumber is nature&rsquo;s answer for healthy, glowing supple skin. Ancient beauty regimes swear by the cooling effects of cucumber, as it softens, brightens and whitens skin. Aloevera or Gritha Kumari, known for its regenerative, and restorative properties to make skin youthful and supple is a skin care staple. Aloevera gel infused with cucumber stimulates skin cell regeneration, hydrates the skin, and reduces blemishes and dark patches, giving radiant, bright and moisturized skin. ALOE VERA SAFFROn GEL : Saffron or Kumkuma, known in Ayurveda for its warm glow and part of many traditional beauty regimes, saffron adds lumniscience to the skin, evens out the skin tone, reduces spots and blemishes, making it radiant. When combines with aloevera in our unique formulation, Banjara&rsquo;s Aloevera saffron gel will be your favorite goto, to all skin problems and a simple daily hydration routine.</li>\r\n</ul>\r\n', '3', ''),
