('1239', '3', '15', 'Biotique Bio Basil and Sandalwood Refreshing Body Powder', 'Biotique-Bio-Basil-and-Sandalwood-Refreshing-Body-Powder-295417', '', 'Active', 'Product Benefits:Freshening\r\n<div>Item Form:Powder</div>\r\n\r\n<div>Scent:Sandalwood.</div>\r\n', 'Biotique', '', '', '128', '2', '<ul>\r\n	<li>This cooling, pampering powder is a blend of pure basil, margosa, Indian corn and red sandalwood extracts, to help brighten body skin and keep it fresher and drier all day</li>\r\n	<li>Absorbs wetness and blocks odor</li>\r\n	<li>Leaves body skin silky-soft to the touch</li>\r\n	<li>Country of Origin: India.</li>\r\n</ul>\r\n', '3', ''),
('1240', '3', '15', 'Biotique Bio Fruit Whitening, Depigmentation and Tan Removal Face Pack', 'Biotique-Bio-Fruit-Whitening-Depigmentation-and-Tan-Removal-Face-Pack-521496', '', 'Active', 'Skin Type:Combination\r\n<div>Product Benefits:Whitening</div>\r\n\r\n<div>Active Ingredients:Acacia</div>\r\n', 'Biotique', '', '', '71', '2', '<ul>\r\n	<li>How to use: apply evenly over cleansed face and neck leave on for 15-20 minutes, rinse with water or damp washcloth, use daily or as needed to lighten and brighten the complexion</li>\r\n	<li>Ingredients: multani mitti (fuller&#39;s earth), geru (garric), yasad hhasma (yasad bas), tamator (lycopersicum esculentum), ananas (ananas c), kikargaund (acacia Arabica), paste base q.S</li>\r\n	<li>Biotique is based on 5000-year-old ayurvedic recipes known to integrate and celebrate body, mind and spirit, blending proven ayurvedic therapies with the science of 21st century bio-technology</li>\r\n	<li>Packaging may vary according to stock availability</li>\r\n	<li>This luxurious whitening and de-pigmentation pack is blended with the juices of pineapple, tomato, lemon and papaya fruit to visibly lighten skin for a fairer, flawless look. With regular use, skin reclaims its soft, smooth, youthful tone and texture.</li>\r\n</ul>\r\n', '3', ''),
('1241', '3', '15', 'Biotique Bio White Advanced Fairness Treatment Cream ', 'Biotique-Bio-White-Advanced-Fairness-Treatment-Cream-628350', '', 'Active', 'Skin Type:All\r\n<div>Item Form:Cream</div>\r\n\r\n<div>Scent:Lemon</div>\r\n\r\n<div>Age Range :Adult.</div>\r\n', 'Biotique', '', '', '109', '2', '<ul>\r\n	<li>Item Form: Cream</li>\r\n	<li>Fruit has been the juice of health and vitality since the beginning of time</li>\r\n	<li>Rich in essential vitamins, nutrients and natural skin brighteners</li>\r\n	<li>Quantity: 150ml; Item Form: Gel</li>\r\n	<li>Skin Type: For All Skin Types; Container Type: Tube. No animal testing</li>\r\n	<li>Biotique Bio White Advanced Fairness Treatment Cream, 50gThis luxurious advanced fairness treatment cream is blended with the juices of pineapple, tomato and lemon fruit to visibly lighten skin for a fairer, flawless look, with regular use, skin reclaims its soft, smooth, youthful tone and texture.Biotique Bio White Advanced Fairness Face Wash, 150mlThis fresh-foaming gel is blended with the juices of pineapple, tomato, lemon and papaya fruit to visibly lighten skin for a fairer, flawless look. With regular use, skin reclaims its soft, smooth, youthful tone and texture.</li>\r\n</ul>\r\n', '3', ''),
('1242', '3', '15', 'Biotique Cucumber Pore Tightening Refreshing Toner with Himalayan Waters', 'Biotique-Cucumber-Pore-Tightening-Refreshing-Toner-with-Himalayan-Waters-620349', '', 'Inactive', 'Skin Type;Combination\r\n<div>Product Benefits:Tightening, Ph Balancing</div>\r\n', 'Biotique', '', '', '166', '2', '<ul>\r\n	<li>Helps reduce the risk of skin aging and other harmful effects of the sun</li>\r\n	<li>It is formulated to bring the complexion into perfect pH balance and help keep skin in its purest state. Maximum Shelf life: 36 Months. For Oily skin and normal skin</li>\r\n	<li>Ingredients: Daruhaldi (Berberis aristata), Dhania (Coriandrum sativum), Majuphal (Quercus infectoria), Pudina (Mentha arvensis)</li>\r\n	<li>Country of Origin: India.</li>\r\n</ul>\r\n', '3', ''),
