('1594', '5', '34', 'Ensure diabetes care chocolate flavour', 'Ensure-diabetes-care-chocolate-flavour-296348', '', 'Active', 'Ensure is a complete and balanced nutrition supplement for adults. It has perfect blend of 32 vital nutrients. It is scientifically designed for adults to help them keep strong and healthy and also help to support recovery. Ensure enjoys the trust of adults and doctors in more than 90 countries around the world.', 'Ensure', '', '', '361', '2', '<ul>\r\n	<li>Complete, Balanced nutrition designed for adults with diabetes. It is sugar-free* and is available in two delicious flavours&ndash;Vanilla Delight and Chocolate</li>\r\n	<li>A scientifically formulated nutrition with slow release energy system which helps manage blood glucose levels and provide steady energy</li>\r\n	<li>Country of Origin: India</li>\r\n	<li>Contains High Protein- essential to support muscle mass along with vitamins and minerals. It is by nature Gluten-free and lactose free</li>\r\n	<li>Supports Heart Health:It is trans-fat free</li>\r\n	<li>HOW TO PREPARE &ndash; Add 6 Scoops of Ensure Diabetes Care powder in 200 ml water. Stir until dissolved and enjoy. One serving of EnsureDiabetes Care provides approximately 226 K cal</li>\r\n	<li>Disclaimers - sugar means only sucrose +compared to a standard shake/ formula.</li>\r\n</ul>\r\n', '3', ''),
('1596', '5', '34', 'Ensure diabetes care vanilla delight flavour', 'Ensure-diabetes-care-vanilla-delight-flavour-253796', '', 'Active', 'Brand:Ensure Diabetes Care\r\n<div>Flavour:Vanilla</div>\r\n\r\n<div>Item Weight:400 Grams</div>\r\n\r\n<div>Item Form:Powder</div>\r\n\r\n<div>Diet Type:Vegetarian</div>\r\n\r\n<div>Package Weight:0.5 Kilograms</div>\r\n', 'Ensure', '', '', '879', '2,2', '<ul>\r\n	<li>Complete, Balanced nutrition specially designed for adults with diabetes, It is sugar-free and is available in two delicious flavours&ndash;Vanilla Delight and Chocolate</li>\r\n	<li>A scientifically formulated nutrition with slow release energy system (unique low glycemic (slow release) carbohydrate blend) which helps manage blood glucose levels and provide steady energy</li>\r\n	<li>Supports Weight Management$: Recommended as a partial/full meal replacement, snack alternative and (or) bedtime drink</li>\r\n	<li>Contains Protein- essential to support muscle mass along with vitamins and minerals. It is by nature Gluten-free and lactose free</li>\r\n	<li>Supports Heart Health</li>\r\n	<li>: It is trans-fat free, is high in MUFA and low in saturated fatty acids</li>\r\n	<li>HOW TO PREPARE &ndash; Add 6 Scoops of Ensure Diabetes Care powder in 200 ml water, stir until dissolved and enjoy. One serving of Ensure Diabetes Care provides approximately 226 K cal.</li>\r\n	<li>DISCLAIMERS - Sugar means only sucrose,compared to a standard shake/ formula, when used as a meal or partial meal replacement as a part of a diabetes management plan (including diet and exercise),Contains healthy fat blend (high in monounsaturated fatty acids [MUFA], low in saturated fatty acids, trans fat free) to support heart health.</li>\r\n</ul>\r\n', '3', ''),
