('1642', '5', '33', 'Kissan mango squash juicy', 'Kissan-mango-squash-125843', '', 'Inactive', 'Packed with real Mango pulp, Kissan Mango squash has a delightful refreshing taste. Just mix one part of Kissan Mango squash with two parts of chilled water or soda and enjoy a delicious glass of natures goodness. Kissan Mango squash provides yummy on the go breakfast on a hot summer morning. Think of different ways to drink it in. Stirred in milkshake, or add to your iced tea, or lassi to give a delight for your kids breakfast with an assortment of flavours. This can be your answer to a cool refreshing drink on a hot sunny day. Kissan Mango Squash is real fruits ka mazaa har sip mein!! Started in 1934, Kissan is a popular brand in India. Kissan is more than just jams, ketchups and squashes. Its all about kids eating happily & growing up happily. Kissan Jams yummy and fruit based sweet spread keeps both, mothers & kids happy. The brands reassurance to mothers is that they can make breakfast times fun yet wholesome every morning with the Kissan range of fruit jams that are made with 100% real fruit ingredients! Remember craving something utterly sweet? This is your answer to that in a packed in a bottle.', 'Kissan', '', '', '133', '2', '<ul>\r\n	<li>Made with 100% real fruit ingredients</li>\r\n	<li>Is easy to pour and can have it on a hot summer day</li>\r\n	<li>Enjoy it best with iced tea, milk shake or lassi</li>\r\n	<li>Turns boring drink into interesting fruity one</li>\r\n	<li>Burst of real fruits in every sip</li>\r\n	<li>Carefully sealed in impermeable packaging to retain the best flavour and taste of product.</li>\r\n</ul>\r\n', '3', ''),
