('1713', '3', '18', 'Colgate zig zag anti-bacterial tooth brush', 'Colgate-zig-zag-anti-bacterial-tooth-brush-832917', '', 'Active', 'Brand:Colgate\r\n<div>Special Feature:Interdental cleaning</div>\r\n\r\n<div>Power Source:Battery Powered</div>\r\n', 'Colgate', '', '', '27', '2', '<ul>\r\n	<li>SUPERIOR GREM PROTECTION: with 100% Anti-bacterial bristles, powered with Silver ion technology, which inhibits the growth of bacteria & germs on the bristle surface of the toothbrush. Colgate ZigZag+ provides an all-round protection from germs & bacteria</li>\r\n	<li>SOFT ZIGZAG BRISTLES: Colgate tooth brush provide a deep reach to the interdental spaces and cavities. The Multi-angle soft cross bristles with rounded tips helps to brush away germs, bacteria, stains and plaque between the teeth and gum lining </li>\r\n	<li>FLEXIBLE COMPACT HEAD: Our toothbrush provides an access to the most remote corners of the mouth and reduces pressure while we brush by gently massaging the gums. A premium tooth brush from Colgate top Indian brand recommended and trusted by dentists</li>\r\n	<li>INBUILT SOFT TONGUE CLEANER: Attached to head of the Colgate toothbrush, it helps scrape off odour causing germs and bacteria from the surface of the tongue to provide an enhanced and improved sense of taste, fresher breath and a cleaner hygienic mouth</li>\r\n	<li>ANTISLIP RUBBERIZED GRIP: Colgate toothbrush helps in comfortable gripping which offers a superior control while we brush. To maintain good oral hygiene brush twice a day for 2 min., rinse with mouthwash for 30 sec., and replace toothbrush every 90 days.</li>\r\n</ul>\r\n', '6', ''),
