('1891', '7', '54', 'Compact (Almond Beige)', 'COMPACT-ALMOND-615849', '', 'Active', 'When it comes to RENEE, the fact is that its not just a compact! Its so much more as we bring together make-up and skincare in an advanced formulation with Face Base Compact Powder! You feel absolutely radiant with a healthy complexion and highly moisturised with active hydration! Increased moisture boosts the upper layer of your skin, reducing the appearance of any fine lines and wrinkles that come in your way of achieving a flawless look. With this, you dont have to sweat about retouching your makeup every now and then, as the compact powder provides a long-lasting, firm base to your face. It has a silky, soft texture that gives you a sophisticated matte finish with a velvety touch, and thus, it can be used on other makeup bases or even simply worn without it!. Enriched with Vitamin E, your skin tone is instantly illuminated and evened out with a soft-focus effect! Flaunt an even, smooth and soft skin without any worries of ever getting it cakey, dry or overly matte because RENEEs always got your back!', 'Renee', '', '', '450', '2', 'Matte Finish\r\nPerfect Blending\r\nSmooth, silky, soft texture\r\nHighly moisturising\r\nRadiant, healthy complexion\r\nCHEERS TO A HEALTHY, MOISTURISED COMPLEXION!', '3', ''),
