('1895', '7', '54', 'Loose Powder (Nude Beige)', 'LOOSE-POWDER-873615', '', 'Active', 'ITS TIME FOR A MAKEUP BAKE!\r\nRENEE Face Base Loose Powder is all it takes to effortlessly bake your makeup! A perfecting loose powder for your skin to attain that fine, silky and luminous look! The powder creates a polished yet natural look that lasts long for you to adore the soft, smooth feel and the velvety, matte finish it provides! Bake your makeup into place with extended foundation wear, keeping aside any worries of your face getting creased or dry! Your skin imperfections are minimised without the powder settling into fine lines or wrinkles. Enriched with Vitamin E and formulated with Topaz Powder, the loose powder is abundant with healing, moisturising and balancing properties that your skin would need. The Topaz Powder also infuses a jewel-like light to your skin for it to glow with radiance from within! Your look will speak for itself with a refined, perfected complexion and a heightened luminosity.', 'Renee', '', '', '599', '2', 'Enriched with Vitamin E\r\nSilky soft velvety-matte\r\nJewel-like light complexion\r\nLight and weightless consistency\r\nNon-sticky and highly moisturising\r\nExcellent adhesion and payoff', '3', ''),
