('1899', '7', '54', 'BB Cream7 in 1(Butterscotch)', 'BB-CREAM-7-in-1BUTTERSCOTCH-326098', '', 'Active', 'Makeup meets skincare\r\nSay hello to makeup combined with skincare in a single product with RENE Face Base 7 in 1 BB Cream. We have carefully created this unique BB cream with SPF 30 and renowned skin superheroes Hyaluronic acid and Vitamin C. Step out with even toned skin everyday with this daily use BB cream which helps hide pigmentation, blemishes and evens out skin texture leaving your skin with a radiant finish. RENE Face Base 7 in 1 BB Cream with SPF 30 is the BB cream you have been waiting for. Its an ideal product when you want a quick and easy base for a no makeup look. If youre a beginner and arent familiar with base makeup and yet want to get that flawless skin, just dab on BB cream and get a perfect natural base. With a wide range of shades that are ideal for all Indian skin tones, RENE Face Base 7 in 1 BB Cream is a one stop solution to your makeup and skin care needs!', 'Renee', '', '', '550', '2', 'Blends easily hiding spots & blemishes\r\nEnriched with Vitamin C\r\nContains Hyaluronic acid which hydrates & plumps up the skin \r\nProtects from UVA & UVB rays with SPF 30\r\nLightweight & non-sticky formula\r\nHelps reduce fine lines, wrinkles & pigmentation\r\nMoisturizes, nourishes & softens skin', '3', ''),
