('1914', '7', '54', 'Make up Removing Balm', 'MAKEUP-REMOVING-BAlM-326419', '', 'Active', 'WHAM BALM YOUR MAKEUP AWAY\r\nWe understand the issues and difficulties that come with getting stubborn makeup products off your skin at the end of a tiring day. Your skin goes through a lot and removing your makeup shouldnt be adding to its troubles. With RENEs Makeup Removing Balm, removing your makeup feels like therapy. It is made with nourishing oils like orange peel oil, argan oil and watermelon seed oil that work like a charm and rejuvenate your skin. It prevents makeup from clogging your pores and keeps your skin healthy and glowing, naturally. It fights away all rigid foundations, mascaras, eyeliners, lipsticks and eyeshadows while retaining the suppleness of your skin. For all your after makeup tensions, know that RENE will always be there to take care of your skin.', 'Renee', '', '', '284', '2', '', '3', ''),
('1915', '7', '54', 'Makeup Remover Wipes ', 'MAKEUP-REMOVAL-WIPES-658032', '', 'Active', 'DESCRIPTION\r\nRemoves makeup effortlessly\r\nSmoothens and refreshes skin\r\nAntioxidant and skin-moisturizer\r\nAnti-inflammatory and skin-conditioning agent\r\nWIPE IT OFF, CLEAN & SMOOTH!\r\nRemoving your makeup before you call it a day is as important as applying makeup to make your day! RENE''S Makeup Removal Wipes are your handy buddies when you want to remove your makeup, easy and effortlessly. Not only does it smoothen your skin, but it also is an antioxidant, anti-inflammatory and skin-conditioning agent, nourishing your skin with hydration and fragrance after a long day. The wipes moisturize your skin so it can breathe and revitalize through the night for you to wake up to flawless and refreshed skin, ready to be enhanced by makeup, however you like it!', 'Renee', '', '', '238', '2', '', '3', ''),
('1916', '7', '54', 'Dark Desire Parfum', 'DARK-DESIRE-PARFUM-301627', '', 'Active', 'Reignite Your Dark Desires\r\nBehold! The perfume that will reignite your dark desires is right here. With a captivating aroma and woody hints, RENEE Dark Desire is captivating and unforgettable. It has a unique blend of strong woody and spicy notes of Musk, Cedarwood, Amber and Vanilla along with citrus twist from Mandarin, Grapefruit, Pear, Pink Pepper, Cassis, Red berries and a whiff of refreshing floral notes from Rose, Water Lilly and Jasmine. A perfect combination of bold notes, this fragrance is suitable for all seasons and perfect for your nocturnal adventures.', 'Renee', '', '', '333', '2', '', '3', ''),
('1917', '7', '54', 'Bloom Parfum', 'BLOOM-PARFUM-680514', '', 'Active', 'Experience The Floral Fantasy\r\nImprint your prey with a floral ambush with RENEE Bloom Eau de parfum. This blooming perfume is a unique combination of notes from Tuberose, Jasmine and Sandalwood along with a spicy trail from Vanilla, Cocoa and Tonka beans with a touch of Almond. Do not underestimate the delicate elements of this fragrance for together they are celebration of floral extravagance which is hard to ignore and sensuously irresistible be it any day or season!', 'Renee', '', '', '333', '2', '', '3', ''),
