('2005', '3', '15', 'Chialeader Shine Control Gel Face Wash (Gentle Cleanser For Oily Skin)', 'Chialeader-Shine-Control-Gel-Face-Wash-Gentle-Cleanser-For-Oily-Skin-276310', '', 'Active', 'Skin Type:All\r\n<div>Product Benefits:Brightening</div>\r\n\r\n<div>Material Type Free:Gluten Free</div>\r\n\r\n<div>Special Ingredients:Vitamin E</div>\r\n', 'Quench', '', '', '499', '2', '<ul>\r\n	<li>A quick lathering, gel-based face wash that deep cleanses to remove dead skin, dirt and grime from skin, revealing a clear, fresh complexion</li>\r\n	<li>Features a built-in exfoliating brush with soft, silicone bristles that slough off dead skin cells and dirt that accumulates on your skin surface</li>\r\n	<li>The formula is packed with hydrating ingredients such as chia seed, cactus water, bamboo water and cica extract. It also has orange peel oil that boosts skin moisture levels, lightens spots, blemishes and enhances skin elasticity. Mild concentration of salicylic acid, a BHA (beta hydroxy acid) helps to keep pores clean, deep cleanse and prevent acne</li>\r\n	<li>Salicylic acid as a content percentage of 0.001% ww</li>\r\n	<li>ABOUT QUENCH : - We believe that beauty comes from within. So, we&rsquo;ve taken Korean skincare and specially crafted it to work for Indian skin. Skincare is supposed to make you feel good and look good, and with our 100% vegetarian, most luscious, skin-rejuvenating formulas, it does just that.</li>\r\n</ul>\r\n', '3', ''),
('2006', '3', '15', 'Matcha Better skin Detox Gel Face Wash Clears Pores and rejuvenates skin', 'Matcha-Better-skin-Detox-Gel-Face-Wash-Clears-Pores-and-rejuvenates-skin-417258', '', 'Active', 'Skin Type:All\r\n<div>Item Form:Cream</div>\r\n\r\n<div>Use for:Face</div>\r\n\r\n<div>Scent:Rose, Mandarin, Orange</div>\r\n', 'Quench', '', '', '499', '2', '<ul>\r\n	<li>How to Use - Squeeze a small amount of face wash into your palms and spread it evenly across your damp face and neck. Massage it gently in circular motions to exfoliate and cleanse your skin. Rinse thoroughly, then pat dry.</li>\r\n	<li>100% vegetarian, toxin-free and cruelty-free formula; free from parabens, sulphates and alcoh</li>\r\n	<li>It&#39;s enriched with the natural extracts, which helps to clean the skin surface making skin soft</li>\r\n	<li>Gives plump, supple and radiant skin, radiance boosting and skin brightening</li>\r\n	<li>ABOUT QUENCH : - We believe that beauty comes from within. So, we&rsquo;ve taken Korean skincare and specially crafted it to work for Indian skin. Skincare is supposed to make you feel good and look good, and with our 100% vegetarian, most luscious, skin-rejuvenating formulas, it does just that.</li>\r\n</ul>\r\n', '3', ''),
('2007', '3', '15', 'Yuzu Fine Vitamin C Foaming Face Wash (Gently Cleanses Skin And Adds A Healthy Glow)', 'Yuzu-Fine-Vitamin-C-Foaming-Face-Wash-Gently-Cleanses-Skin-And-Adds-A-Healthy-Glow-016835', '', 'Active', 'Brand:QUENCH BOTANICS\r\n<div>Item Form:Gel</div>\r\n\r\n<div>Skin Type:All</div>\r\n\r\n<div>Material Type Free:Paraben Free</div>\r\n\r\n<div>Product Benefits:Nourishing</div>\r\n\r\n<div>Material Feature:Vegetarian</div>\r\n', 'Quench', '', '', '499', '2', '<ul>\r\n	<li>Rich antioxidants give your skin a healthy glow - Fortifies your skin&#39;s natural barrier - Skin damage caused by the sun is reduced due to vitamin-C - Helps give you a smoother complexion and more even skin tone. - Formulated using ascorbic acid and niacinamide</li>\r\n	<li>How to use - Saturate a cotton pad with this toner and apply it all over your face. Once fully absorbed, continue with your usual skincare routine.</li>\r\n	<li>&ldquo;Salicylic acid as a content percentage of &ldquo;0.01&rdquo; % ww.&rdquo;</li>\r\n	<li>ABOUT QUENCH : - We believe that beauty comes from within. So, we&rsquo;ve taken Korean skincare and specially crafted it to work for Indian skin. Skincare is supposed to make you feel good and look good, and with our 100% vegetarian, most luscious, skin-rejuvenating formulas, it does just that.</li>\r\n</ul>\r\n', '3', ''),
('2008', '3', '15', 'Mon Cherry Brightening Foam Cleanser', 'Mon-Cherry-Brightening-Foam-Cleanser-492783', '', 'Active', 'Skin Type:All\r\n<div>Product Benefits:Brightening</div>\r\n\r\n<div>Material Type Free:Gluten Free, Alcohol Free, Paraben Free</div>\r\n\r\n<div>Special Ingredients:Vitamin E</div>\r\n', 'Quench', '', '', '499', '2', '<ul>\r\n	<li>KOREAN DOUBLE CLEANSING SIMPLIFIED: Unique oil-based, foaming formula that helps to double cleanse your skin leaving it baby soft, smooth and clear. This 2-in-1 lightweight, oil-based cleanser and face wash removes all traces of dirt, makeup and impurities.</li>\r\n	<li>GENTLY EXFOLIATES: This foaming cleanser is formulated using Grapefruit which is rich in Vitamin C and is a natural source of Salicylic Acid (a BHA), which makes it an ideal natural exfoliant. It also has Citric Acid (an AHA) gently exfoliates, draws out impurities from pores and eliminates dull, dead skin.</li>\r\n	<li>BRIGHTENS &amp; IMPROVES SKIN TEXTURE: Cherry Blossom in this formulation helps to repair the skin&#39;s natural barrier and lighten uneven skin tone. Further, this cleanser has Pearl extracts which promote cellular repair, enhance radiance and improve skin elasticity. Babassu Seed Oil smoothens skin, tackles unevenness and minimizes fine lines resulting in a firm, youthful complexion.</li>\r\n	<li>HOW TO USE: Shake well before use. Press the pump to release the oil-based cleanser as foam in your palm and massage into skin in circular motions till all makeup and dirt dissolves. Rinse thoroughly with warm water.</li>\r\n	<li>ABOUT QUENCH : - We believe that beauty comes from within. So, we&rsquo;ve taken Korean skincare and specially crafted it to work for Indian skin. Skincare is supposed to make you feel good and look good, and with our 100% vegetarian, most luscious, skin-rejuvenating formulas, it does just that.</li>\r\n</ul>\r\n', '3', ''),
('2009', '3', '15', 'Mesmerice Intense Repair Serum', 'Mesmerice-Intense-Repair-Serum-632918', '', 'Active', 'Skin Type:All\r\n<div>Product Benefits;Helps even out skin tone and brighten skin complexion</div>\r\n\r\n<div>Material Type Free:Gluten Free, Paraben Free</div>\r\n\r\n<div>Active Ingredients:Water, Glycerin, Kaolin, Bentonite, Dipropylene Glycol, Citric Acid, Disodium EDTA, Laurylpyridinium Chloride, Hexylene Glycol</div>\r\n', 'Quench', '', '', '699', '2', '<ul>\r\n	<li>How to use - Take 3-4 drops of serum on your fingertips and gently press onto skin. Let the serum fully absorb before moving on to the next step of your skincare routine.</li>\r\n	<li>It contains essential amino acids, minerals, and vitamins that are great to restore skin elasticity.</li>\r\n	<li>It&#39;s enriched with the natural extracts, which helps to clean the skin surface making skin soft</li>\r\n	<li>Gives plump, supple and radiant skin, radiance boosting and skin brightening</li>\r\n	<li>ABOUT QUENCH : - We believe that beauty comes from within. So, we&rsquo;ve taken Korean skincare and specially crafted it to work for Indian skin. Skincare is supposed to make you feel good and look good, and with our 100% vegetarian, most luscious, skin-rejuvenating formulas, it does just that.</li>\r\n</ul>\r\n', '3', ''),
('2010', '3', '15', 'Chialeader Zit Fix Serum', 'Chialeader-Zit-Fix-Serum-Reduces-Excess-oil-And-Soothes-Irritated-Skin-364208', '', 'Active', 'Skin Type:All\r\n<div>Product Benefits:Brightening</div>\r\n\r\n<div>Material Type Free:Gluten Free, Alcohol Free, Paraben Free</div>\r\n\r\n<div>Active Ingredients:(Cactus) Stem Extract, Tocopherol, Ceramide NP, Dextrin, Madecassoside , Ethylexyglycerin, Optunia Ficus- Indica (Cactus)Extract, Melaleuca Alternifolia (Tea Treee ) Leaf Water, Bambusa Vulgaris (Bamboo) Water, Salvia Hispanica (Chia) Seed Extract</div>\r\n', 'Quench', '', '', '699', '2', '<ul>\r\n	<li>PREVENTS ACNE AND BREAKOUTS: This lightweight, cream-based facial serum fights pimples and blemishes. It controls excess oil that can clog pores, prevents breakouts and keeps skin fresh. Its formulated with Tea Tree which has skin purifying properties. It soothes damaged skin and is particularly good for oily skin. It&#39;s also infused with Rosemary Leaf Oil which helps to control excess oil and prevent breakouts.</li>\r\n	<li>REFINES PORES: Cactus Water in this serum has astringent properties which tighten pores. Besides, this formulation has 0.3% Salicylic Acid, a BHA that gently exfoliates, eliminates dead skin cells, minimizes pores and reduces oiliness to give spotless, clear and smooth skin.</li>\r\n	<li>HYDRATES SKIN: This serum has a skin conditioning agent Dippotassium Glycyrrhizate which is obtained from Licorice Root extracts. It reduces flaking, improves dry, damaged skin and restores suppleness. It also has Chia Seed, a superfood that nourish skin and add a radiant glow.</li>\r\n	<li>HOW TO USE: Take 3-4 drops of serum on your fingertips and gently press onto skin. Let the serum fully absorb before moving on to the next step of your skincare routine.</li>\r\n	<li>ABOUT QUENCH : - We believe that beauty comes from within. So, we&rsquo;ve taken Korean skincare and specially crafted it to work for Indian skin. Skincare is supposed to make you feel good and look good, and with our 100% vegetarian, most luscious, skin-rejuvenating formulas, it does just that.</li>\r\n</ul>\r\n', '3', ''),
('2011', '3', '15', 'Mama Cica Dark Spot Correcting Ampoule', 'Mama-Cica-Dark-Spot-Correcting-Ampoule-051439', '', 'Active', 'Skin Type:All\r\n<div>Product Benefits:Brightening</div>\r\n\r\n<div>Material Type Free:Gluten Free, Alcohol Free, Paraben Free</div>\r\n\r\n<div>Active Ingredients:(Rosemary) Leaf Oil, Calophylum Inophyllum (Tamanu) Seed Oil, Centella Asiatica (Cica) Extract, Sodium Hyluronate , Nelumbo Nucifera (Lotus) Root Extract, Panax Ginseng (Korean Ginseng) Root Extract.</div>\r\n', 'Quench', '', '', '699', '2', '<ul>\r\n	<li>TACKLES BLEMISHES AND FADES DARK SPOTS: A quick-absorbing, concentrated serum packed with potent actives that target skin concerns such as dark spots, uneven skin tone and dullness. This ampoule has Lotus Root which is a great source of Vitamin C, it brightens complexion and fades dark spots.</li>\r\n	<li>PREVENTS ACNE: This ampoule also has Cica and Tamanu Oil both of which are known to strengthen the skin barrier, heal pimples and control oiliness. They also sooth troubled and damaged skin.</li>\r\n	<li>NOURISHES: This active concentrate relieves dry and flaky skin. Its formulated with Hyaluronic Acid which is known for its moisture retention properties. It delivers intense hydration to deeper layers of skin, leaving you with visibly plum and soft skin. This ampoule also has Korean Ginseng which helps to brighten skin, reduce fine lines and enhance skin firmness.</li>\r\n	<li>HOW TO USE: Use 2-3 times a week. Use the dropper to pour 3-4 drops of the ampoule on the areas of concern and gently press onto skin. Let the product fully absorb into skin before moving on to the next step of your skincare routine.</li>\r\n	<li>ABOUT QUENCH : - We believe that beauty comes from within. So, we&rsquo;ve taken Korean skincare and specially crafted it to work for Indian skin. Skincare is supposed to make you feel good and look good, and with our 100% vegetarian, most luscious, skin-rejuvenating formulas, it does just that.</li>\r\n</ul>\r\n'