('2013', '3', '15', 'Yuzu Fine Brightening Peeling Gel', 'Yuzu-Fine-Brightening-Peeling-Gel-725893', '', 'Active', 'Skin Type:All\r\n<div>Product Benefits:Softening, Radiant Skin, Brightening, Radiance</div>\r\n\r\n<div>Active Ingredients:Water, Glycerin, Kaolin, Bentonite, Dipropylene Glycol, Citric Acid, Disodium EDTA, Laurylpyridinium Chloride, Hexylene Glycol</div>\r\n\r\n<div>Item Form:Cream</div>\r\n', 'Quench', '', '', '199', '2', '<ul>\r\n	<li>How to Use - Apply an adequate amount of gel on clean, dry skin and gently massage it in circular motions. As you exfoliate, the gel will start clamping into small balls. Continue massaging it until you cover your entire face and neck. Rinse off the residue with lukewarm water and follow up with a moisturizer.</li>\r\n	<li>100% vegetarian, toxin-free and cruelty-free formula; free from parabens, sulphates and alcoh</li>\r\n	<li>It&#39;s enriched with the natural extracts, which helps to clean the skin surface making skin soft</li>\r\n	<li>Gives plump, supple and radiant skin, radiance boosting and skin brightening</li>\r\n	<li>ABOUT QUENCH : - We believe that beauty comes from within. So, we&rsquo;ve taken Korean skincare and specially crafted it to work for Indian skin. Skincare is supposed to make you feel good and look good, and with our 100% vegetarian, most luscious, skin-rejuvenating formulas, it does just that.</li>\r\n</ul>\r\n', '3', ''),
