('2017', '3', '15', 'Yozu Fine Revitalizing Under Eye Gel', 'Yozu-Fine-Revitalizing-Under-Eye-Gel-549632', '', 'Active', 'Brighten dark circles and awaken tired-looking eyes with Quench Yuzu Fine Revitalizing Under Eye Gel! This peptide-rich under-eye gel comes with a fragrance-free, clear formula to soothe, hydrate and firm the delicate area around the eyes and add a rejuvenating boost of moisture to your skin. It has antioxidant-rich, super fruit &#39;Yuzu&#39; extracts along with blueberry and watermelon goodness to minimize fine lines, improve skin elasticity, reduce inflammation and boost collagen.\r\n<div>&nbsp;</div>\r\n\r\n<div>Yuzu Fine Revitalizing Under Eye Gel is loaded with skin-plumping hyaluronic acid, anti-ageing peptides and soothing aloe vera extract blend to treat and prevent skin sagging. Vitamins, antioxidants and anti-bacterial ingredients in this formula help to reduce oxidative stress caused due to harmful sun rays, pollutants. Moreover, they also work on puffiness and dark circles. Non-greasy, quick-absorbing and refreshingly cooling, this brightening under-eye gel comes with a pointed tip for easy application and is quite handy to carry in your skincare stash!</div>\r\n', 'Quench', '', '', '399', '2', '<ul>\r\n	<li>This clear, no-tear and fragrance-free under-eye gel is packed with anti-ageing peptides to reduce dark circles, wrinkles, puffiness and fine lines</li>\r\n	<li>Packed with powerful antioxidant rich &#39;yuzu&#39; fruit extracts, helps improve skin elasticity, smoothen fine lines and keep the under-eye area brighter and firmer</li>\r\n	<li>Hydrating watermelon, blueberry and aloe vera extracts deeply moisturize, nourish and give your eyes a well-rested look</li>\r\n	<li>The non-greasy, quick-absorbing and hydrating formula packed with skin-plumping hyaluronic acid helps to restore the appearance of tired and puffy eyes</li>\r\n	<li>100% vegetarian, toxin-free and cruelty-free formula; Free from parabens, sulphates and alcohol.</li>\r\n</ul>\r\n', '3', ''),
('2018', '3', '15', 'Mama Cica Dark Circle Fading Under Eye Cream', 'Mama-Cica-Dark-Circle-Fading-Under-Eye-Cream-178294', '', 'Active', 'Skin Type:All\r\n<div>Product Benefits:Brightening</div>\r\n\r\n<div>Material Type Free:Gluten Free, Alcohol Free, Paraben Free</div>\r\n\r\n<div>Active Ingredients:Rosmarinus Officinalis (Rosemary) Leaf Oil, Glycirrhiza Glabra (Licorice) Root Extract, Citrus Nobilis (Mandarin Orange) Peel Oil, Centella Asiatica (Cica) Extract, Nelumbo Nucifera (Lotus) Root Extract, Panax Ginseng (Korean Ginseng) Root Extract, Hydrolyzed Hyaluronic Acid, Caramel.</div>\r\n', 'Quench', '', '', '499', '2', '<ul>\r\n	<li>IN-BUILT ROLLER BALL APPLICATOR: Features an easy to use Rollerball Applicator that massages away under-eye puffiness, smoothens fine lines and wrinkles, improves blood circulation and relives skin fatigue.</li>\r\n	<li>FADES DARK CIRCLES: Enriched with Orange Peel Oil, a natural source of antioxidants, polyphenols, and vitamin C. It brightens skin, helps to fade dark spots, reduces dark circles and protects against sun damage.</li>\r\n	<li>FIGHTS MAJOR SIGNS OF AGING: This advanced formula has 3 power ingredients to fight signs of aging - Hyaluronic Acid that delivers hydration deep into the skin layers and reveals visibly plump, supple and soft skin; Cica that strengthens the skin barrier and boosts elasticity; Korean Ginseng that smoothens fine lines and wrinkles and restores skin firmness.</li>\r\n	<li>HOW TO USE: Squeeze the tube to dispense the eye cream and apply it under your eyes. Use the in-built roller ball applicator to gently massage the under eye area to reduce puffiness and enhance blood circulation.</li>\r\n	<li>ABOUT QUENCH : - We believe that beauty comes from within. So, we&rsquo;ve taken Korean skincare and specially crafted it to work for Indian skin. Skincare is supposed to make you feel good and look good, and with our 100% vegetarian, most luscious, skin-rejuvenating formulas, it does just that.</li>\r\n</ul>\r\n', '3', ''),
