('2024', '3', '15', 'Mon Cherry Brightening Face Mist', 'Mon-Cherry-Brightening-Face-Mist-362109', '', 'Active', 'Product Benefits:Brightening\r\n<div>Material Type Free:Gluten Free, Alcohol Free, Paraben Free</div>\r\n\r\n<div>Skin Type:All</div>\r\n\r\n<div>Item Form:Spray</div>\r\n', 'Quench', '', '', '199', '2', '<ul>\r\n	<li>HYDRATES &amp; REJUVINATES: An ultra-refreshing face mist that instantly hydrates and protects skin. It&#39;s formulated with Evening Primrose flower extracts and Sodium Hyaluronate. Evening Primrose is know for its miniaturization properties. It makes skin supple and healthy. Sodium Hyaluronate plumps up skin, moisturizes and revives dull-looking, lackluster complexion.</li>\r\n	<li>BRIGHTENS &amp; EVENS SKINTONE: This face mist has 4 super ingredients to enhance complexion. Cherry Blossom helps to repair the skin&#39;s natural barrier and lighten uneven skin tone; Grapefruit is rich in Vitamin C and a natural source of Salicylic Acid, it helps to gently exfoliate and eliminate dull, dead skin; Pearl extracts enhance radiance and improve skin elasticity; Kudzu Root possess anti-aging properties and helps to even skin tone.</li>\r\n	<li>HOW TO USE: Best suited for dry, dull skin. Use anytime during the day for instant hydration, cooling and refreshment on-the-go. Hold the bottle 6-8 inches away from your face and spray 3-4 times. Now relax and wait for your skin to fully absorb all the nutrients.</li>\r\n	<li>QUENCH PROMISE: 100% vegetarian, toxin-free and cruelty-free formula; free from parabens, sulphates and alcohol.</li>\r\n</ul>\r\n', '3', ''),
('2025', '3', '15', 'Mama Cica Rejuvenating Face Mist', 'Mama-Cica-Rejuvenating-Face-Mist-853729', '', 'Active', 'Product Benefits:Brightening\r\n<div>Material Type Free:Gluten Free, Alcohol Free, Paraben Free</div>\r\n\r\n<div>Skin Type:All</div>\r\n\r\n<div>Item Form:Oil</div>\r\n', 'Quench', '', '', '199', '2', '<ul>\r\n	<li>HYDRATES &amp; REJUVINATES: An ultra-refreshing face mist that instantly hydrates and protects skin. It&#39;s formulated with 2% Niacinamide which helps to maintain the skin&#39;s natural moisture. A powerful antioxidant, it also evens out skin tone and minimizes the appearance of pores.</li>\r\n	<li>CONTROLS OIL &amp; PREVENTS BREAKOUTS: This mist is enriched with Tea Tree Oil which is an extremely beneficial ingredient for oily and acne prone skin. It helps to soothe and heal damaged skin. Suitable for sensitive skin, Cica extracts in this mist help to heal and shrink pimples and strengthen the skin&#39;s barrier.</li>\r\n	<li>ENAHNCES COMPLEXION: This face mist has Korean Ginseng which smoothens fine lines, restores skin firmness and has great anti-aging properties and Lotus Root which is an excellent source of Vitamin C, it brightens complexion and fades dark spots.</li>\r\n	<li>HOW TO USE: Best suited for oily and acne-prone skin. Use anytime during the day for instant hydration, cooling and refreshment on-the-go. Hold the bottle 6-8 inches away from your face and spray 3-4 times. Now relax and wait for your skin to fully absorb all the nutrients.</li>\r\n	<li>ABOUT QUENCH : - We believe that beauty comes from within. So, we&rsquo;ve taken Korean skincare and specially crafted it to work for Indian skin. Skincare is supposed to make you feel good and look good, and with our 100% vegetarian, most luscious, skin-rejuvenating formulas, it does just that.</li>\r\n</ul>\r\n', '0', ''),
