('2255', '3', '15', 'Natures aloevera moisturising beauty gel ', 'Natures-aloevera-moisturising-beauty-gel-100g--824833', '', 'Active', 'Skin Type:Normal\r\n<div>Product Benefits:Softening, Moisturizing</div>\r\n', 'Natures', '', '', '52', '2,2,2', '<ul>\r\n	<li>An unique gel to moisturize skin</li>\r\n	<li>Texture for sensitive skin</li>\r\n	<li>Treat acne and also maintains skin</li>\r\n	<li>Soften skin and protect from sun damage the formulation of this gel includes mineralized water and peppermint oil that work together to soften skin and leave an effective shield against sun damage. Protects from skin ailments the blend of peppermint oil and aloe Vera soothes your skin to repair any damage and protects skin from further skin ailments. Provides radiance and sheen aloe Vera helps regain all the lost moisture and provides a cooling effect on your skin to soothe your dry and flaky skin. A rich texture instantly provides radiance and gives you healthy skin. Enriched with vitamin e vitamin e is a great antioxidant that protects your skin from pollution and it also adds the desired amount of moisture to your skin, leaving it soft and supple.</li>\r\n</ul>\r\n', '5', ''),
('2256', '3', '15', 'Natures brightening diamond facial kit  ', 'Natures-brightening-diamond-facial-kit--348137', '', 'Inactive', 'Skin Type:All Skin Type', 'Natures', '', '', '266', '2', '<ul>\r\n	<li>SUITABLE FOR ALL SKIN TYPES: The Natures Essence Brightening Diamond Facial Kit is safe to use for all skin types.</li>\r\n	<li>GET RADIANT SKIN: Get that dazzling and radiant looking skin with Nature''s Essence The Brightening Diamond Facial Kit. Diamond Facial Kit is a 4-step process that acts as a natural tone enhancer for the skin. It contains zircon ash and lactic acid which gives a uniform complexion and a smooth texture to the skin.</li>\r\n	<li>BEST NATURAL INGREDIENTS: Made up of natural ingredients such as Vitamin E, wheat germ oil, almond oil and honey wax, the Natures Essence Brightening Diamond Facial Kit fades blemishes and nourishes and hydrates skin.</li>\r\n	<li>HOW TO USE: a) Diamond Cleansing Scrub: Apply on the face and gently rub for 3 to 5 minutes. Clean with wet cotton. b) Diamond Massage Cream: Take the required quantity of cream and massage for 10-15 minutes till it is completely absorbed. Remove excess cream traces with wet cotton. c) Diamond Glow Pack: Apply the pack, leaving the eye area and keep it for 15 minutes undisturbed. Rinse thoroughly with water. d) Diamond Polish Mask: Apply a thin layer of this mask and rinse if off after 15 minutes.</li>\r\n	<li>Get ready for a parlour like glow at home. Cleanse, nourish, polish and perfect your skin with the brightening diamond facial kit. The facial kit also has a free De-Tan therapy wipe off mask which is essential for pre-facial prep. Get ready to flaunt the skin which is diamond-white, diamond bright.</li>\r\n</ul>\r\n', '5', ''),
('2257', '3', '15', 'Natures Daily DE+TAN lacto tan clear  ', 'Natures-Daily-DETAN-tan-clear-100ml--737278', '', 'Active', 'Skin Type:All\r\n<div>Product Benefits:Tan Removal</div>\r\n\r\n<div>Material Type Free:Talc Free</div>\r\n\r\n<div>Active Ingredients:Vitamin E Acetate</div>\r\n', 'Natures', '', '', '95', '2,2,2', '<ul>\r\n	<li>Suitable for all skin types: The Nature&rsquo;s Essence Daily De-Tan Lacto Tan clear is dermatologically tested and is suitable for all skin types.</li>\r\n	<li>Power of natural ingredients: Made up of milk and Vitamin E formula, the Nature&rsquo;s Essence Daily De-Tan Lacto Tan Clear removes layers of tan that get accumulated on the face to reveal a bright and glowing skin.</li>\r\n	<li>Removes tan from deepest layer of skin: By regularly using the Nature&rsquo;s Essence Daily De-tan Lacto Tan Clear, your skin will get a radiant glow as the product removes tan from the deepest layer of your skin.</li>\r\n	<li>Use twice daily: At night apply a thick layer on your face. Leave for 5 minutes and let it work on your tan. Wash off for instant glow.</li>\r\n</ul>\r\n', '5', ''),
('2258', '3', '15', 'Natures gentle fruit facial kit ', 'Natures-fruit-facial-kit--832256', '', 'Active', 'Skin Type:All Skin Type\r\n<div>Product Benefits:Anti-Aging</div>\r\n\r\n<div>Material Type Free:Paraben Free</div>\r\n', 'Natures', '', '', '266', '2', '<ul>\r\n	<li>SUITABLE FOR ALL SKIN TYPES: The Nature&rsquo;s Essence Gentle Fruit Facial Kit is safe to use for all skin types.</li>\r\n	<li>FOR NOURISHED SKIN: The Nature&rsquo;s Essence Gentle Fruit Facial Kit fades blemishes, nourishes and hydrates your skin.</li>\r\n	<li>BEST NATURAL INGREDIENTS: It is infused with saffron which keeps your skin visibly smoother. The firming pack keeps your skin nourished.</li>\r\n	<li>HOW TO USE: a) Almond Care: Take a little amount on cotton ball and clean your face and neck thoroughly. b) Orange Scrub Pack: Apply the scrub on wet face, rub for 3-5 min. Let it dry and clean with cold water. c) Saffron Care: Use an adequate amount of cream for face massage after thorough cleansing. d) Apple Pack: Apply the pack on the face and neck and clean after 15 minutes. e) Coconut Care: Apply the cream, massage it well until fully absorbed.</li>\r\n</ul>\r\n', '5', ''),
('2259', '3', '15', 'Natures Gold Bleach fairness bleach cream  ', 'Natures-Gold-Bleach-85g--496872', '', 'Inactive', 'Skin Type:All skin types\r\n<div>Product Benefits:Lightening, Nourishing, Brightening</div>\r\n\r\n<div>Special Ingredients:Aloe Vera</div>\r\n', 'Natures', '', '', '67', '2,2', '<ul>\r\n	<li>SAY GOODBYE TO SKIN PROBLEMS: You won''t have to worry about dark spots, uneven skin tone, dull skin, tan or skin pigmentation once you have used the gold bleach. What''s extra is that it can also lighten your facial hair to your natural skin tone!</li>\r\n	<li>LIGHTENS AND BRIGHTENS: The bleach cream consists of gold extracts and other skin lightening ingredients that considerably lightens and brightens your skin, while adding that goddess golden glow.</li>\r\n	<li>Whether you want an instant glow for a special event or just want to look gorgeous, our Gold bleach will surely make your complexion look dazzling!</li>\r\n	<li>Free mini aloe vera gel sachet inside the pack</li>\r\n	<li>Package includes: 4 x nature''s bleach cream.</li>\r\n</ul>\r\n', '5', ''),
('2260', '3', '15', 'Natures glowing gold facial kit   ', 'Natures-gold-facial-kit-60g--556497', '', 'Active', 'Skin Type:All Skin Type\r\n<div>Product Benefits:Radiant Skin, Smoothing, Cleansing</div>\r\n\r\n<div>Material Type Free:Paraben</div>\r\n', 'Natures', '', '', '266', '2', '<ul>\r\n	<li>SUITABLE FOR ALL SKIN TYPES: The Nature&rsquo;s Essence Glowing Gold Facial Kit is suitable for all skin types.</li>\r\n	<li>ALL DAY GLOW: The Nature&rsquo;s Essence Glowing Gold Facial kit gives you a parlour like glow in just 30 minutes.</li>\r\n	<li>BEST NATURAL INGREDIENTS: Made up of natural ingredients such as aloe vera extract, Vitamin E and Almond oil, the Nature&rsquo;s Essence Glowing Gold Facial kit is the best facial kit for glowing skin.</li>\r\n	<li>HOW TO USE: a) Gold Cleansing Scrub: Apply a little quantity and gently massage in a circular motion on wet face and neck for 3-4 mins. Then clean with wet cotton/water thoroughly. b) Gold Massage Cream: Gently massage the cream on wet face and neck for 8-10 mins. Clean with moist cotton/water. c) Gold Shine Gel: Gently massage the gel on wet face and neck for 4-5 mins. Clean with cotton wool. d) Gold Pack: Apply the required quantity in a smooth layer on the face. Gently massage with wet hands to clean. Wash the face thoroughly with water. Use once a week for smooth textured skin.</li>\r\n</ul>\r\n', '5', ''),
('2261', '3', '15', 'Natures lacto bleach natural milk bleach', 'Natures-lacto-bleach-100gr--379199', '', 'Active', 'Skin Type:All\r\n<div>Product Benefits:Exfoliating</div>\r\n\r\n<div>Scent:Fresh</div>\r\n', 'Natures', '', '', '95', '2,2', '<ul>\r\n	<li>Is Made With Natural Ingredients</li>\r\n	<li>Get Party Ready Skin In Just 15 Mins</li>\r\n	<li>Regular Usage Keeps Skin Even-Toned And And Free Of Pigmentation</li>\r\n	<li>Brand: Nature&#39;S Essence</li>\r\n	<li>Scent name: Fresh</li>\r\n	<li>Skin type: All Skin Type</li>\r\n	<li>Get a bleach like glow naturally with Nature&#39;s Essence lacto bleach. Lactic acid from milk supports cell renewal while lavender oil balances skin ph. Gentle exfoliating agents quickly dissolve surface tan, impurities and dead cells to uncover a radiant complexion. Regular usage keeps skin even-toned and free of pigmentation.</li>\r\n</ul>\r\n', '5', ''),
('2262', '3', '15', 'Natures lacto tan clear tan removal cream', 'Natures-tan-removal-cream-50g--974740', '', 'Active', 'Skin Type:Combination\r\n<div>Product Benefits:Dark Spot Correction</div>\r\n\r\n<div>Material Type Free:Alcohol Free</div>\r\n\r\n<div>Special Ingredients:Goat Milk</div>\r\n', 'Natures', '', '', '95', '2', '<ul>\r\n	<li>LACTO TAN CLEAR (Remedy for Sun Tan Removal Cream) Milk proteins &amp; honey enriched special tan cream helps remove the epidermal sun tan, thereby restoring the natural fairness of the skin &amp; also preventing pigmentation due to harmful sun.</li>\r\n	<li>Its matt effect is ideal for hot climates and the cream also helps enhance after facial glow.</li>\r\n	<li>DIRECTION: Apply layer on the face/skin and keep it on for 10-15 min. &amp; after soft massage remove with water.</li>\r\n	<li>Advised to be used every day to restore natural colour &amp; glowof the skin. SUITABLE : All skin types.</li>\r\n</ul>\r\n', '5', ''),
