('2397', '3', '15', 'Ponds Bright Beauty Vitamin C Serum  ', 'Ponds-bb-vitamin-c-serum-30ml--892548', '', 'Active', 'Skin Type:Dry\r\n<div>Product Benefits:Brightening</div>\r\n\r\n<div>Active Ingredients:Vitamin c</div>\r\n', 'Ponds', '', '', '450', '2', '<ul>\r\n	<li>Pond&#39;s Bright Beauty Vitamin C serum gives your skin the goodness of NATURAL INGREDIENTS: Infused with lemon, green papaya and pomegranate extracts, this serum gives glowing skin</li>\r\n	<li>LIGHTWEIGHT &amp; NON-GREASY FEEL: The serum texture is light and absorbs quickly into your skin, without making it feel heavy and sticky.</li>\r\n	<li>Vitamin C is known for multiple benefits: 1. Helps promote collagen production. 2. It is known to decrease melanin formation, thereby reducing pigmentation. 3. It is known as a potent antioxidant that can neutralize and remove toxic oxidants</li>\r\n	<li>Our Vitamin C serum has 7 skin benefits: i. Makes skin feel moisturized ii. Gives glowing skin iii. Feels lightweight iv. Feels non-greasy v. Feels skin texture improves vi. Makes skin feel nourished vii. Makes skin feel smooth.</li>\r\n	<li>It&#39;s easy to use: just squeeze the dropper, remove it and release 2-3 drops on different areas of your face, pat and then blend it into your skin.</li>\r\n	<li>Dull, dry skin? Try our new Pond&#39;s Bright Beauty Vitamin C serum - infused with the goodness of lemon, green papaya and pomegranate extracts. Our serum feels light and non-greasy. Vitamin C is known for multiple benefits: 1. Helps promote collagen production 2. It is known to decrease melanin formation, thereby reducing pigmentation 3. It is known as a potent antioxidant that can neutralize and remove toxic oxidants 4. It helps promote healthy skin Our Vitamin C serum comes in a dark glass bottle which helps protect it from light exposure too. Pond&#39;s Bright Beauty Vitamin C serum helps offers 7 skin benefits: i. Makes skin feel moisturized ii. Gives glowing skin iii. Feels lightweight iv. Feels non-greasy v. Feels skin texture improves vi. Makes skin feel nourished vii. Makes skin feel smooth How to use: Gently apply a small amount of this face serum on your cleansed face and neck with either your fingertips or palms. Gently massage in circular movements until serum is absorbed into your skin. Use a serum post your face wash and before you apply a moisturizing/brightening cream. Serums are light and fast absorbing. Apply the serum by taking 2-3 drops, blend and pat it into your skin. For best results, use day and night. Pair this with the Pond&#39;s Bright Beauty face wash &amp; Pond&#39;s Bright Beauty day cream for a spot-less glow routine.</li>\r\n</ul>\r\n', '5', ''),
