('2416', '3', '15', 'Shahnaz Husain 24 carat gold kit ', 'Shahnaz-husain-24-carat-gold-kit--723613', '', 'Inactive', 'Skin Type:All\r\n<div>Product Benefits:The Gold Skin Radiance kit is a sensational innovation in achieving skin beauty and radiance. Comprising of age-defying pure gold scrub, gold mask, gold gel and moisturising cream, it purifies revitalizes and rejuvenates the skin, giving it a youthful and golden glow.</div>\r\n\r\n<div>Active Ingredients:This facial kit contains orange peel extracts, rose water, aloe vera, gold leaf, dates, and honey, for a smoother and glowing skin. It is a 40g mini kit. It contains 24 carat pure gold, giving skin a radiant look.</div>\r\n', '', '', '', '1010', '2', '<ul>\r\n	<li>The gold skin radiance kit is a sensational innovation in achieving skin beauty and radiance</li>\r\n	<li>It improves the texture to impart glowing and beautiful complexion.</li>\r\n</ul>\r\n', '5', ''),
