('2418', '3', '15', 'Shahnaz Husain 5 step papaya facial kit  ', 'Shahnaz-5-step-papaya-facial-kit--512420', '', 'Inactive', 'Skin Type:Normal', '', '', '', '250', '2', '<ul>\r\n	<li>A powerful combination of products that help to reduce scars and blemishes, ensuring smooth, even and healthy skin</li>\r\n	<li>Needs to applied twice in a day</li>\r\n	<li>Cleanse face with PROFESSIONAL POWER BIO HYDRATING CLEANSER. Apply and wipe with moist cotton wool. Apply EXFOLIATING SCRUB and rub gently with small circular movements. Wash off. Apply PAPAYA NOURISHING CREAM on face and neck and massage for 15 minutes with a little water. Apply PAPAYA FACE PACK, avoiding the lips and area around eyes. Wash off when dry. Apply PAPAYA MOISTURISER and leave on.</li>\r\n	<li>Shahnaz Husain''s Papaya Mini Kit comprises of products for an entire skin care routine. They contain combinations of plant extracts known for their beauty enhancing properties. Professional Power Bio Hydrating Cleanser: A powerful natural cleanser for the easy and efficient removal of impurities, without disturbing the moisture balance. Prepares the skin for facial massage and treatments Exfoliating Scrub: A powerful deep cleansing treatment, removing dead cells and making the skin appear clear, smooth and free from blemishes. Papaya Nourishing Cream: Containing papaya extract, rich in natural enzymes, in combination with other plant extracts, it nourishes and revitalizes the skin, making it soft, smooth, radiant and youthful. Papaya Face Pack: A vitamin rich combination of natural extracts of papaya, pumpkin and rose, it tightens the pores and improves skin texture, lending a youthful radiance. Papaya Moisturiser: Papaya and pumpkin extracts have been combined with powerful natural rehydrants like aloe vera and rose, to restore the moisture balance and impart a healthy glow.</li>\r\n</ul>\r\n', '5', ''),
