('2420', '3', '15', 'Shahnaz Husain Fairy one natural glow fairness cream  ', 'Shahnaz-fairly-one-natural-glow-cream-50g--759795', '', 'Inactive', 'Product Benefits:Moisturizing\r\n<div>Skin Type:All</div>\r\n\r\n<div>Item Form:Cream</div>\r\n\r\n<div>Specific Uses For Product:Sunburn, Nourishment, Pigmentation</div>\r\n', '', '', '', '95', '2', '<ul>\r\n	<li>Fair One Plus Natural Fairness Cream - 50 GM : It is a fairness cream that moisturizes and nourishes the skin</li>\r\n	<li>Keeping it soft, smooth, glowing, and the skin noticeably fair over a period of time. It has a unique blend of herbal ingredients like rose, aloe vera, cucumber, wheat-germ oil, bearberry, grapeseed & saffron</li>\r\n	<li>Direction to Use : Apply on face, neck and arms daily twice.</li>\r\n	<li>It acts as a natural sun filter that prevents pigmentation and protects the skin from sunburn.</li>\r\n	<li>UV Protected</li>\r\n	<li>Fair One Plus Natural Fairness Cream is a Herbal Fairness Cream containing plant extracts and oils. A unique blend of herbal ingredients like Rose, Aloe Vera, Cucumber, Wheat germ oil, Bearberry, Grape Seed & Saffron, and this Ayurvedic Fairness Cream makes the skin noticeably fairer over a period of time. The natural sun-filters in this herbal fairness cream prevent pigmentation and protect the skin from sunburn. This Shahnaz Ayurvedic Fairness cream also moisturizes and nourishes the skin, keeping it soft, smooth and glowing. Fair One Plus Natural Fairness Cream not only makes your skin noticeably fairer, it also protects your skin from sunburn leaving it soft, young and glowing. DIRECTIONS FOR USE: Apply on face, neck and arms twice daily.</li>\r\n</ul>\r\n', '5', ''),
