('2534', '3', '15', 'Vicco Aloevera Face Wash Soft,Smooth & Healthy Skin ', 'Vicco-aloevera-face-wash-70g--194321', '', 'Active', 'When you speak about Aloe Vera, what is the first thing that comes to the mind? The answer to that is a &ldquo;Good skin care.&rdquo;\r\n<div>&nbsp;</div>\r\n\r\n<div>Giving your body a gentle care with the touch of nature is the treatment you need. Vicco gives you the same benefits of nature through &ldquo;Vicco Aloe Vera Facewash.&rdquo;</div>\r\n', 'Vicco', '', '', '103', '2', '<ul>\r\n	<li>&nbsp;The product contains essential antioxidant and antibacterial properties</li>\r\n</ul>\r\n\r\n<div>* Aloe vera accelerates wound healing</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>* Keeps your skin hydrated all day long</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>* The cooling and soothing properties of Aloe Vera help give you soft, smooth and healthy skin.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>* It is suitable for all skin types.</div>\r\n', '5', ''),
('2535', '3', '15', 'Vicco Turmeric Aloevera Skin Cream', 'Vicco-Aloevera-skin-cream-15g--172902', '', 'Active', 'Special Ingredients:Turmeric &amp; Aloe Vera\r\n<div>Product Benefits:Antioxidant, Inflammatory, Antiseptic na d makes skin Soft &amp; Supple</div>\r\n\r\n<div>Skin Type:All</div>\r\n\r\n<div>Item Form:Cream</div>\r\n', 'Vicco', '', '', '52', '2,2', '<ul>\r\n	<li>Turmeric Aloevera Cream an Ayurvedic Medicine, Prevent and cures Skin infection, inflammation, blamashes, Wounds and other skin disoredrs. It soothes boiles, pimples, acnes and burns.</li>\r\n</ul>\r\n', '5', ''),
('2536', '3', '15', 'Vicco Turmeric Skin Cream With Sandalwood Oil ', 'Vicco-turmeric-cream-70g--835818', '', 'Active', 'Skin Type:All\r\n<div>Product Benefits:Anti-Aging</div>\r\n\r\n<div>Special Ingredients:Almond Oil</div>\r\n', 'Vicco', '', '', '73', '2,2,2,2', '<ul>\r\n	<li>BENEFITS: VICCO TURMERIC AYURVEDIC SKIN CREAM makes skin healthier and its antiseptic properties heal and cure minor burns, cuts, scars and wounds.</li>\r\n	<li>FEATURES: Fight skin infections, inflammation, blemishes and other skin disorders with VICCO TURMERIC SKIN CREAM.</li>\r\n	<li>INGREDIENTS: Vicco Turmeric Skin Cream is a pleasant blend of turmeric with sandalwood oil which has a high medical significance.</li>\r\n	<li>USAGE: It nourishes your skin from within makes your skin healthier, blemish-free and beautiful. It prevents and cures skin infections, inflammation, blemishes, wounds, rashes, pimples, boils, dermatitis, allergic eruption and other skin disorders.</li>\r\n	<li>Vicco Turmeric Skin Ayurvedic Cream is a pleasant blend of turmeric with sandalwood oil which has a high medical significance. Turmeric is an integral part of each and every home in India for the past numerous generations. We at Vicco bring to you the qualities of turmeric in the form Turmeric Skin Cream. Being an Ayurvedic medicine it is safe without any side effects. Fight skin infections, inflammation, blemishes and other skin disorders with VICCO TURMERIC SKIN CREAM.</li>\r\n</ul>\r\n', '5', ''),
('2537', '3', '15', 'Vicco Turmeric Face Wash Fights Acne&Pimple, Healthy&Clear Skin', 'Vicco-turmeric-Wash-70g--380029', '', 'Active', 'The Vicco Turmeric Face Wash with Foam BaseIf helps you tackle various skin problems such as pimples, oily skin, blackheads and more. It helps you get the clear, healthy and naturally glowing skin that you have always desired. Wash off dirt and all impurities from your skin with every wash and restore your beauty naturally. This facewash is now available in a combo pack.', 'Vicco', '', '', '86', '2', '<ul>\r\n	<li>Fights pimples and skin infections</li>\r\n</ul>\r\n\r\n<div>* Clears pores and removes blackheads</div>\r\n\r\n<div>* Accelerates skin cell renewal</div>\r\n\r\n<div>* Removes tan and lightens dark circles and spots</div>\r\n\r\n<div>* Its antifungal properties help in curing minor wounds, cuts and small skin injuries as well</div>\r\n\r\n<div>* Deep cleans and gives your skin and gives it a renewed glow.</div>\r\n', '5', ''),
('2538', '3', '15', 'Vicco Turmeric WSO Skin Cream', 'Vicco-wso-15g--485824', '', 'Active', 'Product Benefits:Blemishes Treatment\r\n<div>Skin Type:Dry</div>\r\n\r\n<div>Item Form:Cream</div>\r\n\r\n<div>Specific Uses For Product:Inflammation.</div>\r\n', 'Vicco', '', '', '33', '2,2,2', '<ul>\r\n	<li>Turmeric Is A Wonderfully Versatile Root That Has Been In Every Indian Household For Centuries</li>\r\n	<li>This Luxurious Cream Vanishes Into Your Skin And Starts Working Its Magic From Within</li>\r\n	<li>From Queens To Commoners, Turmeric Has Been Indispensable As A Skin-Care Preparation And Grooming Aid For Every Woman. This Is Because 63% Of The Body Functions Are Said To Be Controlled By The Skin Alone. Vicco Has Combined The Goodness Of Turmeric Which Is Said To Prevent The Penetration Of Ultra Violet Rays Of The Sun Into The Skin And Thus Maintains The Original Color Of The Pigment Of The Skin, With The Richness Of Pure Sandalwood Oil Which Is Supposed To Be The Most Cooling Element In Vicco Turmeric Cream. This Luxurious Cream Vanishes Into Your Skin And Starts Working Its Magic From Within.</li>\r\n</ul>\r\n', '5', ''),
('2539', '3', '15', 'VLCC Almond Under Eye Cream  ', 'vlcc-almond-under-eye-cream--546137', '', 'Active', 'Special Ingredients:Almond Oil\r\n<div>Product Benefits:Anti-Acne</div>\r\n\r\n<div>Material Type Free:Paraben Free</div>\r\n\r\n<div>Skin Type:Combination</div>\r\n', 'Vlcc', '', '', '228', '2', '<ul>\r\n	<li>Item Form: Cream</li>\r\n	<li>Removes dark circles</li>\r\n	<li>Store in cool and dry place</li>\r\n	<li>Skin Type: Suitable for all skin types</li>\r\n	<li>Usage: Apply appropriate amount from the inside of the eye contour to the outside, gently massage the eye contour area with your ring finger Suits all skin types. For best results, use twice a day after cleansing the face.</li>\r\n	<li>Target Audience: Men.</li>\r\n</ul>\r\n', '5', ''),
('2540', '3', '15', 'VLCC Anti Tan Facial Kit', 'Vlcc-Anti-Tan-facial-Kit-60g--954484', '', 'Active', 'Skin Type:Combination\r\n<div>Product Benefits:Cleansing</div>\r\n\r\n<div>Material Type Free:Oil Free</div>\r\n\r\n<div>Active IngredientsIngredients: Oatmeal ; Cucumber ; Pistachio ; Winter Cherry</div>\r\n', 'Vlcc', '', '', '285', '2', '<ul>\r\n	<li>Helps reduce the effect of UV rays on your skin</li>\r\n	<li>Suitable for all skin types</li>\r\n	<li>Usage: Step 1: Comfrey Cleanser cum Toner Deeply cleanse your skin, minimize the pores and make your skin ready for facial Step 2: Oatmeal Scrub This powder based scrub enriched with Oatmeal helps in exfoliating the skin &amp; gently removes blackheads &amp; white patches. Step 3: Melawhite Gel: Enriched with Cucumber &amp; Aloe Vera, helps to breakdown dead cells and reduces sun tan while keeping the skin soft &amp; hydrated.</li>\r\n	<li>Step 4: Pista Massage Cream Multi-action cream, with the goodness of pistachio &amp; nutmeg, gives the skin cellular protection &amp; a youthful glow. Step 5: Melawhite Pack This pack has wintercherry&amp; aloe vera extracts which brightens, lightens &amp; evens out dull, patchy &amp; damaged skin. Step 6: Oil Free Moisturising Gel: Moisturises your skin, while SPF 15 with PA+ protects from harmful UVA &amp; UVB rays.</li>\r\n	<li>Ideal Usage: All Day; Target Audience: Men &amp; Women.</li>\r\n</ul>\r\n', '5', ''),
('2541', '3', '15', 'VLCC Ayurveda Vitamin E Soothing Aloe Vera Gel', 'Vlcc-ayurveda-aloe-vera-gel-100g--142273', '', 'Active', 'Skin Type:Dry Skin\r\n<div>Product Benefits:Soothing</div>\r\n\r\n<div>Special Ingredients:Aloe Vera</div>\r\n', 'Vlcc', '', '', '100', '2', '<ul>\r\n	<li>Healthy skin</li>\r\n	<li>Glowing and supple skin</li>\r\n	<li>Firms ups the skin cells.</li>\r\n</ul>\r\n', '5', ''),
('2542', '3', '15', 'VLCC Activated Bamboo Charcoal Facial Kit', 'Vlcc-bamboo-charcoal-facial-kit-60g--470626', '', 'Active', 'Skin Type:Normal\r\n<div>Product Benefits:Cleansing</div>\r\n\r\n<div>Material Type Free:Paraben Free</div>\r\n\r\n<div>Special Ingredients:Clove</div>\r\n', 'Vlcc', '', '', '333', '2', '<ul>\r\n	<li>The activated charcoal helps to purify and detoxify skin deeply for a beautiful glowing skin</li>\r\n	<li>Vitamin B3 reduces wrinkles, provides even skin tone and reduces hyper pigmentation</li>\r\n	<li>Nutmeg oil, clove oil &amp; neem bark powder extract help to reduce pore size and eliminate blackheads</li>\r\n	<li>Paraben free, hence completely safe</li>\r\n	<li>Salicylic Acid as a content percentage of 1.85% ww as an ingredient.</li>\r\n</ul>\r\n', '5', ''),
('2543', '3', '15', 'VLCC Pro Radiance Brightening Face Wash', 'Vlcc-brightening-face-wash-100ml--700509', '', 'Inactive', 'Skin Type:All\r\n<div>Item Form:Gel</div>\r\n\r\n<div>Use for:Face</div>\r\n\r\n<div>Age Range :Adult</div>\r\n', 'Vlcc', '', '', '200', '2', '<ul>\r\n	<li>Instantly cleanses & brightens the skin</li>\r\n	<li>Pro Radiance Brightening Face Wash is formulated with a unique D-White Complex that instantly cleanses & brightens the skin, keeping the skin moisture intact. Enriched with natural fruits extract, Acai Berry & Nutmeg Oil that reduces melanin production and lightens the dark spots.</li>\r\n</ul>\r\n', '5', ''),
('2544', '3', '15', 'VLCC Pro Radiance Brightening Gel Mask', 'Vlcc-brightening-gel-mask-80g--896915', '', 'Active', 'Product Benefits:Radiance\r\n<div>Item Form:Gel</div>\r\n', 'Vlcc', '', '', '276', '2', '<ul>\r\n	<li>It Helps to cleanses pores, removes tan, dullness and dark spots.</li>\r\n	<li>Pro Radiance Brightening Gel Mask is a unique gel formulation enriched with D-White Complex that comes with natural actives of Acai Berry Extracts & Nutmeg Oil that cleanses pores, removes tan, dullness, dark spots and makes your skin glow naturally without any dryness.</li>\r\n</ul>\r\n', '1', ''),
('2545', '3', '15', 'VLCC Pro Radiance Brightening Serum ', 'Vlcc-brightening-serum-30ml--243743', '', 'Active', 'Skin Type:All\r\n<div>Product Benefits:Hydrating, Brightening</div>\r\n\r\n<div>Active Ingredients:Nutmeg</div>\r\n', 'Vlcc', '', '', '428', '2', '<ul>\r\n	<li>Rejuvenates skin and reduce dark spots</li>\r\n	<li>Enriched with Acai Berry Extract and nutmeg oil</li>\r\n	<li>Enriched with powerful antioxidants</li>\r\n	<li>Hydrates the skin, boots radiance</li>\r\n	<li>Suitable for all skin types</li>\r\n	<li>Pro Radiance Brightening Serum is formulated with micro-actives of D-White Complex designed to nourish, rejuvenate &amp; lightens dark spots and give a radiant tone to the skin. It is enriched with natural fruit extract of Acai Berry &amp; Nutmeg Oil that reduces melanin production and brightens &amp; lightens the skin tone.</li>\r\n</ul>\r\n', '5', ''),
('2546', '3', '15', 'VLCC Lovable Lips Cherry Lip Balm  ', 'Vlcc-cherry-lip-balm--930240', '', 'Active', 'Flavour:Cherry\r\n<div>Product Benefits:Shining</div>\r\n\r\n<div>Sun Protection:15 SPF</div>\r\n\r\n<div>Item Form:Balm</div>\r\n', 'Vlcc', '', '', '142', '2', '<ul>\r\n	<li>With spf 15</li>\r\n	<li>Beautiful colour</li>\r\n	<li>Glossy shine</li>\r\n	<li>Enriched with jojoba oil, almond oil and vitamin e</li>\r\n	<li>Water resistant</li>\r\n	<li>A cherry-flavored, tinted lip balm infused with the goodness of Jojoba Oil that dresses and caresses your pout in one sweep to make it luscious, lovely and lovable. Pronounced as ho-ho-ba, jojoba oil is one of the richest natural conditioners that the tropical forests have to offer. It has numerous beauty benefits and is perhaps the best known plant-based lip hydrater and soother. Jojoba oil, which is chemically similar to skin&rsquo;s natural oil, heals chapped lips and seeps in to restore moisture and texture from within smooth, supple lips. VLCC has whisked together the benefits of this vitamin E-rich oil with nourishing almond oil and SPF to create this range of delectable sun-safe, pout perfectors in 6 pretty hues.</li>\r\n</ul>\r\n', '5', ''),
