('2654', '3', '15', 'Garnier Hydra Bomb Serum Mask', 'Garnier-Hydra-Bomb-037149', '', 'Active', 'Skin Type:Oily\r\n<div>Product Benefits:Hydrating, Fine Lines Treatment, Smoothing, Detoxifying</div>\r\n\r\n<div>Active Ingredients:Hyaluronic acid</div>\r\n\r\n<div>Item Form:Sheet</div>\r\n', 'Garnier ', '', '', '94', '2', '<ul>\r\n	<li>Garnier tissue face masks provide your skin with deep hydration</li>\r\n	<li>Hydra Bomb Sheet Mask is enriched with green tea extracts</li>\r\n	<li>Perfect for oily skin</li>\r\n	<li>Instantly hydrates the skin and also purifies it</li>\r\n	<li>Reduce dark circles with a bomb of cooling hydration in just 15 mins</li>\r\n	<li>Contains orange juice and hyaluronic acid.</li>\r\n</ul>\r\n', '5', ''),
