('2656', '3', '15', 'Garnier Sakura Glow Hyaluron Serum Mask', 'Garnier-Sakura-487510', '', 'Active', 'Skin Type:All\r\n<div>Product Benefits:Hydrating</div>\r\n\r\n<div>Material Type Free;Petroleum Free</div>\r\n\r\n<div>Active Ingredients:Japanese Sakura &amp; Hyaluronic Acid</div>\r\n', 'Garnier ', '', '', '94', '2', '<ul>\r\n	<li>Garnier tissue face masks provide your skin with deep hydration</li>\r\n	<li>Garnier Sakura White Sheet Mask is enriched with Japanese Sakura flower extracts</li>\r\n	<li>Perfect for de-hydrated and dry skin</li>\r\n	<li>Instantly hydrates the skin and gives it a pinkish glow in just 15 minutes</li>\r\n	<li>Suitable for all skin types, including sensitive skin</li>\r\n	<li>Instantly hydrates the skin and gives it a pinkish glow in just 15 minutes. Perfect for de-hydrated and dry skin.</li>\r\n</ul>\r\n', '5', ''),
('2657', '3', '15', 'Garnier Bright Complete Vitamin C Serum Cream', 'Garnier-Bright-Complete-Cream-851930', '', 'Active', 'Colour:Single, 45g\r\n<div>Item Form:Cream</div>\r\n\r\n<div>Product Benefits:Brightening</div>\r\n\r\n<div>Skin Tone:All</div>\r\n', 'Garnier ', '', '', '189', '2,2', '<ul>\r\n	<li>Garnier Light Complete is a brightening face cream for women</li>\r\n	<li>Is enriched with Yuzu Lemon &amp; Vitamin C serum</li>\r\n	<li>Gives spot-less, brighter skin in 1 week</li>\r\n	<li>Reduces dark spots, pimple spots and sun spots</li>\r\n	<li>Target Gender: Female.</li>\r\n</ul>\r\n', '5', ''),
('2658', '3', '15', 'Garnier Bright Complete Vitamin C Yoghurt Night Cream', 'Garnier-Bright-Complete-Night-Cream-234167', '', 'Active', 'Skin Type:All\r\n<div>Product Benefits:Brightening</div>\r\n\r\n<div>Material Type Free:Paraben Free</div>\r\n\r\n<div>Special Ingredients:YOUGHUT NIGHT CREAM</div>\r\n', 'Garnier ', '', '', '185', '2,2', '<ul>\r\n	<li>GET BRIGHTER SKIN FROM THE FIRST NIGHT: The Garnier Skin Naturals Bright Complete Vitamin C Yoghurt Night Cream is a lightweight night cream that absorbs into your skin without being too greasy or oily.</li>\r\n	<li>It is formulated with VITAMIN C, LEMON ESSENCE, YOGHURT BIFIDUS AND WHITESPEED SERUMTM which help in reducing dark spots and evening out the skin tone.</li>\r\n	<li>The brightening cream exfoliates dead cells and BRIGHTENS THE SKIN OVERNIGHT while you get your beauty sleep.; The VITAMIN C cream helps in skin brightening at night and gives you bright and glowing skin in the morning.</li>\r\n	<li>It&#39;s YOGHURT-like texture gives the Night Cream an ultra-light texture absorbs quickly into your skin layers.</li>\r\n	<li>Target Gender: Unisex.</li>\r\n</ul>\r\n', '5', ''),
('2659', '3', '15', 'Garnier Bright Complete 30x Vitamin C Booster Serum', 'Garnier-Bright-Complete-Serum-594230', '', 'Active', 'Skin Type:All\r\n<div>Product Benefits:The lightweight and non-oily formula instantly penetrates into the skin to give you an INSTANT GLOW and REDUCE SPOTS IN 3 DAYS**</div>\r\n\r\n<div>Active Ingredients:Vitamin c</div>\r\n', 'Garnier ', '', '', '237', '2,2', '<ul>\r\n	<li>Face serum suitable for all skin types</li>\r\n	<li>Instantly combats a dull skin tone and reduces dark spots when used regularly</li>\r\n	<li>How to use: Cleanse skin using a face wash, Apply 3-4 drops of serum and spread evenly over the face and neck using gentle tapping motions, Use twice a day and follow up with moisturising creams</li>\r\n	<li>Enriched with lemon extracts and 30 times the amount of Vitamin C of Garnier&#39;s Bright Complete face creams to combat dark spots.</li>\r\n</ul>\r\n', '5', ''),
('2660', '3', '15', 'Garnier Bright Complete Vitamin C Serum Cream Spf40', 'Garnier-Bright-Complete-Cream-Spf40-693142', '', 'Active', 'Skin Type:Combination\r\n<div>Product Benefits:Brightening</div>\r\n\r\n<div>Material Type Free:Oil Free</div>\r\n\r\n<div>Active Ingredients:Yuzu Lemon &amp; 3X Vitamin C Serum</div>\r\n', 'Garnier ', '', '', '224', '2', '<ul>\r\n	<li>Serum cream for all skin types</li>\r\n	<li>Reduces dark spots and gives the skin a bright, natural glow</li>\r\n	<li>How to use: Cleanse face with a face wash and apply a face serum, Apply day cream evenly over the face and neck in the morning.</li>\r\n</ul>\r\n', '5', ''),
