('2730', '5', '34', 'Horlicks Womens Plus Chocolate Flavour Refil', 'Horlicks-Womens-Plus-Chocolate-Flavour-Refil-290815', '', 'Active', 'Bones form the structural framework of the human body. Up until the age of 30, bone formation is faster than bone loss, which causes the skeleton to grow both in size and density, resulting in an overall increase in bone mass. After the age of 30, bone mineral density may start to decrease. Unfortunately, there are no visible signs of weak bones. They often go unnoticed over many years, with no symptoms or discomfort until a bone breaks. To maintain strong bones you don&rsquo;t just need an adequate intake of Calcium, but also Vitamin D for Calcium absorption and Vitamin K2 for binding Calcium to bones, daily. Remember, Vitamin K2 is not commonly found in the Indian diet, and Vitamin D is not even available in your daily diet. Horlicks Women&rsquo;s Plus is a bone nutrition specialist powered with CALSEAL formula. It provides 100% RDA of Calcium, Vitamin D &amp; Vitamin K2 requirements. NIH Osteoporosis and related bone diseases national resource center. Ref: Malhotra N and Mithal A. Osteoporosis in Indians. Indian J med res 127, march 2008, pp 263-268 Unique combination of Vitamin K2, Calcium and Vitamin D to support bone health. In 2 serves (60 g) as per ICMR 2010 Guidelines on Women. Added sugar refers to Sucrose.&#39;CONTAINS NATURALLY OCCURRING SUGARS&#39;. Horlicks Women&rsquo;s Plus is a nourishing beverage to be consumed as a part of regular diet.', 'Horlicks ', '', '', '344', '2', '<ul>\r\n	<li>Calseal Formula</li>\r\n	<li>Bone Nutrition Specialist</li>\r\n	<li>Nutrients For Strong Bones</li>\r\n	<li>100% Rda Of Calcium, Vitamins D &amp; K2</li>\r\n	<li>Clinically proven~ to help improve bone strength in 6 months</li>\r\n	<li>item_volume:400 g.</li>\r\n</ul>\r\n', '4', ''),
