('2745', '7', '91', 'Jovees Herbal Coffee Exfoliating Lip scrub', 'Jovees-Herbal-Coffee-Exfoliating-Lip-scrub-869372', '', 'Active', 'Gentle scrub that exfoliates and helps brighten darkened lips. Coffee Oil is a rich source of Caffeine that helps to reduce pigmentation and helps to brighten darkened lips. It leaves your lips soft &amp; supple.&nbsp;', 'Jovees', '', '', '166', '2', '<ul>\r\n	<li>Hydrates and soothes.&nbsp; &nbsp;&nbsp;</li>\r\n	<li>Leave lips feeling soft &amp; smooth.&nbsp; &nbsp;&nbsp;</li>\r\n	<li>Helps to restore skins moisture barrier.&nbsp; &nbsp;&nbsp;</li>\r\n	<li>Dermatologically tested.</li>\r\n</ul>\r\n', '1', ''),
('2746', '7', '91', 'Jovees Revita Ageing Skin Recovery Cleansing Gel', 'Jovees-Revita-Ageing-Skin-Recovery-Cleansing-Gel-362095', '', 'Active', 'Skin Type:All\r\n<p>Item Form:Gel</p>\r\n\r\n<p>Scent:Herbal</p>\r\n\r\n<p>Age Range :Adult</p>\r\n', 'Jovees', '', '', '204', '2', '<ul>\r\n	<li>Benefits: Jovees Revita Ageing Cleansing Gel is a mild cleanser that removes impurities from the skin without making it dry. Increase Skin firmness, Reduces the appearance of fine lines and wrinkles, has strong anti- aging action giving smoother, firmer and more radiant looking skin.</li>\r\n	<li>Ingredients: Bio-retinol (Biden pilosa extract, Elaeis guinensis oil, Gossypium herbaceum seed oil, Linum usitatissimum oil), Pomegranate extract, Aloe vera juice, Grape seed extract, Olivem-400, Carbomer, Decyl glucoside, Lauryl glucoside, Coco amido propyl betain, Glycerin, Phenoxyethanol, Parfum, Sodium hydroxide, Potassium sorbate, Purified water.</li>\r\n	<li>Use instruction: Squeeze out a small amount on your palm. Massage gently on the face and neck. Rinse well and pat dry.</li>\r\n	<li>Safety Precaution: For External Use Only</li>\r\n	<li>Shelf life in months: 36 Months.</li>\r\n</ul>\r\n', '3', ''),
('2747', '7', '91', 'Jovees Revita Ageing Skin Recovery Face Mask ', 'Jovees-Revita-Ageing-Skin-Recovery-Face-Mask-416300', '', 'Active', 'Skin Type:All\r\n<p>Item Form:Paste</p>\r\n\r\n<p>Scent:Herbal</p>\r\n\r\n<p>Age Range: Adult</p>\r\n', 'Jovees', '', '', '252', '2', '<ul>\r\n	<li>Benefits: Jovees Revita Ageing Face Mask reduces signs of aging. Made from ingredients derived from plants, it is milder to skin. It provides a soothing effect to the skin. It reduces hyperpigmentation and treats age spots. Rich in antioxidants, it leaves your face feeling smooth and firm.</li>\r\n	<li>Ingredients: Bio-retinol (Biden pilosa extract, Elaeis guinensis oil, Gossypium herbaceum seed oil, Linum usitatissimum oil), Hyaluronic acid, Pomegranate extract, Aloe vera extract, Grape seed extract, Olive oil, Jojoba oil, Wheat germ oil, Cetyl alcohol, Light Kaolin, Bentonite, Zinc oxide, Titanium dioxide, Capric Caprylic Triglyceride, Glycerin, Allantoin, Xanthan gum, parfum, Phenoxyethanol &amp; Ethyl hexyl glycerin, Sodium benzoate, Purified water.</li>\r\n	<li>Use instruction: Apply evenly all over face and neck. Leave on for 15-20 minutes. Rinse with plain water. Use twice a week for best results.</li>\r\n	<li>Safety Precaution: For External Use Only</li>\r\n	<li>Shelf life in months: 36 Months.</li>\r\n</ul>\r\n', '2', ''),
('2748', '7', '91', 'Jovees Revita Ageing Skin Recovery Serum', 'Jovees-Revita-Ageing-Skin-Recovery-Serum-004937', '', 'Active', 'Jovees Revita Ageing&reg; Bio-Retinol Skin Recovery Serum is a fast absorbing, all-natural, oil-free formula. Made with Ecocert Certified Plant-Based 2% Bio-Retinol, 1.2% Hyaluronic Acid, Pomegranate extract and a blend of naturally derived herbal extracts, it helps tighten the skin, making it plumper, firming the skin, helps reduce fine lines by improving skin elasticity &amp; making it look younger by boosting collagen production that protects the skin from free radical damages. An excellent recipe for ever-youthful skin.', 'Jovees', '', '', '537', '2', '<ul>\r\n	<li>Jovees Revita Ageing Skin Recovery Serum reduces age spot fine lines, wrinkles, and hyperpigmentation.</li>\r\n	<li>It penetrates the deepest layer of the skin in 4 hours and helps keeping the skin hydrated for 24 hours.</li>\r\n	<li>Light and controls skin barrier.</li>\r\n	<li>Suitable for all skin types.</li>\r\n</ul>\r\n', '2', ''),
('2749', '7', '91', 'Jovees Revita Ageing Skin Recovery Cream', 'Jovees-Revita-Ageing-Skin-Recovery-Cream-943175', '', 'Active', 'Product Benefits:Hydrating', 'Jovees', '', '', '432', '2', '<ul>\r\n	<li>Jovees Revita Ageing Skin Recovery Cream reduces fine lines, wrinkles, and hyperpigmentation. It penetrates the deepest layer of the skin in 4 hours and helps keeping the skin hydrated for 24 hours , lightens pigmentation and fight signs of aging. Suitable for all skin types.</li>\r\n</ul>\r\n', '2', ''),
('2750', '7', '91', 'Jovees Himalayan Cherry Pro Collagen Body Lotion', 'Jovees-Himalayan-Cherry-Pro-Collagen-Body-Lotion-961504', '', 'Active', 'Special Ingredients:Glycerin, Hemp Seed Oil, Olive Oil\r\n<p>Product Benefits:Hydrating</p>\r\n\r\n<p>Material Type Free:Paraben Free</p>\r\n\r\n<p>Skin Type:Dry</p>\r\n', 'Jovees', '', '', '356', '2', '<ul>\r\n	<li>all skin types</li>\r\n	<li>parabeen free</li>\r\n	<li>Rich in antioxidants, Himalayan Cherry hydrates and softens dry skin, replenishes the skin&#39;s natural moisture barrier, and fights the signs of ageing. Perfect for 30 and above age group, this lotion is packed with the goodness of many botanical extracts that work to clarify, brighten, tighten, and deeply nourish your skin.</li>\r\n</ul>\r\n', '2', ''),
('2751', '7', '91', 'Jovees Cocoa Butter Ultra Rich Body Lotion', 'Jovees-Cocoa-Butter-Ultra-Rich-Body-Lotion-218093', '', 'Active', 'Special Ingredients:Avocado Oil\r\n<p>Product Benefits:Lock in mosture</p>\r\n\r\n<p>Material Type Free:Paraben Free</p>\r\n\r\n<p>Skin Type:Acne, Dry</p>\r\n', 'Jovees', '', '', '356', '2', '<ul>\r\n	<li>Pamper your skin with this silky and lightweight body lotion comes with the goodness of cocoa butter. Packed with deep-moisture, heavenly chocolatey fragrance, and scar-healing properties, this lotion is perfect for cold and dry weather and to reduce the appearance of acne spots, pigmentation, and stretch marks.</li>\r\n</ul>\r\n', '3', ''),
('2752', '7', '91', 'Jovees Honey & Grapes Skin Revitalizing Body Lotion', 'Jovees-Honey-Grapes-Skin-Revitalizing-Body-Lotion-364829', '', 'Active', 'Protect your skin from the harsh tap water, synthetic soaps and extreme weather with this quick-absorbing lotion that keeps your skin soft, smooth and fresh for hours.', 'Jovees', '', '', '356', '2', '<ul>\r\n	<li>Honey nourishes and moisturises the dry and flaky skin.</li>\r\n	<li>Makes the skin soft and supple and gives the natural glow to the skin.</li>\r\n	<li>Grape seed oil helps the vitamin E and vitamin C in your skin to be more efficient and effective at preserving your skin.</li>\r\n</ul>\r\n', '2', ''),
('2753', '3', '15', 'Nivea Berry Shine Caring Lip Balm', 'Nivea-Berry-Shine-Caring-Lip-Balm-152980', '', 'Active', 'Flavour:Berry\r\n<div>Product Benefits:Softening, Smoothening, Shine</div>\r\n\r\n<div>Colour:Berry</div>\r\n\r\n<div>Item Form:Balm</div>\r\n', 'Nivea', '', '', '149', '2', '<ul>\r\n	<li>Item form solid</li>\r\n	<li>With delightful blackberry aroma</li>\r\n	<li>Open the cap and twist up the &shy;stick, apply to get moisturized smooth lips with a touch of colour, use whenever lips feel dry</li>\r\n	<li>Nivea blackberry shine lip care delights your lips with its delicious blackberry aroma, a fabulous shimmer and soft glossy colour. Pamper your lips with its gentle care and long lasting moisturization to get soft and smooth lips, Long lasting moisturization combined with delightful blackberry aroma and chosen pigments that leave a touch of colour on your lips with Nivea blackberry shine. Your lips care a lot for you, now it&rsquo;s your turn to care for them. Nivea blackberry shine is the new, exotic way to love your lips.</li>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n', '2', ''),
